\"Gravatar: Gravatar: Creating a Truly Global System\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.gravatar.com/?p=425\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"http://blog.gravatar.com/2013/01/14/gravatar-translations/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2100:\"<p>We can&#8217;t really call Gravatars &#8220;globally recognized avatars&#8221; unless they&#8217;re realistically available to people the world over, and that means making sure everyone who wants to use one has language access. That&#8217;s why Gravatar, like every Automattic joint, relies on a fantastic group of international volunteers to translate almost everything we create, ensuring that what we do is globally accessible.</p>\n<p>In the past few weeks, we&#8217;ve completed the <a href=\"http://fr.gravatar.com/\" target=\"_blank\">French</a> and <a href=\"http://ko.gravatar.com/\" target=\"_blank\">Korean</a> translations of en.gravatar.com, bringing the total number of available languages to 43, from <a href=\"http://ka.gravatar.com/\" target=\"_blank\">Georgian</a> to <a href=\"http://nb.gravatar.com/\" target=\"_blank\">Norwegian</a> to <a href=\"http://bn.gravatar.com/\" target=\"_blank\">Bengali</a>.</p>\n<p>(If you&#8217;ve never heard of <a href=\"http://ka.gravatar.com/\" target=\"_blank\">Georgian</a>, take a minute to click over &#8212; it&#8217;s a beautiful script!)</p>\n<p>If you visit any of the non-English Gravatar pages, you might still see some content in English &#8212; that&#8217;s because almost all these pages are works-in-progress. If you&#8217;d like to contribute to one of them, or start a translation for a language that&#8217;s not currently on the list, we&#8217;d love to have you! Just click on &#8220;help translate&#8221; next to any of the <a href=\"http://en.gravatar.com/site/translations/\" target=\"_blank\">currently available languages</a>, or visit the Gravatar GlotPress page to see exactly what still needs to be done, learn how to become a translator, and add your language to the list.</p>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/gravatar.wordpress.com/425/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/gravatar.wordpress.com/425/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=blog.gravatar.com&blog=1886259&post=425&subd=gravatar&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 14 Jan 2013 18:54:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:11:\"michelle w.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Weblog Tools Collection: WordPress Theme Releases for 1/14\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12524\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/