for 1/10\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12506\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/AfC9ZUVMuHw/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1260:\"<p><a href=\"http://blankthemes.com/customfolio/\"><img class=\"alignnone size-thumbnail wp-image-12507\" alt=\"screenshot\" src=\"http://i0.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot2.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://blankthemes.com/customfolio/\"><strong>CustomFolio</strong></a> is a simple, responsive theme for portfolio and or business sites.</p>\n<p><a href=\"http://emptynestthemes.com/2013/01/05/12497/\"><img class=\"alignnone size-thumbnail wp-image-12508\" alt=\"screenshot-1\" src=\"http://i1.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot-12.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://emptynestthemes.com/2013/01/05/12497/\"><strong>Night Class</strong></a> is a classic, elegant, and professional theme.</p>\n<p><a href=\"http://3oneseven.com/02/scuba-wp-theme/\"><img class=\"alignnone size-thumbnail wp-image-12509\" alt=\"screenshot-2\" src=\"http://i0.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot-21.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://3oneseven.com/02/scuba-wp-theme/\"><strong>Scuba</strong></a> is a responsive diving-style theme.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/AfC9ZUVMuHw\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 10 Jan 2013 14:00:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Dougal Campbell: Loopty-Loop\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"http://dougal.gunters.org/?p=72398\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"http://dougal.gunters.org/blog/2013/01/09/loopty-loop/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:14845:\"<div class=\"featured-image align-right\"><img width=\"240\" height=\"240\" src=\"http://maxcdn.gunters.org/wordpress/wp-content/uploads/2013/01/ouroboros-240x240.png?c9421e\" class=\"attachment-post-thumbnail wp-post-image\" alt=\"Image of an ouroborus, a serpent eating its own tail, representing self-reflexivity\" /></div><p>Herein is a cautionary tale about automated cross-posting between different social networking web services.</p>\n<p>Earlier this morning, I was checking Facebook from my phone, and saw a notification of someone Liking one of my entries. I clicked through to see what it was, and it was a link to a post here on this blog. Facebook didn&#8217;t have an excerpt, just a link, so I followed the link to my blog to see what it was. It turned out to just contain another link, which was a shortened URL, so I clicked through to see where it led. It turned out that it linked to <em>another</em> entry here on my blog. And that entry contained another link. Which led to <strong><em>another</em></strong> entry on my blog, again, with a link. A couple more levels deep, I eventually got to an entry that was an automated cross-post to my blog, generated by a checkin on Foursquare.</p>\n<p><span id=\"more-72398\"></span>About the time I was realizing what was happening, I got a notification from my phone that someone had mentioned me on Twitter. I switched over to TweetBot, and saw this:</p>\n<p><!-- tweet id : 289012784581206016 --><br />\n#bbpBox_289012784581206016 a { text-decoration:none; color:#2AA197; }#bbpBox_289012784581206016 a:hover { text-decoration:underline; }\n<div id=\"bbpBox_289012784581206016\" class=\"bbpBox\">\n<div><span>someone nearby there, please drive to @<a href=\"http://twitter.com/intent/user?screen_name=dougal\" class=\"twitter-action\">dougal</a> &#8216;s home and shoot his computer. if that doesn&#8217;t stop it &#8211; proceed to his hosting provider&#8230;</span>\n<div class=\"bbp-actions\"><img align=\"middle\" src=\"http://dougal.gunters.org/wordpress/wp-content/plugins/twitter-blackbird-pie//images/bird.png?c9421e\" /><a title=\"tweeted on January 9, 2013 9:16 am\" href=\"http://twitter.com/#!/Rarst/status/289012784581206016\" target=\"_blank\">January 9, 2013 9:16 am</a> via <a href=\"http://www.metrotwit.com/\" rel=\"nofollow\" target=\"blank\">MetroTwit</a><a href=\"https://twitter.com/intent/tweet?in_reply_to=289012784581206016&related=dougal\" class=\"bbp-action bbp-reply-action\" title=\"Reply\"><span><em></em><strong>Reply</strong></span></a><a href=\"https://twitter.com/intent/retweet?tweet_id=289012784581206016&related=dougal\" class=\"bbp-action bbp-retweet-action\" title=\"Retweet\"><span><em></em><strong>Retweet</strong></span></a><a href=\"https://twitter.com/intent/favorite?tweet_id=289012784581206016&related=dougal\" class=\"bbp-action bbp-favorite-action\" title=\"Favorite\"><span><em></em><strong>Favorite</strong></span></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=Rarst\"><img src=\"http://a0.twimg.com/profile_images/2761047576/cf0f7a568773c2f508e1f5b27d97de61_normal.jpeg\" /></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=Rarst\">@Rarst</a>\n<div>Andrey Savchenko</div>\n</div>\n<div></div>\n</div>\n</div>\n<p><!-- end of tweet --></p>\n<p>And there were other tweets, mentioning that I was spamming links, and people were starting to wonder if my server had been hacked. But I was already pretty certain I knew what was going on. I just didn&#8217;t know why it started happening at this particular time (and I still don&#8217;t, really).</p>\n<p><!-- tweet id : 288925135958851584 --><br />\n#bbpBox_288925135958851584 a { text-decoration:none; color:#0084B4; }#bbpBox_288925135958851584 a:hover { text-decoration:underline; }\n<div id=\"bbpBox_288925135958851584\" class=\"bbpBox\">\n<div><span>@<a href=\"http://twitter.com/intent/user?screen_name=dougal\" class=\"twitter-action\">dougal</a> Your importer (?) is making lots of Tweets like this.</span>\n<div class=\"bbp-actions\"><img align=\"middle\" src=\"http://dougal.gunters.org/wordpress/wp-content/plugins/twitter-blackbird-pie//images/bird.png?c9421e\" /><a title=\"tweeted on January 9, 2013 3:28 am\" href=\"http://twitter.com/#!/MacManXcom/status/288925135958851584\" target=\"_blank\">January 9, 2013 3:28 am</a> via <a href=\"http://tapbots.com/tweetbot\" rel=\"nofollow\" target=\"blank\">Tweetbot for iOS</a><a href=\"https://twitter.com/intent/tweet?in_reply_to=288925135958851584&related=dougal\" class=\"bbp-action bbp-reply-action\" title=\"Reply\"><span><em></em><strong>Reply</strong></span></a><a href=\"https://twitter.com/intent/retweet?tweet_id=288925135958851584&related=dougal\" class=\"bbp-action bbp-retweet-action\" title=\"Retweet\"><span><em></em><strong>Retweet</strong></span></a><a href=\"https://twitter.com/intent/favorite?tweet_id=288925135958851584&related=dougal\" class=\"bbp-action bbp-favorite-action\" title=\"Favorite\"><span><em></em><strong>Favorite</strong></span></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=MacManXcom\"><img src=\"http://a0.twimg.com/profile_images/2549926756/jameshat_normal.jpg\" /></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=MacManXcom\">@MacManXcom</a>\n<div>James Huff</div>\n</div>\n<div></div>\n</div>\n</div>\n<p><!-- end of tweet --></p>\n<p><!-- tweet id : 288949200497037313 --><br />\n#bbpBox_288949200497037313 a { text-decoration:none; color:#1BB0CE; }#bbpBox_288949200497037313 a:hover { text-decoration:underline; }\n<div id=\"bbpBox_288949200497037313\" class=\"bbpBox\">\n<div><span>@<a href=\"http://twitter.com/intent/user?screen_name=dougal\" class=\"twitter-action\">dougal</a> what&#8217;s with all the links?</span>\n<div class=\"bbp-actions\"><img align=\"middle\" src=\"http://dougal.gunters.org/wordpress/wp-content/plugins/twitter-blackbird-pie//images/bird.png?c9421e\" /><a title=\"tweeted on January 9, 2013 5:03 am\" href=\"http://twitter.com/#!/paul_wp/status/288949200497037313\" target=\"_blank\">January 9, 2013 5:03 am</a> via <a href=\"http://www.tweetdeck.com\" rel=\"nofollow\" target=\"blank\">TweetDeck</a><a href=\"https://twitter.com/intent/tweet?in_reply_to=288949200497037313&related=dougal\" class=\"bbp-action bbp-reply-action\" title=\"Reply\"><span><em></em><strong>Reply</strong></span></a><a href=\"https://twitter.com/intent/retweet?tweet_id=288949200497037313&related=dougal\" class=\"bbp-action bbp-retweet-action\" title=\"Retweet\"><span><em></em><strong>Retweet</strong></span></a><a href=\"https://twitter.com/intent/favorite?tweet_id=288949200497037313&related=dougal\" class=\"bbp-action bbp-favorite-action\" title=\"Favorite\"><span><em></em><strong>Favorite</strong></span></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=paul_wp\"><img src=\"http://a0.twimg.com/profile_images/2918786305/b5beb0169d9e04f5c7285951f2707705_normal.jpeg\" /></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=paul_wp\">@paul_wp</a>\n<div>Paul de Wouters</div>\n</div>\n<div></div>\n</div>\n</div>\n<p><!-- end of tweet --></p>\n<p><!-- tweet id : 288962635850985472 --><br />\n#bbpBox_288962635850985472 a { text-decoration:none; color:#FF3300; }#bbpBox_288962635850985472 a:hover { text-decoration:underline; }\n<div id=\"bbpBox_288962635850985472\" class=\"bbpBox\">\n<div><span>@<a href=\"http://twitter.com/intent/user?screen_name=dougal\" class=\"twitter-action\">dougal</a> I sense some recursive auto posting going on here&#8230; <img src=\"http://maxcdn.gunters.org/wordpress/wp-includes/images/smilies/icon_wink.gif?c9421e\" alt=\";)\" class=\"wp-smiley\" /> </span>\n<div class=\"bbp-actions\"><img align=\"middle\" src=\"http://dougal.gunters.org/wordpress/wp-content/plugins/twitter-blackbird-pie//images/bird.png?c9421e\" /><a title=\"tweeted on January 9, 2013 5:57 am\" href=\"http://twitter.com/#!/jan_dembowski/status/288962635850985472\" target=\"_blank\">January 9, 2013 5:57 am</a> via <a href=\"http://www.tweetdeck.com\" rel=\"nofollow\" target=\"blank\">TweetDeck</a><a href=\"https://twitter.com/intent/tweet?in_reply_to=288962635850985472&related=dougal\" class=\"bbp-action bbp-reply-action\" title=\"Reply\"><span><em></em><strong>Reply</strong></span></a><a href=\"https://twitter.com/intent/retweet?tweet_id=288962635850985472&related=dougal\" class=\"bbp-action bbp-retweet-action\" title=\"Retweet\"><span><em></em><strong>Retweet</strong></span></a><a href=\"https://twitter.com/intent/favorite?tweet_id=288962635850985472&related=dougal\" class=\"bbp-action bbp-favorite-action\" title=\"Favorite\"><span><em></em><strong>Favorite</strong></span></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=jan_dembowski\"><img src=\"http://a0.twimg.com/profile_images/3029824058/39bee8122e35ec6fc8aef2fab63d9f00_normal.jpeg\" /></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=jan_dembowski\">@jan_dembowski</a>\n<div>Jan Dembowski</div>\n</div>\n<div></div>\n</div>\n</div>\n<p><!-- end of tweet --></p>\n<p><!-- tweet id : 288962753618640896 --><br />\n#bbpBox_288962753618640896 a { text-decoration:none; color:#2FC2EF; }#bbpBox_288962753618640896 a:hover { text-decoration:underline; }\n<div id=\"bbpBox_288962753618640896\" class=\"bbpBox\">\n<div><span>@<a href=\"http://twitter.com/intent/user?screen_name=dougal\" class=\"twitter-action\">dougal</a> Uh oh.</span>\n<div class=\"bbp-actions\"><img align=\"middle\" src=\"http://dougal.gunters.org/wordpress/wp-content/plugins/twitter-blackbird-pie//images/bird.png?c9421e\" /><a title=\"tweeted on January 9, 2013 5:57 am\" href=\"http://twitter.com/#!/rmccue/status/288962753618640896\" target=\"_blank\">January 9, 2013 5:57 am</a> via web<a href=\"https://twitter.com/intent/tweet?in_reply_to=288962753618640896&related=dougal\" class=\"bbp-action bbp-reply-action\" title=\"Reply\"><span><em></em><strong>Reply</strong></span></a><a href=\"https://twitter.com/intent/retweet?tweet_id=288962753618640896&related=dougal\" class=\"bbp-action bbp-retweet-action\" title=\"Retweet\"><span><em></em><strong>Retweet</strong></span></a><a href=\"https://twitter.com/intent/favorite?tweet_id=288962753618640896&related=dougal\" class=\"bbp-action bbp-favorite-action\" title=\"Favorite\"><span><em></em><strong>Favorite</strong></span></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=rmccue\"><img src=\"http://a0.twimg.com/profile_images/1092157751/avatar_normal.jpeg\" /></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=rmccue\">@rmccue</a>\n<div>Ryan McCue</div>\n</div>\n<div></div>\n</div>\n</div>\n<p><!-- end of tweet --></p>\n<p><!-- tweet id : 288963280272244736 --><br />\n#bbpBox_288963280272244736 a { text-decoration:none; color:#1BB0CE; }#bbpBox_288963280272244736 a:hover { text-decoration:underline; }\n<div id=\"bbpBox_288963280272244736\" class=\"bbpBox\">\n<div><span>@<a href=\"http://twitter.com/intent/user?screen_name=rmccue\" class=\"twitter-action\">rmccue</a> @<a href=\"http://twitter.com/intent/user?screen_name=dougal\" class=\"twitter-action\">dougal</a> hacked account?</span>\n<div class=\"bbp-actions\"><img align=\"middle\" src=\"http://dougal.gunters.org/wordpress/wp-content/plugins/twitter-blackbird-pie//images/bird.png?c9421e\" /><a title=\"tweeted on January 9, 2013 5:59 am\" href=\"http://twitter.com/#!/paul_wp/status/288963280272244736\" target=\"_blank\">January 9, 2013 5:59 am</a> via <a href=\"http://www.tweetdeck.com\" rel=\"nofollow\" target=\"blank\">TweetDeck</a><a href=\"https://twitter.com/intent/tweet?in_reply_to=288963280272244736&related=dougal\" class=\"bbp-action bbp-reply-action\" title=\"Reply\"><span><em></em><strong>Reply</strong></span></a><a href=\"https://twitter.com/intent/retweet?tweet_id=288963280272244736&related=dougal\" class=\"bbp-action bbp-retweet-action\" title=\"Retweet\"><span><em></em><strong>Retweet</strong></span></a><a href=\"https://twitter.com/intent/favorite?tweet_id=288963280272244736&related=dougal\" class=\"bbp-action bbp-favorite-action\" title=\"Favorite\"><span><em></em><strong>Favorite</strong></span></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=paul_wp\"><img src=\"http://a0.twimg.com/profile_images/2918786305/b5beb0169d9e04f5c7285951f2707705_normal.jpeg\" /></a></div>\n<div><a href=\"http://twitter.com/intent/user?screen_name=paul_wp\">@paul_wp</a>\n<div>Paul de Wouters</div>\n</div>\n<div></div>\n</div>\n</div>\n<p><!-- end of tweet --></p>\n<p>(and so forth)</p>\n<p>So, here&#8217;s the rundown:</p>\n<ul>\n<li><span>I have a feature turned on in <a title=\"Dougal\'s Delicious bookmarks\" href=\"http://delicious.com/dougal\">my Delicious.com account</a> which sees when I post links on Twitter, and creates bookmarks for those links.</span></li>\n<li>On the <a href=\"http://ifttt.com/\">IFTTT</a> service, I have a recipe which takes new Delicious bookmarks, and creates link posts here on my WordPress blog.</li>\n<li>In WordPress, I had <a href=\"http://jetpack.me/\">JetPack</a> installed, with the &#8220;Publicize&#8221; feature set to post links to my new blog posts on <a href=\"https://twitter.com/dougal\">Twitter</a>, <a href=\"https://www.facebook.com/dougal.campbell\">Facebook</a>, and <a href=\"http://www.linkedin.com/in/dougal\">LinkedIn</a>.</li>\n</ul>\n<p>And thus, a loop: Link posted on Twitter, picked up by Delicious; Delicious bookmark picked up by IFTTT and posted to my blog; Blog post picked up by JetPack, and posted to Twitter; Link posted to Twitter, picked up by Delicious, etc.</p>\n<p>The mystery is why this suddenly started happening. Because I&#8217;ve had those services set up that way for some time now. My immediate solution was to disassociate the automatic cross-posting of new blog entries to other services from the JetPack Publicize feature. But what I may end up doing instead is to disable the monitoring of links on Twitter from my Delicious account, as that function was never as selective as what I really wanted.</p>\n<p>But do you want to know who I really blame for this? It&#8217;s Twitter. Do you know why? It&#8217;s because of a change they made to their terms and conditions a while back.</p>\n<p>You see, I used to only cross-post from Twitter to my blog via the IFTTT service, by having it watch for tweets I posted specifically with the hashtag &#8216;#moblog&#8217;. But changes that Twitter made to their terms caused IFTTT to remove a lot of their Twitter functionality. So, I started using the feature in Delicious which could automatically pick up links I posted to Twitter and create bookmarks from them, instead. But since there was no limiting factor (the hashtag), it opened the door for this cross-posting loop.</p>\n<p>So there you go: it&#8217;s all Twitter&#8217;s fault.</p>\n<p>&nbsp;</p>\n<p>Original Article: <a href=\"http://dougal.gunters.org/blog/2013/01/09/loopty-loop/\">Loopty-Loop</a>\n<a href=\"http://dougal.gunters.org\">Dougal Campbell&#039;s geek ramblings - WordPress, web development, and world domination.</a></p><div class=\"yarpp-related-rss yarpp-related-none\">\n<h3>Related posts:</h3>\n<img src=\"http://yarpp.org/pixels/5db43ee24c4f1e1d0e45d08cc91b0130\" />\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 09 Jan 2013 16:49:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Dougal Campbell\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"Matt: Qualcomm LOLs\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=42100\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"http://ma.tt/2013/01/qualcomm-lols/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:357:\"<p>&#8220;And now there&#8217;s a Rolls Royce. I would believe literally anything you told me was about to happen right now.&#8221; <a href=\"http://www.theverge.com/2013/1/8/3850056/qualcomms-insane-ces-2013-keynote-pictures-tweets\">This Verge post on Qualcomm&#8217;s insane CES 2013 keynote</a> is the funniest thing I&#8217;ve read or seen all year. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 09 Jan 2013 14:52:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"Weblog Tools Collection: WordPress 3.6 Areas of Focus\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12498\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/U6MdhjxQeSc/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2133:\"<p>Development on <a href=\"http://wordpress.org\">WordPress</a> 3.6 has taken off like a rocket, and six areas of focus have already been defined.</p>\n<ul>\n<li><a href=\"http://make.wordpress.org/core/2013/01/07/wordpress-3-6-the-post-formats-ui-feature/\">The Post Formats UI</a> will be getting a major usability overhaul, lead by <a href=\"http://helen.wordpress.com\">Helen Hou-Sandi</a>.</li>\n<li><a href=\"http://make.wordpress.org/core/2013/01/07/wordpress-3-6-autosave-and-post-locking/\">Autosave and Post Locking</a> will be getting some new love, so you&#8217;ll hopefully never lose your posts again, lead by <a href=\"http://azaozz.wordpress.com\">Andrew Ozz</a>.</li>\n<li><a href=\"http://make.wordpress.org/core/2013/01/07/wordpress-3-6-edit-flow/\">The Editorial Flow experience</a> will be getting a major overhaul too, lead by <a href=\"http://danielbachhuber.com\">Daniel Bachhuber</a>, so we can probably expect some bits of <a href=\"http://editflow.org\">Edit Flow</a> to make an appearance.</li>\n<li><a href=\"http://make.wordpress.org/core/2013/01/07/wordpress-3-6-revisions/\">Revisions</a> will be getting some improvements, particularly in author attribution and comparing diffs, lead by <a href=\"http://blog.ftwr.co.uk\">Peter Westwood</a>.</li>\n<li><a href=\"http://make.wordpress.org/core/2013/01/08/wordpress-3-6-menus/\">Menus</a> will be seeing some usability improvements, lead by <a href=\"http://davemart.in\">Dave Martin</a>.</li>\n<li><a href=\"http://make.wordpress.org/core/2013/01/08/wordpress-3-6-distraction-free-writing-improvements/\">Distraction-Free Writing</a> will be getting more visibility, a smoother experience, more features, and some overall polish. A leader for this project has yet to be chosen.</li>\n</ul>\n<p>If you aren&#8217;t already following along with <a href=\"http://make.wordpress.org/core/\">the Make WordPress Core blog</a>, I highly recommend doing so now, especially if you&#8217;re a plugin or theme developer, or just someone whose livelihood relies on WordPress in general.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/U6MdhjxQeSc\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 09 Jan 2013 14:00:38 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"Matt: Control Your Social Network\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=42098\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://ma.tt/2013/01/control-your-social-network/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:162:\"<p>Dylan Tweney writes on <a href=\"http://venturebeat.com/2012/12/20/dylans-desk-social-networking/\">how to take back control of your own social networks</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Jan 2013 21:58:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"WP Windows Phone 7: Version 1.9 Is Here: Featured Images, Editing, &amp; Reliability Improvements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"http://wpwindowsphone.wordpress.com/?p=358\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://wpwindowsphone.wordpress.com/2013/01/08/version-1-9/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3729:\"<p><a href=\"http://wpwindowsphone.files.wordpress.com/2013/01/wpwindowsphone-1-8-featured-images-editor-reliability.png\"><img class=\"alignright size-large wp-image-376\" alt=\"wpwindowsphone-1-8-featured-images-editor-reliability\" src=\"http://wpwindowsphone.files.wordpress.com/2013/01/wpwindowsphone-1-8-featured-images-editor-reliability.png?w=300&h=560\" width=\"300\" height=\"560\" /></a>A new update of WordPress for Windows Phone is <a href=\"http://windowsphone.com/s?appid=5f64ad85-f801-e011-9264-00237de2db9e\">now available in the Windows Phone Store</a>. We’re pleased to introduce version 1.9, which adds some very powerful features! Here’s what’s new:</p>\n<h3>Featured Images Support</h3>\n<p>We’re happy to report that you can now upload a <a href=\"http://codex.wordpress.org/Post_Thumbnails\" target=\"_blank\">Featured Image</a> for your blog posts as long as your theme supports it. To set an image as featured, just tap on it after adding it to the post content area and click the ‘feature’ button — see the screenshot on the right.</p>\n<p>Note that you’ll need WordPress 3.4.1 or greater and a theme that supports featured images in order to use this feature.</p>\n<h3>Full Screen Editing</h3>\n<p>Your phone has a relatively small screen and when writing a post, a large portion of it is taken up by the keyboard. While you’re not likely to write <a href=\"http://en.wikipedia.org/wiki/Divine_Comedy\" target=\"_blank\">&#8220;The Divine Comedy&#8221;</a> on your phone, wouldn’t it be great to have just a little more space? In 1.9 the content editor has its own page that fills the whole screen.</p>\n<p>When the post is ready to go, just press the back button and you’ll be right back in the Post editor.</p>\n<h3>Reliability Improvements</h3>\n<p>In addition to the new features, we’ve worked hard on making the app even more stable and fast. In total, almost 20 bugs and crashes have been fixed in this release. You can see the details on what was taken care of on the <a href=\"http://windowsphone.trac.wordpress.org/query?group=status&milestone=1.9\" target=\"_blank\">trac roadmap</a>.</p>\n<h3>Download</h3>\n<p>Ready to get the latest? Click the link below to update the best WordPress app for Windows Phone so far.</p>\n<p class=\"download\"><a href=\"http://windowsphone.com/s?appid=5f64ad85-f801-e011-9264-00237de2db9e\"><strong>Download App</strong>WordPress for Windows Phone</a><span class=\"download-info\">Supported: WordPress.com or self-hosted WordPress (v. 2.9+)</span></p>\n<h3>Contributors</h3>\n<p>A huge thanks to the contributors that worked on this release:  <a href=\"http://wordpress.org/support/profile/aerych\">aerych</a>, <a href=\"http://wordpress.org/support/profile/daniloercoli\">daniloercoli</a>.</p>\n<p>Would you like to get in on the fun? Let us know at <a title=\"WordPress for Windows Phone developer blog\" href=\"http://windowsphonedev.wordpress.org\" target=\"_blank\">windowsphonedev.wordpress.org</a>  or head on over to <a href=\"http://make.wordpress.org/mobile\" target=\"_blank\">make/mobile on WordPress.org</a> and we&#8217;ll help you get started as a contributor.  Do you have an idea for a new feature or have you encountered a bug that needs fixing? Tell us about it on the <a title=\"Project Trac site\" href=\"http://wpwindowsphone.wordpress.com/feed/windowsphone.trac.wordpress.org\" target=\"_blank\">WordPress for Windows Phone Trac</a>.</p>\n<p>Make sure to follow <a href=\"https://twitter.com/wpwindowsphone\" target=\"_blank\">@WPWindowsPhone on Twitter</a> to get the latest news first.</p>\n<br />  <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wpwindowsphone.wordpress.com&blog=16495748&post=358&subd=wpwindowsphone&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Jan 2013 21:11:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Danilo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"WordPress.tv: Michael Bastos: WordPress on Amazon Web Services from Start to Finish\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=14850\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"http://wordpress.tv/2013/01/08/michael-bastos-wordpress-on-amazon-web-services-from-start-to-finish/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:681:\"<div id=\"v-BJtaCCRc-1\" class=\"vid