s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:311:\"<p>If you&#8217;re using <a href=\"http://wordpress.org/extend/plugins/social/\">Social</a> and haven&#8217;t yet upgraded to 2.7, make sure to do so before January 15th. The URL endpoint that Social talks to has changed and the old endpoint (used on versions prior to 2.7) will be going away on January 15th.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Jan 2013 18:54:04 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Weblog Tools Collection: WordPress Plugin Releases for 1/8\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12491\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/-ZJzs9CJzCQ/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1635:\"<h3>New plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/fikraticker/\"><strong>FikraTicker</strong></a> is a simple newsticker that displays the recent news/posts on your website/blog.</p>\n<p><a href=\"http://strawberryjellyfish.com/wordpress-plugin-jellyfish-invaders/\"><strong>Jellyfish Invaders</strong></a> adds animated flying retro space invaders to your blog.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/wp-ads-within-contents/\"><strong>WP Ads Within Contents</strong></a> allows you to show ads within your post content.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/cloudflare/\"><strong>CloudFlare</strong></a> ensures your WordPress blog is running optimally on the CloudFlare platform.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/contextual-related-posts/\"><strong>Contextual Related Posts</strong></a> helps you increase reader retention and reduce bounce rates by displaying a set of related posts on your website or in your feed.</p>\n<p><a href=\"http://www.fastsecurecontactform.com/\"><strong>Fast Secure Contact Form</strong></a> lets your visitors send you a quick e-mail message and blocks all common spammer tactics. Additionally, the plugin has a multi-form feature, optional extra fields, and an option to redirect visitors to any URL after the message is sent.</p>\n<p><a href=\"http://jetpack.me/\"><strong>Jetpack</strong></a> allows you to supercharge your WordPress site with powerful features previously only available to WordPress.com users.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/-ZJzs9CJzCQ\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Jan 2013 14:00:25 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"Matt: 2012 at Automattic\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=42086\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"http://ma.tt/2013/01/2012-at-automattic/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1635:\"<p>Twenty-twelve was an exciting year for <a href=\"http://automattic.com/\">Automattic</a>. We added 48 <a href=\"http://automattic.com/about/\">new Automatticians</a> and it&#8217;s been delightful to see the effect the new folks have had on the company. We made over 40,000 commits to our various repositories, about half of those on <a href=\"http://wp.com/\">WP.com</a> alone. Contained in those commits are countless improvements to the experience for WP.com, but I&#8217;m just as proud of the things we removed and streamlined: the WP.com homepage has been drastically simplified, and a completely revamped reader is launching this week. Engagement started rising again after being flat in 2011. Support responses that used to take days now take hours or less. We <a href=\"https://www.quantcast.com/p-18-mFEk4J448M\">added 75M uniques</a> to our our network. There is a <a href=\"http://ios.wordpress.org/\">demo WordPress app</a> on every iPhone and iPad in every Apple store I&#8217;ve visited in the US. (If you contribute to WordPress, show it to your friends next time you&#8217;re in a store and say &#8220;I help make this!&#8221;) We did two acquisitions, one announced, one not yet. It looks like we&#8217;ll <a href=\"http://automattic.com/work-with-us/\">grow the team by at least another 60 people this year</a>. There&#8217;s so much more already done that hasn&#8217;t been announced yet or that&#8217;s coming that I&#8217;m bursting to share, but the surprise is at least half the fun. Stay tuned. <img src=\"http://i1.wp.com/s.ma.tt/blog/wp-includes/images/smilies/icon_smile.gif?w=640\" alt=\":)\" class=\"wp-smiley\" /> </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 08 Jan 2013 04:03:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"Weblog Tools Collection: WordPress Theme Releases for 1/6\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12477\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/KfjPkFLYrNc/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2091:\"<p><a href=\"http://wordpress.org/extend/themes/cell\"><img class=\"alignnone size-thumbnail wp-image-12479\" alt=\"screenshot-1\" src=\"http://i1.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot-11.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://wordpress.org/extend/themes/cell\"><strong>Cell</strong></a> is a clean and lightweight theme.</p>\n<p><a href=\"http://wordpress.org/extend/themes/cyberchimps\"><img class=\"alignnone size-thumbnail wp-image-12478\" alt=\"screenshot-2\" src=\"http://i0.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot-2.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://wordpress.org/extend/themes/cyberchimps\"><strong>CyberChimps</strong></a> features <a href=\"http://twitter.github.com/bootstrap/\">Twitter Bootstrap</a>, and responsive touch friendly theme options.</p>\n<p><a href=\"http://wordpress.org/extend/themes/fotogram\"><img class=\"alignnone size-thumbnail wp-image-12480\" alt=\"screenshot-3\" src=\"http://i1.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot-3.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://wordpress.org/extend/themes/fotogram\"><strong>Fotogram</strong></a> is a clean and fast loading theme.</p>\n<p><a href=\"http://wordpress.org/extend/themes/spartan\"><img class=\"alignnone size-thumbnail wp-image-12481\" alt=\"screenshot-4\" src=\"http://i1.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot-4.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://wordpress.org/extend/themes/spartan\"><strong>Spartan</strong></a> is a responsive magazine theme.</p>\n<p><a href=\"http://devpress.com/themes/zenith/\"><img class=\"alignnone size-thumbnail wp-image-12482\" alt=\"screenshot\" src=\"http://i1.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot1.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://devpress.com/themes/zenith/\"><strong>Zenith</strong></a> is a responsive theme designed for blogs and magazines that aren’t about fluff.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtool