ite against malicious URL requests.</p>\n<p><a href=\"http://jetpack.me/\"><strong>Jetpack</strong></a> allows you to supercharge your WordPress site with powerful features previously only available to WordPress.com users.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/uuZpKewqA8U\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 04 Jan 2013 17:00:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"Matt: Learning by Shipping\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=42085\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"http://ma.tt/2013/01/learning-by-shipping/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:416:\"<p>Steven Sinofsky, known at Microsoft for turning around the Office franchise and most recently as head of Windows, where he turned it around post-Vista. He left Microsoft a few months ago, and just started a blog on WordPress.com called <a href=\"http://blog.learningbyshipping.com/\">Learning by Shipping</a>. It&#8217;s a concept <a href=\"http://ma.tt/2010/11/one-point-oh/\">I&#8217;m particularly fond of</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 04 Jan 2013 14:47:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"Weblog Tools Collection: Weblog Tools Collection in 2012\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12463\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/SkOzKnQRiw4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1436:\"<p><a href=\"http://weblogtoolscollection.com/archives/2013/01/01/wordpress-in-2012/\">WordPress had a great 2012</a>, <a href=\"http://weblogtoolscollection.com/archives/2012/12/29/bbpress-in-2012/\">bbPress had a great 2012</a>, and <a href=\"http://jetpack.me/annual-report/1060991/2012/\">we had a great 2012</a> too!</p>\n<p><a href=\"http://jetpack.me/annual-report/1060991/2012/\">This handy report</a> was generated for several <a href=\"http://wordpress.com/\">WordPress.com</a> and <a href=\"http://jetpack.me\">Jetpack</a>-powered <a href=\"http://wordpress.org\">WordPress.org</a> blogs with moderate to high traffic, and it really is quite nice. Here&#8217;s one of my favorite excerpts from our report.</p>\n<blockquote><p>About 55,000 tourists visit Liechtenstein every year. This blog was viewed about 950,000 times in 2012. If it were Liechtenstein, it would take about 17 years for that many people to see it. <strong>Your blog had more visits than a small country in Europe!</strong></p></blockquote>\n<p>So, with visits from 217 countries world-wide, and the United States, India, and the United Kingdom rounding out the top, we had more visits than 17 years worth of tourists to a small European country. That&#8217;s not bad, but we could always do better.</p>\n<p>What would you kind folks love to see from us in 2013?</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/SkOzKnQRiw4\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 03 Jan 2013 14:00:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"Alex King: Using Social and Disqus at the Same Time\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://alexking.org/?p=15500\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"http://alexking.org/blog/2013/01/02/using-social-and-disqus-at-the-same-time\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:768:\"<p>I&#8217;ve had a few people ask about how best to use Social and Disqus at the same time. I&#8217;ve <a href=\"https://github.com/crowdfavorite/wp-social/commit/36a3ce3a3f6755d60fcc5665f1fb104ce80a4799\">added an FAQ to the README</a> for the next release:</p>\n<p><strong>Can I use Social and Disqus at the same time?</strong></p>\n<p>Both Social and Disqus try to replace the default WordPress comment experience by default. If you want to use Social&#8217;s broadcasting features but prefer to use Disqus for your comments, you probably want to check the &#8220;Disable Social&#8217;s comment display (use standard theme output instead).&#8221; box under Advanced Options. This will allow Disqus to take over comment display without any interference from Social.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 02 Jan 2013 22:29:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"Weblog Tools Collection: WordPress Theme Releases for 1/2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12454\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/P0D2d14-L38/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1363:\"<p><a href=\"http://emptynestthemes.com/2012/12/29/12482/\"><img class=\"alignnone size-thumbnail wp-image-12455\" alt=\"DemoBlog\" src=\"http://i0.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/DemoBlog.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://emptynestthemes.com/2012/12/29/12482/\"><strong>Minis</strong></a> is a minimal, simple, clean, yet graphically bold theme that would be great for any blog or website.</p>\n<p><a href=\"http://wordpress.org/extend/themes/simple-style\"><img class=\"alignnone size-thumbnail wp-image-12456\" alt=\"screenshot\" src=\"http://i2.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://wordpress.org/extend/themes/simple-style\"><strong>Simple Style</strong></a> is a white and blue single-column theme.</p>\n<p><a href=\"http://wordpress.org/extend/themes/voyage\"><img class=\"alignnone size-thumbnail wp-image-12457\" alt=\"screenshot-1\" src=\"http://i0.wp.com/weblogtoolscollection.com/wp-content/uploads/2013/01/screenshot-1.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://wordpress.org/extend/themes/voyage\"><strong>Voyage</strong></a> is a flexible and responsive theme that allows you change layout and style through theme options.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/P0D2d14-L38\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 02 Jan 2013 14:00:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"Weblog Tools Collection: WordPress in 2012\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12446\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/IhBrutIBlZc/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1607:\"<p><a href=\"http://wordpress.org\">WordPress</a> has had a rather exciting year, all covered in <a href=\"http://wordpress.org/news/2013/01/2012-a-look-back/\">their handy A Look Back post</a>.</p>\n<p>2012 saw two major WordPress releases, addressing primarily theme customization and media management. There were also five security releases, <a href=\"http://wordpress.org/extend/themes/twentytwelve\">a new default theme</a>, and a record number of code contributions in <a href=\"http://weblogtoolscollection.com/archives/2012/12/11/wordpress-3-5-released/\">the 3.5 release</a>.</p>\n<p>The site itself also saw some improvements, including a new plugin page design with <a href=\"http://weblogtoolscollection.com/archives/2012/11/02/plugin-and-theme-reviews-are-live-on-wordpress-org/\">plugin and theme reviews</a>, and <a href=\"http://make.wordpress.org\">Make.WordPress.org</a>, a network of sites where teams and contributors can easily communicate with each other.</p>\n<p>Speaking of teams and contributors, 2012 also saw the very first <a href=\"https://make.wordpress.org/summit/\">WordPress Community Summit</a>, a 2-day event attended by 108 of the top WordPress development, support, and overall community volunteers.</p>\n<p>2012 was certainly a big year for WordPress, and with <a href=\"http://weblogtoolscollection.com/archives/2012/12/20/wordpress-3-6-planning-underway/\">planning for WordPress 3.6 already underway</a>, it looks like they&#8217;re going to hit the ground running in 2013.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/IhBrutIBlZc\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 01 Jan 2013 14:00:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"Dev Blog: 2012: A Look Back\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://wordpress.org/news/?p=2525\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://wordpress.org/news/2013/01/2012-a-look-back/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4440:\"<p>Another year is coming to a close, and it&#8217;s time to look back and reflect on what we&#8217;ve accomplished in the past twelve months. The WordPress community is stronger than ever, and some of the accomplishments of the past year are definitely worth remembering.</p>\n<h4>Software Releases</h4>\n<p>We had two major releases of the WordPress web application with versions <a href=\"http://wordpress.org/news/2012/06/green/\">3.4</a> and <a href=\"http://wordpress.org/news/2012/12/elvin/\">3.5</a>, as well as 5 security releases during 2012. 3.4 included the theme customizer, while 3.5 became the long awaited &#8220;media release&#8221; featuring a new uploader and gallery management tool. 3.5 contained code contributions from more people than ever, and we hope to continue growing the contributor ranks in the year ahead. We currently have native apps on 6 mobile platforms &#8212; <a href=\"http://ios.wordpress.org/\">iOS</a>, <a href=\"http://android.wordpress.org/\">Android</a>, <a href=\"http://blackberry.wordpress.org/\">Blackberry</a>, <a href=\"http://wpwindowsphone.wordpress.com/\">Windows Phone</a>, <a href=\"http://nokia.wordpress.org/\">Nokia</a>, and <a href=\"http://webos.wordpress.org/\">WebOS</a> &#8212; and saw several updates there as well.</p>\n<h4>Plugin Directory</h4>\n<p>A number of improvements were made to the Plugin Directory in 2012. More cosmetic  updates, like the introduction of branded plugin page headers, make it a nicer browsing experience, while functional changes like better-integrated support forums, plugin reviews, and a favorites system made the plugin directory even more useful as a resource.</p>\n<h4>The &#8220;Make&#8221; Network and Team Reps</h4>\n<p>2012 was the year that saw the creation of <a href=\"http://make.wordpress.org/\">Make.wordpress.org</a>, a network of sites for the teams of contributors responsible for the different areas of the WordPress project. Now anyone can follow along and get involved with the teams that work on <a href=\"http://make.wordpress.org/core/\">core</a>, <a href=\"http://make.wordpress.org/themes/\">theme review</a>, <a href=\"http://make.wordpress.org/support/\">forum support</a>, <a href=\"http://make.wordpress.org/docs/\">documentation</a>, and more. In 2013 we&#8217;ll work to improve these sites to make it easier to become a contributor. Each team also now has elected Team Reps, a new role that has already led to more cross-team communication. Team reps post each week to the <a href=\"https://make.wordpress.org/updates/\">Updates blog</a> so that the other reps can keep up with what&#8217;s going on in other teams.</p>\n<h4>WordPress Community Summit</h4>\n<p>At the end of October, about 100 of the most influential and respected members of the WordPress community attended an inaugural <a href=\"https://make.wordpress.org/summit\">summit</a> to discuss where we all stand, and to figure out where we go next with WordPress. A &#8220;conference of conversations,&#8221; this unconference made everyone an active participant, and while not every issue brought to the table was solved by the end of the event, the right questions were being asked.</p>\n<h4>Meetup.com</h4>\n<p>The WordPress Foundation now has a central account with Meetup.com. We&#8217;ve brought in a couple dozen existing meetup groups as a pilot to test the system, and are in the process of working with more existing meetups (as well as new ones) to join us so that local organizers won&#8217;t have to pay organizer dues and can get more support from the WordPress project.</p>\n<h4>Internet Blackout Day</h4>\n<p>We participated in the protest against SOPA/PIPA, Internet Blackout Day, on January 18. Though we usually stay out of politics, this campaign was important, and we not only participated in the blackout on WordPress.org, we encouraged our users to do so as well, and recommended plugins to provide blackout functionality. It was deemed the <a href=\"http://sopastrike.com/numbers/\">largest online protest in history</a>.</p>\n<h4>WordCamps</h4>\n<p>And finally, it wouldn&#8217;t be a recap without counting up the <a href=\"http://wordcamp.org\">WordCamps</a>! There were 67 WordCamps around the world in 2012, bringing together WordPress users, developers, and fans. If you didn&#8217;t make it to a WordCamp this year, maybe it can be one of your new year resolutions: <a href=\"http://central.wordcamp.org/schedule/\">check the schedule</a> to find one near you!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 01 Jan 2013 02:22:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:10:\"Jane Wells\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"Weblog Tools Collection: WordPress Plugin Releases for 12/30\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12435\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/YNoFz37j9tA/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1079:\"<h3>New plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/document-feedback/\"><strong>Document Feedback</strong></a> allows you to get feedback from readers on the documentation you write.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/duckduckgo-search/\"><strong>DuckDuckGo Search Widget</strong></a> allows users to search your site using the <a href=\"http://duckduckgo.com\">DuckDuckGo</a> search engine.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/restore-image-title/\"><strong>Restore Image Title</strong></a> restores the title attribute when images are inserted into posts.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/camptix/\"><strong>CampTix Event Ticketing</strong></a> is an easy to use and flexible event ticketing plugin.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/w3-total-cache/\"><strong>W3 Total Cache</strong></a> allows you to improve site performance and user experience via caching.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/YNoFz37j9tA\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 30 Dec 2012 14:00:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"Weblog Tools Collection: bbPress in 2012\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12430\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/R0eLiQ6ymLc/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:766:\"<p><a href=\"http://bbpress.org\">bbPress</a>, the forum &#8220;cousin&#8221; of <a href=\"http://wordpress.org\">WordPress</a>, has had a rather exciting year in 2012, and it&#8217;s all been wrapped up with a nice bow in <a href=\"http://bbpress.org/blog/2012/12/year-in-review/\">their year in review post</a>.</p>\n<p>Over the course of 2012, bbPress has seen two major version releases, a new core committer, and a redesigned site with an emphasis on showcasing and supporting bbPress.</p>\n<p>In 2013, the team plans to focus on improved searching, more integration with <a href=\"http://buddypress.org\">BuddyPress</a>, and various performance improvements.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/R0eLiQ6ymLc\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 29 Dec 2012 14:00:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"WPTavern: Automattic Acquires CodeGarage\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6753\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"http://feedproxy.google.com/~r/WordpressTavern/~3/yVmq2R5GpIk/automattic-acquires-codegarage\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2337:\"<p><a href=\"http://www.wptavern.com/wp-content/uploads/2012/12/CodeGaragelogo.jpg\" rel=\"thumbnail\"><img src=\"http://www.wptavern.com/wp-content/uploads/2012/12/CodeGaragelogo.jpg\" alt=\"Code Garage Logo\" width=\"262\" height=\"54\" class=\"alignright size-full wp-image-6754\" /></a>Automattic or more aptly VaultPress, has acquired security company, <a href=\"http://codegarage.com/blog/2012/12/going-automattic/\">CodeGarage</a>. This is the first time I&#8217;ve ever heard about CodeGarage but they appear to be a VaultPress alternative. Looking over the pricing and plans for each service, I see that CodeGarage was definitely cheaper as you can monitor 5 websites for $25 a month while VaultPress charges a flat fee <strong>PER</strong> website. The acquisition appears to be a talent grab as well as being a learning exercise. As an example, CodeGarage has a great pricing structure that allows businesses to have multiple websites monitored for a nominal fee, something which VaultPress doesn&#8217;t have. </p>\n<p>I have to say though, I&#8217;m a bit perplexed as to why <a href=\"http://blog.vaultpress.com/2012/12/21/vaultpress-in-the-garage/\">Automattic/VaultPress would continue</a> to build and expand upon CodeGarage considering the existence of VaultPress. Even though it was not announced, if I were a customer of CodeGarage, I&#8217;d be watching the news very carefully to watch for any hints of the service shutting down and everyone having to migrate over to the VaultPress platform. </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/vaultpress-not-an-option-for-non-profit-multisite-installations\" rel=\"bookmark\" title=\"VaultPress &#8211; Not An Option For Non-Profit MultiSite Installations?\">VaultPress &#8211; Not An Option For Non-Profit MultiSite Installations?</a></li>\n<li><a href=\"http://www.wptavern.com/vaultpress-now-supports-wordpress-multisite\" rel=\"bookmark\" title=\"VaultPress Now Supports WordPress Multisite\">VaultPress Now Supports WordPress Multisite</a></li>\n<li><a href=\"http://www.wptavern.com/vaultpress-issues-first-set-of-invites\" rel=\"bookmark\" title=\"VaultPress Issues First Set Of Invites\">VaultPress Issues First Set Of Invites</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/yVmq2R5GpIk\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Dec 2012 20:20:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"WP Windows Phone 7: Version 1.8 Released\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"http://wpwindowsphone.wordpress.com/?p=314\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://wpwindowsphone.wordpress.com/2012/12/07/version-1-8/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2749:\"<p><a href=\"http://wpwindowsphone.files.wordpress.com/2012/12/wpwindowsphone-1-8-comment-moderation.png\"><img src=\"http://wpwindowsphone.files.wordpress.com/2012/12/wpwindowsphone-1-8-comment-moderation.png?w=300&h=560\" alt=\"wpwindowsphone-1-8-comment-moderation\" width=\"300\" height=\"560\" class=\"alignright size-medium wp-image-347\" /></a>The team is excited to announce version 1.8 of WordPress for Windows Phone! This update not only runs better but also has a cool new comments moderation UI.</p>\n<h3>Comments moderation changes</h3>\n<p>Save time by moderating several comments at once with the new “bulk edit” mode. The ability to moderate multiple comments at once is now available right from the comments list.</p>\n<p>Simply tap the moderate icon in the toolbar to access bulk moderation. Tap the checkboxes next to the comments to select them, then tap a moderation option to moderate them all at once.</p>\n<p>But wait, there&#8217;s more! It&#8217;s now possible to filter comments by their status, just open the menu and select one of the filters.</p>\n<p>Here are other improvements and bugs fixed in version 1.8:</p>\n<ul>\n<li>Multi-sites and subdirectory installations can now be added to the app without hassle, as long as the app can access the RSD endpoint of your site.</li>\n<li>Bug fix: the loading indicator no longer occasionally stays on the screen when the back button is pressed.</li>\n<li>A bunch of minor issues related to the connectivity layer were fixed in this release.</li>\n</ul>\n<a href=\"http://wpwindowsphone.wordpress.com/2012/12/07/version-1-8/#gallery-314-1-slideshow\">Click to view slideshow.</a>\n<h3>Contributors</h3>\n<p>The following contributors have worked on this release of WordPress for Windows Phone:  <a href=\"http://wordpress.org/support/profile/aerych\">aerych</a>, <a href=\"http://wordpress.org/support/profile/daniloercoli\">daniloercoli</a>.</p>\n<p>Would you like to get in on the fun? Let us know at <a title=\"WordPress for Windows Phone developer blog\" href=\"http://windowsphonedev.wordpress.org\" target=\"_blank\">windowsphonedev.wordpress.org</a> and we&#8217;ll help you get started as a contributor.  Do you have an idea for a new feature or have you encountered a bug that needs fixing? Tell us about it on the <a title=\"Project Trac site\" href=\"http://wpwindowsphone.wordpress.com/feed/windowsphone.trac.wordpress.org\" target=\"_blank\">WordPress for Windows Phone Trac</a>.</p>\n<p>Make sure to follow <a href=\"https://twitter.com/wpwindowsphone\">@WPWindowsPhone on Twitter</a> to get the latest news first.</p>\n<br />  <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wpwindowsphone.wordpress.com&blog=16495748&post=314&subd=wpwindowsphone&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Dec 2012 20:15:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Danilo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"WP Windows Phone 7: Introducing Version 1.7: Local Drafts, Post Formats, Compatibility\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"http://windowsphone.wordpress.org/?p=269\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://wpwindowsphone.wordpress.com/2012/11/29/version-1-7/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4190:\"<p><a href=\"http://wpwindowsphone.files.wordpress.com/2012/11/wpwindowsphone-1-7-new-post.png\"><img src=\"http://wpwindowsphone.files.wordpress.com/2012/11/wpwindowsphone-1-7-new-post.png?w=300&h=560\" alt=\"\" width=\"300\" height=\"560\" class=\"alignright size-large wp-image-307\" /></a>We’re very happy to announce that version 1.7 of WordPress for Windows Phone is now available in the <a href=\"http://windowsphone.com/s?appid=5f64ad85-f801-e011-9264-00237de2db9e\" target=\"_blank\">Windows Phone Store</a>! This update adds many new features such as Local Drafts, Multimedia Management, and Post Formats. It also resolves many of the outstanding issues and quirks that you have mentioned on the <a href=\"http://windowsphone.forums.wordpress.org/\">forums</a> and on <a href=\"http://twitter.com/wpwindowsphone\">Twitter</a>. Read on to find out more.</p>\n<h3>New Features</h3>\n<ul>\n<li><strong>Local Drafts<br />\n</strong>Nothing’s worse than working on a great post only to have it disappear because of a bad internet connection. That&#8217;s why we made it possible to save a new post or page as a Local Draft on your device.</li>\n<li><strong>Multimedia Management improvements</strong><br />\nAdding photos to your blog posts is now easier than ever. You can choose to upload straight from the camera or from the photo library on your device. You can also now set the positioning (i.e: display at the top or bottom of your post) by tapping the picture on the Edit screen.</li>\n<li><strong>Post Format Support<br />\n</strong>At the bottom of the Edit screen, you’ll now see an option for setting the post format for your posts. The app will check with your blog to get a list of post formats that your theme supports.</li>\n<li><strong>Windows Phone 8 compatibility</strong><br />\nWhile this release focuses mainly on bugs and performance enhancements, it also includes some updates to help Windows Phone users take advantage of the latest addition from Microsoft: Windows Phone 8!</li>\n</ul>\n<p>Version 1.7 also includes numerous other bug fixes and improvements not listed here. For a full list, <a href=\"http://windowsphone.trac.wordpress.org/query?group=status&milestone=1.7\" target=\"_blank\">visit the 1.7 Trac milestone</a>.</p>\n<p>As always, your feedback and input on this release will help guide us as we work hard on the next release, which we’ve already started coding. If you feel like 1.7 is an improvement over the previous release, feel free to leave us a review in the Marketplace to let everyone else know that they should upgrade.</p>\n<p>Additionally, we welcome your feedback in <a href=\"http://windowsphone.forums.wordpress.org/\">the forums</a> and on <a href=\"http://twitter.com/wpwindowsphone\">Twitter</a>.</p>\n<a href=\"http://wpwindowsphone.wordpress.com/2012/11/29/version-1-7/#gallery-269-2-slideshow\">Click to view slideshow.</a>\n<h3>Contributors</h3>\n<p>The following contributors have worked on this release of WordPress for Windows Phone:  <a href=\"http://wordpress.org/support/profile/aerych\">aerych</a>, <a href=\"http://wordpress.org/support/profile/isaackeyet\">isaackeyet</a>, <a href=\"http://wordpress.org/support/profile/daniloercoli\">daniloercoli</a>, and <a href=\"http://wordpress.org/support/profile/mrroundhill\">mrroundhill</a>!</p>\n<h3>Getting Involved?</h3>\n<p>Development is continuing at a very rapid pace. We are already marching towards the next release of the app. So far we are keen on adding a better Post Editor, and support for Featured Images. Want to help out? Check out <a href=\"http://make.wordpress.org/mobile\">make.wordpress.org/mobile</a> and the <a href=\"http://windowsphonedev.wordpress.org/\" target=\"_blank\">WordPress for Windows Phone dev blog</a> to see how you can get involved!</p>\n<p>If you’d like to help us translate the app into your native language, check out the <a href=\"http://translate.wordpress.org/projects/wordpress-for-windows-phone/development\" target=\"_blank\">translation project</a>.</p>\n<p>Happy blogging!</p>\n<br />  <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wpwindowsphone.wordpress.com&blog=16495748&post=269&subd=wpwindowsphone&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Dec 2012 20:15:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Danilo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"WPTavern: Security Hole In W3 Total Cache\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6749\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"http://feedproxy.google.com/~r/WordpressTavern/~3/dJ3PpaC8SJk/security-hole-in-w3-total-cache\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2669:\"<p>Over the past few days, I&#8217;ve read various posts regarding a security hole discovered in the popular W3 Total Cache plugin. According to a <a href=\"http://seclists.org/fulldisclosure/2012/Dec/242\">security bulletin published</a> by Jason Donenfeld on Seclist.org, after installing the plugin from the WordPress plugin repository through the backend of WordPress, there are two avenues of attack left open.</p>\n<blockquote><p>\n1) Directory listings were enabled on the cache directory, which means anyone could easily recursively download all the database cache keys,<br />\nand extract ones containing sensitive information, such as password hashes. A simple google search of &#8220;inurl:wp-content/plugins/w3tc/dbcache&#8221; and maybe some other magic reveals this wasn&#8217;t just an issue for me. As W3 Total Cache already futzes with the .htaccess file, I see no reason for it not to add &#8220;Options -Indexes&#8221; to it upon installation. I haven&#8217;t read any W3 documentation, so it&#8217;s possible this is a known and documented misconfiguration, but maybe not.</p>\n<p>2) Even with directory listings off, cache files are by default publicly downloadable, and the key values / file names of the database cache items are easily predictable. Again, it seems odd that &#8220;deny from all&#8221; isn&#8217;t added to the .htaccess file. Maybe it&#8217;s documented somewhere that you should secure your directories, or maybe it isn&#8217;t; I&#8217;m not sure.</p></blockquote>\n<p>However, <a href=\"http://wordpress.org/support/topic/w3-total-cache-critical-vulnerability-disclosed-1\">within the plugin&#8217;s support forums</a> on WordPress.org, Otto suggested that until a fix is released, to check and see if you&#8217;re using &#8220;Disk: Basic&#8221; or &#8220;Disk: Enhanced&#8221; for database caching. If so, disable database caching and clear out those caches. </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/wp-super-cache-1-0-released\" rel=\"bookmark\" title=\"WP Super Cache 1.0 Released\">WP Super Cache 1.0 Released</a></li>\n<li><a href=\"http://www.wptavern.com/share-your-wordpress-security-nightmare\" rel=\"bookmark\" title=\"Share Your WordPress Security Nightmare\">Share Your WordPress Security Nightmare</a></li>\n<li><a href=\"http://www.wptavern.com/top-5-wordpress-security-tips-you-most-likely-dont-follow\" rel=\"bookmark\" title=\"Top 5 WordPress Security Tips You Most Likely Don&#8217;t Follow\">Top 5 WordPress Security Tips You Most Likely Don&#8217;t Follow</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/dJ3PpaC8SJk\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Dec 2012 19:54:52 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WPTavern: bbPress Publishes 2012 Year In Review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://www.wptavern.com/?p=6746\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"http://feedproxy.google.com/~r/WordpressTavern/~3/oTY3wyCumUQ/bbpress-publishes-2012-year-in-review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1818:\"<p><a href=\"http://www.wptavern.com/wp-content/uploads/2011/09/bbpresslogo.png\" rel=\"thumbnail\"><img src=\"http://www.wptavern.com/wp-content/uploads/2011/09/bbpresslogo.png\" alt=\"bbpress.org Logo\" width=\"205\" height=\"70\" class=\"alignright size-full wp-image-5463\" /></a>John James Jacoby has published the <a href=\"http://bbpress.org/blog/2012/12/year-in-review/\">2012 year in review post</a> for bbPress. It&#8217;s been one year since the project went from being stand alone software to a WordPress plugin. So far, it looks like the project is progressing along quite steadily. Among some of the cool stuff added to bbPress during 2012 are <em>retina support, theme compatibility, multiple user roles, private/hidden forums, BuddyPress integration, Akismet integration, and improved multisite support.</em> Although it&#8217;s taken awhile, it looks like the community is really starting to rally behind the project again. </p>\n<p>For those of you that are using the plugin version of bbPress, what are your thoughts on the new project so far? </p>\n<div class=\"yarpp-related-rss\">\n<p>Related posts:<ol>\n<li><a href=\"http://www.wptavern.com/the-future-of-bbpress-lies-within-wordpress\" rel=\"bookmark\" title=\"The Future Of bbPress Lies Within WordPress\">The Future Of bbPress Lies Within WordPress</a></li>\n<li><a href=\"http://www.wptavern.com/new-home-for-bbpress-development-chatter\" rel=\"bookmark\" title=\"New Home For bbPress Development Chatter\">New Home For bbPress Development Chatter</a></li>\n<li><a href=\"http://www.wptavern.com/buddypress-and-bbpress-are-getting-a-divorce\" rel=\"bookmark\" title=\"BuddyPress And bbPress Are Getting A Divorce\">BuddyPress And bbPress Are Getting A Divorce</a></li>\n</ol></p>\n</div>\n<img src=\"http://feeds.feedburner.com/~r/WordpressTavern/~4/oTY3wyCumUQ\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 28 Dec 2012 19:35:12 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Jeffro\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"WordPress.tv: Joel R. Norris: A Beginner’s WordPress Bootcamp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=14237\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"http://wordpress.tv/2012/12/26/joel-r-norris-a-beginners-wordpress-bootcamp/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:635:\"<div id=\"v-IsG4XNns-1\" class=\"video-player\">\n</div>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/14237/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/14237/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=14237&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2012/12/26/joel-r-norris-a-beginners-wordpress-bootcamp/\"><img alt=\"JoelWordCampNash\" src=\"http://videos.videopress.com/IsG4XNns/joelwordcamp_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 26 Dec 2012 14:42:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ah So Designs\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"Weblog Tools Collection: WordPress Plugin Releases for 12/26\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12420\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/2p-8OLDl7Hw/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1068:\"<h3>New plugins</h3>\n<p><a href=\"http://wordpress.org/extend/plugins/font-emoticons/\"><strong>Font Emoticons</strong></a> replaces WordPress&#8217; smileys with font-based emoticons.</p>\n<p><a href=\"http://akted.com/plugins/mu-plugins-tool/\"><strong>MU Plugins Tool</strong></a> allows you to selectively enable/disable any MU (must-use) plugins you have installed.</p>\n<h3>Updated plugins</h3>\n<p><a href=\"http://www.fastsecurecontactform.com/\"><strong>Fast Secure Contact Form</strong></a> lets your visitors send you a quick e-mail message and blocks all common spammer tactics. Additionally, the plugin has a multi-form feature, optional extra fields, and an option to redirect visitors to any URL after the message is sent.</p>\n<p><a href=\"http://wordpress.org/extend/plugins/yet-another-related-posts-plugin/\"><strong>Yet Another Related Posts Plugin</strong></a> displays a list of related entries on your site and feeds based on a unique algorithm.</p>\n<img src=\"http://feeds.feedburner.com/~r/weblogtoolscollection/UXMP/~4/2p-8OLDl7Hw\" height=\"1\" width=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 26 Dec 2012 14:00:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:23:\"bbPress: Year in Review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://bbpress.org/?p=124460\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"http://bbpress.org/blog/2012/12/year-in-review/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1832:\"<h4>bbPress.org</h4>\n<p>bbPress.org went through a serious clean-up effort in 2012. The site now runs a minimal set of plugins, with an emphasis on supporting the project proper and showcasing it in a much more subtle and focused way.</p>\n<p>bbPress.org&#8217;s plugin repository was retired, and all new plugins are located in WordPress.org extend. This makes perfect sense right now, and really goes a long way towards more tightly integrating the WordPress/bbPress ecosystems together.</p>\n<h4>bbPress Releases</h4>\n<p>bbPress saw the release of 2.1 and 2.2 this year, both major versions that included some pretty nifty and progressive features, such as: retina support, theme compatibility, multiple user roles, private/hidden forums, BuddyPress integration, Akismet integration, and improved multisite support.</p>\n<p>bbPress recently welcomed Jennifer M. Dodd as a core committer, and she&#8217;s already doing great. We&#8217;ve also started doing weekly team chats, and have regulars that are helping run the show, triage trac, and follow closely inline with the successes of WordPress core.</p>\n<p>In 2013, bbPress will see:</p>\n<ul>\n<li>Forum specific searching.</li>\n<li>More BuddyPress integration.</li>\n<li>More migrations to 2.x in the various .org usages.</li>\n<li>Performance improvements around recalculating metadata.</li>\n<li>Improved capability mapping, to allow more granular access control.</li>\n<li>Hopefully, another core committer.</li>\n</ul>\n<h4>In closing</h4>\n<p>2012 has been a great year for the bb&#8217;s. The community is really rallying behind bbPress again, and our BuddyPress users are anxiously awaiting the 1.7 release to alleviate all of their theming woes. Overall, I&#8217;m very proud about what we were able to accomplish this year, and am excited about what we have planned for 2013.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 25 Dec 2012 17:00:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"John James Jacoby\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"BuddyPress: Year in Review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://buddypress.org/?p=148902\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:45:\"http://buddypress.org/2012/12/year-in-review/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2401:\"<h4>BuddyPress.org</h4>\n<p>BuddyPress.org went through another serious clean-up effort in 2012. It now runs a minimal set of plugins, with an emphasis on supporting the project proper.</p>\n<p>BuddyPress.org&#8217;s group forums were retired. They were a fun experiment, but largely confusing to users and a moderation nightmare for site staffers. BuddyPress.org also experienced another redesign, taking much inspiration from bbPress.org and shifting focus away from evangelizing and towards supporting and showcasing what a nicely integrated BuddyPress installation can be.</p>\n<h4>BuddyPress Releases</h4>\n<p>BuddyPress saw both 1.5 and 1.6, with focus on cleaning up the codebase, gently migrating off of bbPress 1.1 for group forums, activity stream administration, performance improvements, and better single and multisite switching support. We also had our very first BuddyCamp in Vancouver, which was an amazing event thanks to Matt, the event organizers, sponsors, and all-of-the-other awesome contributors.</p>\n<p>In 2012, we added our 4th core committer, Raymond Hoh. Ray has been a prolific contributor since the early days, and recently stepped up his game where him not having commit access was slowing him down. We also started experimenting with new default themes, codenamed Status, and Turtleshell respectively. Neither has made it directly into core, but TS is showing promise as a great compliment to 1.7 as we roll out theme compatibility in BuddyPress.</p>\n<p>In 2013, BuddyPress will likely see:</p>\n<ul>\n<li>Theme compatibility with all WordPress themes.</li>\n<li>Dropping the ability to create new bbPress 1.1 powered group forums, relying solely on bbPress 2.x.</li>\n<li>Notifications being extracted into its own component.</li>\n<li>More wp-admin integration, starting with Groups management.</li>\n<li>Retina all-of-the-things.</li>\n<li>What&#8217;s New and Credits pages, ala WordPress core.</li>\n<li>Again, hopefully another prolific core committer.</li>\n<li>A BuddyCamp or two wouldn&#8217;t hurt.</li>\n</ul>\n<h4>In closing</h4>\n<p>2012 has been a great year for the bb&#8217;s. The community is really rallying behind bbPress again, and our BuddyPress users are anxiously awaiting the 1.7 release to alleviate all of their theming woes. Overall, I&#8217;m very proud about what we were able to accomplish this year, and am excited about what we have planned for 2013.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 25 Dec 2012 10:09:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"John James Jacoby\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"Weblog Tools Collection: WordPress Theme Releases for 12/24\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://weblogtoolscollection.com/?p=12407\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://feedproxy.google.com/~r/weblogtoolscollection/UXMP/~3/Na-eskKYYU0/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2144:\"<p><a href=\"http://wordpress.org/extend/themes/artblog\"><img class=\"alignnone size-thumbnail wp-image-12409\" alt=\"screenshot\" src=\"http://i2.wp.com/weblogtoolscollection.com/wp-content/uploads/2012/12/screenshot4.png?resize=150%2C150\" /></a></p>\n<p><a href=\"http://wordpress.org/extend/themes/artblog\"><strong>Artblog</strong></a> is a simple theme designed for artists.</p>\n<p><a href=\"http://wordpress.org/extend/themes/cheer\"><img class=\"alignnone size-thumbnail wp-image-12410\" alt=\"screenshot-1\" src=\"http://i1.wp.com/we