ents/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"James\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WordPress.tv: Brad McCarty: Making the Leap: From Hobbyist to Professional\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wordpress.tv/?p=14242\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"http://wordpress.tv/2012/12/23/brad-mccarty-making-the-leap-from-hobbyist-to-professional/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:681:\"<div id=\"v-PGfZ2v8X-1\" class=\"video-player\">\n</div>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/wptv.wordpress.com/14242/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/wptv.wordpress.com/14242/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=wordpress.tv&blog=5089392&post=14242&subd=wptv&ref=&feed=1\" width=\"1\" height=\"1\" /><div><a href=\"http://wordpress.tv/2012/12/23/brad-mccarty-making-the-leap-from-hobbyist-to-professional/\"><img alt=\"bradmccarty_wordcamp_nashville\" src=\"http://videos.videopress.com/PGfZ2v8X/bradmccarty_wordcamp_nashville_std.original.jpg\" width=\"160\" height=\"120\" /></a></div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 23 Dec 2012 16:30:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Ah So Designs\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"Alex King: What image gets passed to Facebook in Social broadcasts?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://alexking.org/?p=15404\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"http://alexking.org/blog/2012/12/21/what-image-gets-passed-to-facebook-in-social-broadcasts\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1266:\"<p>Anyone who has developed against Facebook&#8217;s API knows that the only constant is change &#8211; Facebook is an ever-evolving platform. In <a href=\"https://alexking.org/blog/2012/12/21/social-2-7\">Social</a> we&#8217;ve made changes a few different times to the way we broadcast links.</p>\n<p>Our original posting approach was working fine, but as Facebook started rolling out their &#8220;Share&#8221; feature, it wasn&#8217;t available on links being published by Social. We poked around and found that if we used a different endpoint then the Share feature would be available for these broadcasts. So we made the change.</p>\n<p>Recently another problem popped up. The Facebook broadcasts were no longer showing up with the post&#8217;s featured image. Turns out that feature was removed from the endpoint we were using. Fortunately, the original endpoint we were using (which does allow us to send an image with the link) started supporting the Share feature, so we&#8217;ve switched back to that one in Social 2.7.</p>\n<p>For posts that have no image, Facebook falls back on it&#8217;s Open Graph protocol. If you want to tell Facebook what image to use with your broadcasts, you can do so by installing one of a number of Facebook Open Graph plugins.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 21 Dec 2012 21:57:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"Alex King: Social 2.7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://alexking.org/?p=15412\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"http://alexking.org/blog/2012/12/21/social-2-7\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1221:\"<p>Just in time for the holidays I am very pleased to report we have a new version of <a href=\"http://wordpress.org/extend/plugins/social/\">Social</a> for you (compliments of our good friends at <a href=\"http://mailchimp.com\">MailChimp</a> and my team at <a href=\"http://crowdfavorite.com\">Crowd Favorite</a>).</p>\n<p>This release as a few changes of note:</p>\n<ul>\n<li>Points to a new Social proxy URL. The old one will stop working on Jan 15th &#8211; make sure to upgrade before then.</li>\n<li>Potential work-around for crazy &#8220;security&#8221; settings on some hosts &#8211; I&#8217;m looking at you HostGator.</li>\n<li>Separate settings for Social&#8217;s WP-Cron feature and retrieving comments from Twitter and Facebook. Now you don&#8217;t have to enable retrieving social comments for Twitter Tools to pull in your tweets automatically.</li>\n<li>Improved comment date handling, including better i18n support.</li>\n<li>Match Facebook&#8217;s API changes for passing in images with broadcasts.</li>\n</ul>\n<p>I think this is the best release of Social yet, I hope you enjoy it. If you have any issues, please post them in the <a href=\"http://wordpress.org/support/plugin/social\">WordPress support forum</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 21 Dec 2012 21:06:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Alex\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"Akismet: A Spammy Year in Review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"http://blog.akismet.com/?p=795\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"http://blog.akismet.com/2012/12/21/a-spammy-year-in-review/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5825:\"<p>It&#8217;s that time of the year again.</p>\n<p>Time for family members to joyfully gather for the holidays. Time to work on those ill-fated New Year&#8217;s resolutions. Time to relax and reflect on the past year and lessons learned.</p>\n<p>Here at Akismet, we proudly work year round to protect millions of sites from comment spam. To date, in fact, we have eliminated over <strong>65 billion</strong> (yes, with a &#8216;b&#8217;) spam comments, and we saw many interesting &#8212; and nasty &#8212; things in 2012. Make no mistake about it &#8212; spam levels are certainly on the rise.</p>\n<p>Akismet saved the web from over <strong>25 billion </strong>pieces of spam content this past year alone (and December is not over yet!). Toward the end of the year, specifically, we began seeing alarming and heightened levels of spam. Our daily totals &#8212; starting in early December &#8212; began topping <strong>120 million</strong> spam comments <strong>per day</strong>, a trend that appears to be continuing into the new year. To add some perspective, these numbers are roughly double what we were seeing in previous months. We also topped the <strong>3 billion</strong> spam mark in November:</p>\n<p><a href=\"http://akismet.files.wordpress.com/2012/12/2012-akismet-spam.png\"><img alt=\"Akismet Spam Totals By Month, 2012\" src=\"http://akismet.files.wordpress.com/2012/12/2012-akismet-spam.png?w=550\" /></a></p>\n<p><em><small>The chart above contains both current (C) and projected (P) December figures.</small></em></p>\n<p>More troubling in terms of trends, there has been an unfortunate increase in compromised sites, wikis, and forums. We come across these after a hacker takes over a site, sets up their payload, and proceeds to spam a great number of sites with their malicious links. It is clear that spammers are increasingly willing to use illegal methods, such as hacking and exploiting these vulnerable websites. We have even seen these tactics used to advertise otherwise-reputable and well-known websites, a trend that suggests some marketing firms are outsourcing work to black-hat spammers.</p>\n<p>Further noticeable increases in spam include elevated traffic from China, as well as the promotion of Chinese knockoff fashion sites. If you happen to regularly check your spam queue, we&#8217;re sure that you&#8217;ve seen at least one offer to purchase discount Christian Louboutin shoes or &#8220;authentic&#8221; Michael Kors purses. Also steadily on the rise has been spam content promoting TV streaming, payday loans, and &#8220;Get rich by working from home!&#8221; sites and programs. Sure, we have all seen this garbage before, but its recent increase is something to still keep in mind. Here are some example sites, all of which were created on free blog hosts:</p>\n\n<a href=\"http://blog.akismet.com/2012/12/21/a-spammy-year-in-review/tv-streaming-spam-example/\" title=\"TV Streaming Spam\"><img /></a>\n<a href=\"http://blog.akismet.com/2012/12/21/a-spammy-year-in-review/knockoff-spam-example/\" title=\"Knockoff Spam\"><img /></a>\n<a href=\"http://blog.akismet.com/2012/12/21/a-spammy-year-in-review/oakley-knockoff-spam-example/\" title=\"Knockoff Spam\"><img /></a>\n<a href=\"http://blog.akismet.com/2012/12/21/a-spammy-year-in-review/payday-loan-spam-example/\" title=\"Payday Loan Spam\"><img /></a>\n<a href=\"http://blog.akismet.com/2012/12/21/a-spammy-year-in-review/tv-streaming-spam-example3/\" title=\"TV Streaming Spam\"><img /></a>\n<a href=\"http://blog.akismet.com/2012/12/21/a-spammy-year-in-review/tv-streaming-spam-example2/\" title=\"TV Streaming Spam\"><img /></a>\n\n<p>Spammers have also taken a liking to the abuse of reputable affiliate and referral programs.Their goal is simple: set up a free blog or site (example shown below), publish oodles of product listings including specific affiliate URLs, and spam the rest of the internet. You may notice that many of these spammers plant their payloads on free site hosts. Luckily, on <a title=\"WordPress.com\" href=\"http://wordpress.com\">WordPress.com</a>, Akismet is actively working to combat the creation of these spam sites. We would love to see such integration on other hosts.</p>\n<p><a href=\"http://akismet.files.wordpress.com/2012/12/affiliate-program-spam-example.png\"><img alt=\"Affiliate Spammer\" src=\"http://akismet.files.wordpress.com/2012/12/affiliate-program-spam-example.png?w=550\" /></a></p>\n<p><em><small>A spammer abusing Amazon&#8217;s affiliate program. A prominent form of spam in 2012.</small></em></p>\n<p>Recent streams of human-generated spam are also worth mentioning. These campaigns tend to focus on more difficult targets, such as forums, third-party commenting platforms, and social networks. Such spam can be more difficult to systematically neutralize, which is why Akismet continues to develop and employ refined tactics against it.</p>\n<p>Rest assured, we are always hard at work to make sure that any global increase in spam does not mean an unfortunate rise in unwanted comments getting through to your posts or moderation queues. Because we know that you have far more important things to do than sift through trash.</p>\n<p>As always, our resolution for the new year is to continue making Akismet better, faster, and more accurate. As spam evolves, so will Akismet. We sincerely thank each and every one of our users for trusting us to defend their sites against the web&#8217;s underbelly.</p>\n<p>Happy Holidays to you and yours,<br />\nTeam Akismet</p>\n<br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/akismet.wordpress.com/795/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/akismet.wordpress.com/795/\" /></a> <img alt=\"\" border=\"0\" src=\"http://stats.wordpress.com/b.gif?host=blog.akismet.com&blog=116920&post=795&subd=akismet&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 21 Dec 2012 15:03:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:7:\"Anthony\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";a:9:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Tue, 15 Jan 2013 14:42:15 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:14:\"content-length\";s:6:\"122748\";s:10:\"connection\";s:5:\"close\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Tue, 15 Jan 2013 14:15:18 GMT\";s:4:\"x-nc\";s:11:\"HIT luv 138\";s:13:\"accept-ranges\";s:5:\"bytes\";}s:5:\"build\";s:14:\"20121211201949\";}','no');
