INSERT INTO `wp_posts` VALUES (1328,1,'2012-12-17 11:15:48','2012-12-17 11:15:48','<p>\n\n\n	<strong>Description:</strong> This is a breakout board for the Silicon Laboratories Si4703 FM tuner chip. Beyond being a simple FM radio, the Si4703 is also capable of detecting and processing both Radio Data Service (RDS) and Radio Broadcast Data Service (RBDS) information. The Si4703 even does a very good job of filtering and carrier detection. It also enables data such as the station ID and song name to be displayed to the user.</p>\n\n\n<p>\n\n\n	Using this board we are able to pick up multiple stations just as well as with a standard FM radio. The board breaks out all major pins and makes it easy to incorporate this great chip into your next radio project. Also, by plugging headphones into the 3.5mm audio jack, you effectively use the cable in your headphones as an antenna! Therefore, this board does not require an external antenna if using headphones or a 3.5mm audio cable longer than 3 feet.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Si470x-Eval-v11.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Si470x-Eval-v11.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Si4702-03-C19-1.pdf\">Datasheet</a> (Si4703)</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/tpa6111a2.pdf\" target=\"_blank\">Datasheet</a> (TPA6111A2)</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Si4703_Example.pde\" target=\"_blank\">Arduino Example Code</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/AN230_0.61.pdf\" target=\"_blank\">Programming Guide</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/8972\" target=\"_blank\">WRL-08972</a></p>','Digital FM Radio Receiver','','inherit','open','open','','1178-revision','','','2012-12-17 11:15:48','2012-12-17 11:15:48','',1178,'http://localhost/fz-parts/1178-revision/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (1329,1,'2012-12-17 11:15:35','2012-12-17 11:15:35','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> If you&#39;ve ever tried to connect a 3.3V device to a 5V system, you know what a challenge it can be. The SparkFun logic level converter is a small device that safely steps down 5V signals to 3.3V and steps up 3.3V to 5V. This level converter also works with 2.8V and 1.8V devices. Each level converter has the capability of converting 4 pins on the high side to 4 pins on the low side. Two inputs and two outputs are provided for each side.<br />\n\n\n	<br />\n\n\n	Bread board friendly! Can be used with normal serial, I2C, SPI, and any other digital signal. Does not work with an analog signal.<br />\n\n\n	<br />\n\n\n	The level converter is very easy to use. The board needs to be powered from the two voltages sources (high voltage and low voltage) that your system is using. High voltage (5V for example) to the &#39;HV&#39; pin, low voltage (2.8V for example) to &#39;LV&#39;, and ground from the system to the &#39;GND&#39; pin.<br />\n\n\n	<br />\n\n\n	Pins are labeled as <span style=\"font-weight: bold;\">I</span>nputs and <span style=\"font-weight: bold;\">O</span>utputs. These are relative to the board. A digital one going into the RXI pin on the 5V side will show up on the RXO pin on the 3.3V side as 3.3V. A digital one going into the TXI pin on the 3.3V side will show up on the TXO pin on the 5V side as 5V.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span> 0.5x0.6&quot;<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span> <a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Level-Converter-v10.pdf\" target=\"_blank\">Schematic</a></p>','Logic Level Converter','','inherit','open','open','','1038-revision','','','2012-12-17 11:15:35','2012-12-17 11:15:35','',1038,'http://localhost/fz-parts/1038-revision/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (1330,1,'2012-12-17 14:56:11','2012-12-17 14:56:11','<span style=\"font-weight: bold;\">Description:</span> If you\'ve ever tried to connect a 3.3V device to a 5V system, you know what a challenge it can be. The SparkFun logic level converter is a small device that safely steps down 5V signals to 3.3V and steps up 3.3V to 5V. This level converter also works with 2.8V and 1.8V devices. Each level converter has the capability of converting 4 pins on the high side to 4 pins on the low side. Two inputs and two outputs are provided for each side.\r\n\r\nBread board friendly! Can be used with normal serial, I2C, SPI, and any other digital signal. Does not work with an analog signal.\r\n\r\nThe level converter is very easy to use. The board needs to be powered from the two voltages sources (high voltage and low voltage) that your system is using. High voltage (5V for example) to the \'HV\' pin, low voltage (2.8V for example) to \'LV\', and ground from the system to the \'GND\' pin.\r\n\r\nPins are labeled as <span style=\"font-weight: bold;\">I</span>nputs and <span style=\"font-weight: bold;\">O</span>utputs. These are relative to the board. A digital one going into the RXI pin on the 5V side will show up on the RXO pin on the 3.3V side as 3.3V. A digital one going into the TXI pin on the 3.3V side will show up on the TXO pin on the 5V side as 5V.\r\n\r\n<span style=\"font-weight: bold;\">Dimensions:</span> 0.5x0.6\"\r\n\r\n<span style=\"font-weight: bold;\">Documents:</span> <a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Level-Converter-v10.pdf\" target=\"_blank\">Schematic</a>','Logic Level Converter','','inherit','open','open','','1038-revision-2','','','2012-12-17 14:56:11','2012-12-17 14:56:11','',1038,'http://localhost/fz-parts/1038-revision-2/',0,'revision','',0);
