INSERT INTO `wp_posts` VALUES (1334,1,'2012-12-19 12:08:38','2012-12-19 12:08:38','<span style=\"font-weight: bold;\">Description:</span> This is a three axis accelerometer for the LilyPad system. Based on the ADXL335 accelerometer from Analog Devices, the LilyPad Accelerometer can detect joint movement as well as inclination and vibration.\n\nThe ADXL335 outputs a 0V to 3V analog signal on each of the X, Y, and Z axis. You will need to convert this analog voltage to a gravity amount and use trigonometry to calculate a true \'angle\'. If you are not looking for tilt, it is very easy to use this sensor for basic motion sensing.\n\nLilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They\'re even washable!\n\n<span style=\"font-weight: bold;\">Dimensions:</span>\n<ul>\n	<li>20mm outer diameter</li>\n	<li>Thin 0.8mm PCB</li>\n</ul>\n<span style=\"font-weight: bold;\">Documents:</span>\n<ul>\n	<li><a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-Accelerometer-v17.pdf\" target=\"_blank\" name=\"\">Schematic</a></li>\n	<li><a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/ADXL335.pdf\" target=\"_blank\" name=\"\">ADXL335 Datasheet</a></li>\n	<li><a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-Accelerometer-v17Eagle.zip\" target=\"_blank\" name=\"\">Eagle files</a> released under the Creative Commons Attribution</li>\n	<li>Example <a href=\"http://www.pyrofersprojects.com/3dcube.php\" target=\"_blank\">3D cube project</a> using a PIC</li>\n</ul>','LilyPad Accelerometer ADXL335','','inherit','open','open','','1043-autosave','','','2012-12-19 12:08:38','2012-12-19 12:08:38','',1043,'http://localhost/fz-parts/1043-autosave/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (1335,1,'2012-12-19 12:09:51','2012-12-19 12:09:51','<b>Description:</b> This new version adds 2 standoff holes as well as an extra decoupling capacitor. The ADXL345 is a small, thin, low power, 3-axis accelerometer with high resolution (13-bit) measurement at up to ±16 g. Digital output data is formatted as 16-bit twos complement and is accessible through either a SPI (3- or 4-wire) or I2C digital interface.\n\nThe ADXL345 is well suited to measures the static acceleration of gravity in tilt-sensing applications, as well as dynamic acceleration resulting from motion or shock. Its high resolution (4 mg/LSB) enables measurement of inclination changes less than 1.0°.\n\nSeveral special sensing functions are provided. Activity and inactivity sensing detect the presence or lack of motion and if the acceleration on any axis exceeds a user-set level. Tap sensing detects single and double taps. Free-fall sensing detects if the device is falling. These functions can be mapped to one of two interrupt output pins. An integrated, patent pending 32-level first in, first out (FIFO) buffer can be used to store data to minimize host processor intervention. Low power modes enable intelligent motion-based power management with threshold sensing and active acceleration measurement at extremely low power dissipation.\n\n<span style=\"font-weight: bold;\">Features:</span>\n<ul>\n	<li>2.0-3.6VDC Supply Voltage</li>\n	<li>Ultra Low Power: 40uA in measurement mode, 0.1uA in standby@ 2.5V</li>\n	<li>Tap/Double Tap Detection</li>\n	<li>Free-Fall Detection</li>\n	<li>SPI and I2C interfaces</li>\n</ul>\n<b>Documents:</b>\n<ul>\n	<li><a href=\"http://www.sparkfun.com/datasheets/Sensors/Accelerometer/ADXL345-BreakoutBoard-v13.pdf\" target=\"_blank\"> Schematic</a></li>\n	<li><a href=\"http://www.sparkfun.com/datasheets/Sensors/Accelerometer/ADXL345-BreakoutBoard-v13.zip\">Eagle Files</a></li>\n	<li><a href=\"http://www.sparkfun.com/datasheets/Sensors/Accelerometer/ADXL345.pdf\" target=\"_blank\" name=\"\"> Datasheet</a></li>\n	<li><a href=\"http://www.sparkfun.com/tutorials/240\" target=\"_blank\">Quickstart Guide</a></li>\n	<li><a href=\"http://www.sparkfun.com/datasheets/Sensors/Accelerometer/ADXL345-talktest.zip\" target=\"_blank\" name=\"\">Example Code</a> (ATmega328)</li>\n	<li><a href=\"http://bildr.org/2011/03/adxl345-arduino/\" target=\"_blank\">Bildr Tutorial </a></li>\n</ul>\n<strong>Replaces: </strong><a href=\"http://www.sparkfun.com/products/9156\" target=\"_blank\">SEN-09156</a>','Triple Axis Accelerometer Breakout - ADXL345','','inherit','open','open','','957-autosave','','','2012-12-19 12:09:51','2012-12-19 12:09:51','',957,'http://localhost/fz-parts/957-autosave/',0,'revision','',0);
