INSERT INTO `wp_posts` VALUES (1347,1,'2012-12-17 11:16:15','2012-12-17 11:16:15','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>This new revision fixes some minor spacing and labeling issues, but functionality remains the same.The XBee Shield simplifies the task of interfacing an XBee with your Arduino. This board mates directly with an <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9219\" name=\"\" target=\"_blank\">Arduino Pro</a> or <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9950\" target=\"_self\">USB board</a>, and equips it with wireless communication capabilities using the popular XBee module. This unit works with all XBee modules including the Series 1 and Series 2.5, standard and Pro version. This is SparkFun&#39;s own design and is a distant relative to the official XBee Shield from Arduino.<br />\n\n\n	<br />\n\n\n	The serial pins (DIN and DOUT) of the XBee are connected through an SPDT switch, which allows you to select a connection to either the UART pins (D0, D1) or any digital pins on the Arduino (D2 and D3 default). Power is taken from the 5V pin of the Arduino and regulated on-board to 3.3VDC before being supplied to the XBee. The shield also takes care of level shifting on the DIN pin of the XBee.<br />\n\n\n	<br />\n\n\n	The board also includes LEDs to indicate power and activity on DIN, DOUT, RSSI, and DIO5 pins of the XBee. The Arduino&#39;s reset button is brought out on the shield, and a 12x11 grid of 0.1&quot; holes are available for prototyping. The shield does not come with headers installed; we recommend the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" name=\"\" target=\"_self\">6</a> and <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">8-pin stackable headers</a>. The XBee module is also not included.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Mounts directly onto your Arduino</li>\n\n\n	<li>\n\n\n		DIN and DOUT pins of XBee can be connected to either the UART pins or any digital pin on the Arduino (D2 and D3 default)</li>\n\n\n	<li>\n\n\n		3.3V power regulation and level shifting on-board</li>\n\n\n	<li>\n\n\n		12x11 grid of 0.1&quot; spaced prototyping holes</li>\n\n\n	<li>\n\n\n		Reset button brought out</li>\n\n\n	<li>\n\n\n		Power, DIN, DOUT, RSSI and DIO5 indicator LEDs</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/xbeeshield-v13.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/xbeeshield-v13.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/9841\">WRL-09841</a></p>','Arduino XBee Shield','','inherit','open','open','','1322-revision','','','2012-12-17 11:16:15','2012-12-17 11:16:15','',1322,'http://localhost/fz-parts/1322-revision/',0,'revision','',0);
