INSERT INTO `wp_posts` VALUES (3549,1,'2013-04-02 14:18:48','2013-04-02 14:18:48','<b>Venus638FLPX-L GPS Receiver</b><p>\n\nVenus638FLPx is a high performance, low cost, single\nchip GPS receiver targeting mobile consumer and cellular\nhandset applications. It offers very low power\nconsumption, high sensitivity, and best in class signal\nacquisition and time-to-first-fix performance.<p>\nVenus638FLPx contains all the necessary components of\na complete GPS receiver, includes 1.2dB cascaded\nsystem NF RF front-end, GPS baseband signal processor,\n0.5ppm TCXO, 32.768kHz RTC crystal, RTC LDO\nregulator, and passive components. It requires very low\nexternal component count and takes up only 100mm2\nPCB footprint.<p>\nDedicated massive-correlator signal parameter search\nengine within the baseband enables rapid search of all the\navailable satellites and acquisition of very weak signal. An\nadvanced track engine allows weak signal tracking and\npositioning in harsh environments such as urban canyons\nand under deep foliage. The self-contained architecture keeps GPS processing off\nthe host and allows integration into applications with very\nlittle resource.<p>\nFEATURES<p>\n<ul>\n<li>20Hz update rate</li>\n<li>-148dBm cold start sensitivity</li>\n<li>-165dBm tracking sensitivity</li>\n<li>29 second cold start TTFF</li>\n<li>3.5 second TTFF with AGPS</li>\n<li>1 second hot start</li>\n<li>2.5m accuracy</li>\n<li>Multipath detection and suppression</li>\n<li>Jamming detection and mitigation</li>\n<li>SBAS (WAAS / EGNOS) support</li>\n<li>7-day extended ephemeris AGPS</li>\n<li>67mW full power navigation</li>\n<li>Works directly with active or passive antenna</li>\n<li>Internal flash for optional 75K point data logging</li>\n<li>Supports external SPI flash memory data logging</li>\n<li>Complete receiver in 10mm x 10mm x 1.3mm size</li>\n<li>Contains LNA, SAW Filter, TCXO, RTC Xtal, LDO</li>\n<li>Pb-free RoHS compliant</li>\n</ul>','Venus638FLPX-L GPS Receiver','','publish','open','open','','venus638flpx-l-gps-receiver','','','2013-04-02 14:18:48','2013-04-02 14:18:48','',0,'http://localhost/fz-parts/fzp/venus638flpx-l-gps-receiver/',0,'fz_fzp','',0);
