INSERT INTO `wp_posts` VALUES (3657,1,'2013-04-08 08:51:15','2013-04-08 08:51:15','<p>\n\n\n	<strong>Description:</strong> E-paper displays are rad. But those 26-pin SMD connectors can be a real pain to solder, so we put together a breakout board to help you integrate this very cool technology into your next project. This board breaks out all of the major pins from the e-paper ribbon connector to a 0.1&quot; pitch header. Because the e-paper display requires a 35V supply, the breakout also includes a voltage step-up so that you can power the display using either 3.3V or 5V.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/10x2-Epaper-Breakout-Board-v11.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/10x2-Epaper-Breakout-Board-v11.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/LCD/Monochrome/WATN001002BFW00000000.pdf\">Datasheet</a> (E-paper display)</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Prototyping/Connectors/08630.pdf\">Datasheet</a> (SMD Connector)</li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/LCD/Monochrome/ePaperDriver.zip\" target=\"_blank\">Example Code</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://bildr.org/2011/06/epaper-arduino/\" target=\"_blank\">bildr Tutorial</a></li>\n\n\n</ul>','E-Paper Eval Board','','publish','open','open','','e-paper-eval-board','','','2013-04-08 08:51:15','2013-04-08 08:51:15','',0,'http://localhost/fz-parts/fzp/e-paper-eval-board/',0,'fz_fzp','',0);
