INSERT INTO `wp_posts` VALUES (3693,1,'2013-04-08 08:51:16','2013-04-08 08:51:16','<p>\n\n\n	<strong>Description:</strong> This is a breakout for the SOIC version of the 74HC595 shift register IC. Clock in data and latch it to free up IO pins on your micro. All pins from the IC are broken out to standard 0.1&quot; spaced headers. The Serial in and out pins are on opposite sides of the board with the remaining pins carried over so that multiple shift register boards can be chained together.</p>\n\n\n<p>\n\n\n	<b>Documents:</b></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/74HC595 Shift Reg Breakout-v11.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/74HC595 Shift Reg Breakout-v11.zip\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/MM74HC595.pdf\" target=\"_blank\">Datasheet</a> (MM74HC595M)</li>\n\n\n	<li>\n\n\n		<a href=\"http://bildr.org/2011/02/74hc595/\" target=\"_blank\">bildr blog - 74HC595 Project</a></li>\n\n\n</ul>','Shift Register Breakout - 74HC595','','publish','open','open','','shift-register-breakout-74hc595','','','2013-04-08 08:51:16','2013-04-08 08:51:16','',0,'http://localhost/fz-parts/fzp/shift-register-breakout-74hc595/',0,'fz_fzp','',0);
