INSERT INTO `wp_posts` VALUES (3705,1,'2013-04-08 08:51:16','2013-04-08 08:51:16','<div class=\"description\">\n\n\n	<p>\n\n\n		<strong>Description:</strong> The 9DOF Sensor stick is a very small sensor board with 9 degrees of freedom. It includes the ADXL345 accelerometer, the HMC5883L magnetometer, and the ITG-3200 gyro. The &#39;stick&#39; has a simple I2C interface and a mounting hole for attaching it to your project. Also, the board is a mere 0.036&quot; thick (0.093&quot; overall), allowing it to be easily mounted in just about any application.</p>\n\n\n	<p>\n\n\n		<strong>Dimensions:</strong> 1.37x0.42&quot;</p>\n\n\n	<p>\n\n\n		<strong>Documents:</strong></p>\n\n\n	<ul>\n\n\n		<li>\n\n\n			<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/IMU/9DoF-Stick-v13.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n		<li>\n\n\n			<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/IMU/9DoF-Stick-v13.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n		<li>\n\n\n			<a href=\"http://www.sparkfun.com/datasheets/Sensors/Accelerometer/ADXL345.pdf\" target=\"_blank\">Datasheet</a> (ADXL345)</li>\n\n\n		<li>\n\n\n			<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/Magneto/HMC5883L-FDS.pdf\" target=\"_blank\">Datasheet</a> (HMC5883L)</li>\n\n\n		<li>\n\n\n			<a href=\"http://www.sparkfun.com/datasheets/Sensors/Gyro/PS-ITG-3200-00-01.4.pdf\" target=\"_blank\">Datasheet</a> (ITG-3200)</li>\n\n\n	</ul>\n\n\n	<p>\n\n\n		<strong>Replaces: </strong><a href=\"http://www.sparkfun.com/products/10321\" target=\"_blank\">SEN-10321</a></p>\n\n\n</div>','9 Degrees of Freedom - Sensor Stick','','publish','open','open','','9-degrees-of-freedom-sensor-stick','','','2013-04-08 08:51:16','2013-04-08 08:51:16','',0,'http://localhost/fz-parts/fzp/9-degrees-of-freedom-sensor-stick/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3706,1,'2013-04-08 08:51:16','2013-04-08 08:51:16','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This current sensor gives precise current measurement for both AC and DC signals. These are good sensors for metering and measuring overall power consumption of systems. The ACS712 current sensor measures up to 5A of DC or AC current. We added an opamp gain stage for more sensitive current measurements. By adjusting the gain (from 4.27 to 47) you can measure very small currents.<br />\n\n\n	<br />\n\n\n	The ACS712 Low Current Sensor Breakout outputs an analog voltage that varies linearly with sensed current. To calibrate, first set the output offset to the desired level (with zero current on the sense lines, read output with a DVM). Then with a known current input (a 100mA limited supply works well for this), set the output deflection with the gain pot. Sensitivity is then calculated as (Vref - Vdeflect)/(current input).<br />\n\n\n	<br />\n\n\n	The bandwidth on the ASC712 Low Current Sensor Breakout has been set to 34Hz to reduce noise when using at high gains. The full 80KHz bandwidth that the sensor is capable of can be recovered by removing C1. See schematic for more details.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/0712.pdf\" name=\"\" target=\"_blank\">ACS712 Datasheet</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/ACS712%20Low%20Current%20Sensor%20Board%20v12.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://wiring.org.co/learning/basics/currentacs712.html\" target=\"_blank\">Wiring Example</a></li>\n\n\n</ul>','ACS712 Low Current Sensor Board v12','','publish','open','open','','acs712-low-current-sensor-board-v12','','','2013-04-08 08:51:16','2013-04-08 08:51:16','',0,'http://localhost/fz-parts/fzp/acs712-low-current-sensor-board-v12/',0,'fz_fzp','',0);
