INSERT INTO `wp_posts` VALUES (3713,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','<p>\n\n\n	<strong>Description:</strong> The Serial Alphanumeric Display Driver allows you to communicate with alphanumeric displays over a simple SPI interface. Based on the A6282 IC, these boards work well with all of our alphanumeric displays and we have even provided a library listed below.</p>\n\n\n<p>\n\n\n	You can daisy-chain as many displays as you would like to create scrolling messages. Each board has both input and output headers that connect to each other. All you need to do is define the number of displays and your message. Check the example code below.</p>\n\n\n<p>\n\n\n	<strong>Note:</strong> This product includes only the carrier board. You will need to provide your own alphanumeric display. Check the related products below for ones that will work.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/AlphaNumericDisplay-v13.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/AlphaNumericDisplay-v13.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/SMD/A6282.pdf\" target=\"_blank\">Datasheet</a> (A6282)</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/AlphaNumeric_Driver.pde\">Example Arduino Code</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/AlphaNumeric_Driver-v13.zip\">Arduino Library</a></li>\n\n\n</ul>','Serial Alphanumeric Display Driver','','publish','open','open','','serial-alphanumeric-display-driver','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/serial-alphanumeric-display-driver/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3714,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> Ready to add audio to your next project? This small breakout board couples a small electret microphone with a 100x opamp to amplify the sounds of voice, door knocks, etc loud enough to be picked up by a microcontroller&#39;s Analog to Digital converter. Unit comes fully assembled as shown. Works from 2.7V up to 5.5V.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Amplified-Mic-Electret-v14.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"/datasheets/BreakoutBoards/Mic-Testing-v10.zip\" target=\"_blank\">Example PIC ADC Code</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://focus.ti.com/lit/ds/symlink/opa344.pdf\" target=\"_blank\">OPA344 Datasheet</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://negativeacknowledge.com/2008/06/11/final-lightbar-controller/\" target=\"_blank\">Example Audio LED control project</a> by Adam Greig</li>\n\n\n</ul>','Breakout Board for Electret Microphone','','publish','open','open','','breakout-board-for-electret-microphone','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/breakout-board-for-electret-microphone/',0,'fz_fzp','',0);
