INSERT INTO `wp_posts` VALUES (3716,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>The ArduPilot Mega is the newest version of autopilot board designed by Chris Anderson and Jordi Mu&ntilde;oz of DIY Drones. This latest revision uses<span><span> </span></span>the ATmega2560<span><span> in place of the ATmega1280.</span></span><br />\n\n\n	<br />\n\n\n	<span>ArduPilot Mega is a fully programmable autopilot that requires a GPS module and sensors</span><span> to create a functioning Unmanned Aerial Vehicle (UAV). The autopilot handles both stabilization and navigation, eliminating the need for a&nbsp;separate&nbsp;stabilization system. It also supports a &quot;fly-by-wire&quot; mode that can stabilize an aircraft when flying manually under RC control, making it easier and safer to fly. The hardware and software are all open source. The board comes with all the surface-mount parts already soldered, but requires the user to solder on connectors. RC processing firmware is already loaded, but the autopilot software must be downloaded and loaded onto the board by the user.</span><span> It can be programmed with the&nbsp;<a href=\"http://arduino.cc/en/Main/Software\" name=\"\">Arduino IDE</a>. </span><br />\n\n\n	<br />\n\n\n	We recommend the following items to accompany this product:</p>\n\n\n<div>\n\n\n	<ul>\n\n\n		<li>\n\n\n			<a href=\"http://store.diydrones.com/product_p/spk-gps-gs407.htm\">uBlox 5 GPS module</a> and <a href=\"http://store.diydrones.com/product_p/br-0008-01.htm\">adapter</a></li>\n\n\n		<li>\n\n\n			<a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8772\" name=\"\" target=\"\">FTDI Basic</a> or <a href=\"http://store.diydrones.com/ProductDetails.asp?ProductCode=TTL%2D232R%2D3V3\" name=\"\" target=\"_blank\">FTDI cable</a> for programming</li>\n\n\n	</ul>\n\n\n</div>\n\n\n<div>\n\n\n	Other necessary elements, including aircraft recommendations, can be found at the project&#39;s home page.</div>\n\n\n<div>\n\n\n	<div style=\"font-weight: bold;\">\n\n\n		<br />\n\n\n		<span><span>Features:</span></span></div>\n\n\n	<div>\n\n\n		<ul>\n\n\n			<li>\n\n\n				<span>Controller designed to be used with autonomous aircraft, car or boat.</span></li>\n\n\n			<li>\n\n\n				<span><span>Based on a 16MHz Atmega2560 processor.</span></span></li>\n\n\n			<li>\n\n\n				<span><span>Built-in hardware failsafe that uses a separate circuit (multiplexer chip and ATMega328 processor) to transfer control from the RC system to the autopilot and back again. Includes ability to reboot the main processor in mid-flight</span></span></li>\n\n\n			<li>\n\n\n				<span><span>Dual-processor design with 32 MIPS of onboard power</span></span></li>\n\n\n			<li>\n\n\n				<span><span>Supports of 3D waypoints and mission commands (limited only by memory)</span></span></li>\n\n\n			<li>\n\n\n				<span><span>Comes with a 6-pin GPS connector (EM406 style). </span></span></li>\n\n\n			<li>\n\n\n				<span><span>Has 16 spare analog inputs (with ADC on each) and 40 spare digital input/outputs to add additional sensors</span></span></li>\n\n\n			<li>\n\n\n				<span><span>Four dedicated serial ports for two-way telemetry (using optional<a href=\"../commerce/product_info.php?products_id=9097\"> XBee modules</a>) and expansion<br />\n\n\n				</span></span></li>\n\n\n			<li>\n\n\n				<span><span>Can be powered by either the RC receiver or a separate battery</span></span></li>\n\n\n			<li>\n\n\n				<span><span>Hardware-driven servo control, which means less processor overhead, tighter response and no jitters</span></span></li>\n\n\n			<li>\n\n\n				Eight <span><span>RC channels (including the autopilot on/off channel) can be processed by the autopilot.&nbsp;</span></span></li>\n\n\n			<li>\n\n\n				<span><span>LEDs for power, failsafe status, autopilot status and GPS lock</span></span></li>\n\n\n			<li>\n\n\n				<span><span>Full autopilot software, including IMU and groundstation/mission planning code,&nbsp; are available at <a href=\"http://diydrones.com/\">DIY Drones</a>. Code supports autonomous takeoff and landing. </span></span></li>\n\n\n		</ul>\n\n\n	</div>\n\n\n</div>\n\n\n<div>\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span> 40mm x 69mm</div>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/IMU/ArduPilotMega_v15.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/IMU/ArduPilotMega_v15.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/ArduPilotMega_demo.zip\" target=\"_blank\">Example Firmware</a> - reads in 8 channels and outputs 8 channels</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/ArduPilotMega_dancing.zip\" target=\"_blank\">Example Dancing Firmware</a> - <a href=\"http://www.youtube.com/watch?v=U0Smrhy1xYg\" target=\"_blank\">Video</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://ardupilot.com/\" name=\"\" target=\"_blank\">ArduPilot Project Homepage</a></li>\n\n\n	<li>\n\n\n		Software and instructions: <a classname=\"\" href=\"http://diydrones.com/\" name=\"\" target=\"_blank\">DIY Drones Community</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/9710\" target=\"_blank\">GPS-09710</a></p>','ArduPilot Mega','','publish','open','open','','ardupilot-mega','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/ardupilot-mega/',0,'fz_fzp','',0);
