INSERT INTO `wp_posts` VALUES (3718,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','The Arduino Fio is a microcontroller board based on the ATmega328P runs at 3.3V and 8 MHz. It has 14 digital input/output pins (of which 6 can be used as PWM outputs), 8 analog inputs, an on-board resonator, a reset button, and holes for mounting pin headers. It has connections for a Lithium Polymer battery and includes a charge circuit over USB. An XBee socket is available on the bottom of the board.\nThe Arduino Fio is intended for wireless applications. The user can upload sketches with an a FTDI cable or Sparkfun breakout board. Additionally, by using a modified USB-to-XBee adaptor such as XBee Explorer USB, the user can upload sketches wirelessly. The board comes without pre-mounted headers, allowing the use of various types of connectors or direct soldering of wires.\nThe Arduino Fio was designed by Shigeru Kobayashi and SparkFun Electronics, and manufactured by SparkFunElectronics.\n\nhttp://arduino.cc/en/Main/ArduinoBoardFio','Arduino Fio','','publish','open','open','','arduino-fio','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/arduino-fio/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3719,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','The LilyPad Arduino is a microcontroller board designed for wearables and e-textiles. It can be sewn to fabric and similarly mounted power supplies, sensors and actuators with conductive thread.','Arduino LilyPad','','publish','open','open','','arduino-lilypad','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/arduino-lilypad/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3720,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','\n    The Arduino Mini is a small microcontroller board based on the ATmega168 (datasheet), intended for use on breadboards and when space is at a premium. It has 14 digital input/output pins (of which 6 can be used as PWM outputs), 8 analog inputs, and a 16 MHz crystal oscillator. It can be programmed with the Mini USB adapter or other USB or RS232 to TTL serial adapter.\n    \n    http://arduino.cc/en/Main/ArduinoBoardMini','Arduino Mini','','publish','open','open','','arduino-mini','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/arduino-mini/',0,'fz_fzp','',0);
