INSERT INTO `wp_posts` VALUES (3723,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>The VoiceBox Shield can be mounted on top of your <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=666\" name=\"\" target=\"_self\">Arduino USB Board</a> or <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9219\" name=\"\" target=\"_self\">Pro</a>, to give it access to all capabilities of the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9578\" name=\"\" target=\"_self\">SpeakJet</a> voice and sound synthesizer. <span class=\"description\">The Voice Box Shield uses the SpeakJet chip to convert serial commands into a great robot-sounding voice.</span><br />\n\n\n	<br />\n\n\n	Populated on the VoiceBox Shield are the 18-DIP SpeakJet IC and a two stage audio amplifier with a potentiometer to set the gain. You can connect a speaker directly to the &#39;SPK+/-&#39; pins, and get your Arduino-bot talking with very minimal work!<br />\n\n\n	<br />\n\n\n	You can control the SpeakJet through either its serial line, or the eight event input lines which are connected to digital pins 5-12. A 3-way jumper allows you to connect either the software (D2) or hardware (D1) TX pin of the Arduino to the SpeakJet&#39;s serial input.<br />\n\n\n	<br />\n\n\n	Also included on the shield are a 13x7 grid of 0.1&quot; pitch through-holes for prototyping, the Arduino&#39;s reset button. Headers are not included, we recommend the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" name=\"\" target=\"_self\">6</a> and <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">8-pin stackable headers</a>.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Arduino%20Voice%20Shield-v13.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/Code/SpeakJet_Sample.zip\" name=\"\" target=\"_blank\">Example Code</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.youtube.com/watch?v=Eo3hEKAOxeg\" name=\"\" target=\"_blank\">Listen to the SpeakJet!</a> (YouTube)</li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=158\" name=\"\" target=\"_blank\">Talking Wireless Server Tutorial</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/General/speakjet-usermanual.pdf\" name=\"\" target=\"_blank\">SpeakJet User&#39;s Guide</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/General/SpeakJet-dictionary.zip\" name=\"\" target=\"_blank\">SpeakJet Dictionary</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=166\" target=\"_blank\">Tutorial </a>on adding the TTS256 text to speech IC to the shield</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces: </strong><a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9624\" target=\"_self\">DEV-09624</a></p>','Arduino Voicebox Shield (Stephen Hawking in a box)','','publish','open','open','','arduino-voicebox-shield-stephen-hawking-in-a-box','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/arduino-voicebox-shield-stephen-hawking-in-a-box/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3724,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','<p>\n\n\n	<strong>Description:</strong> Ever wonder what would happen if you stacked an Ethernet shield on an Arduino Pro microcontroller and ran over it with a steam roller? Well, it would probably just break. But in a cartoon world it might turn into the Ethernet Pro! The Ethernet Pro is an Arduino-sized, shield-compatible microcontroller with all of the functionality of the Ethernet shield built right in!</p>\n\n\n<p>\n\n\n	The Ethernet Pro is based on the same hardware as the Ethernet shield (Wiznet W5100) in the same configuration so it is a drop-in replacement for the &quot;Arduino/Ethernet double-stack,&quot; and works with all of the existing Ethernet shield libraries and code. This board features the &#39;Optiboot&#39; bootloader, so be sure to select &quot;Arduino Uno&quot; in the Arduino IDE when you program it. The board can be programmed using either an FTDI Basic or the ATmega8U2 breakout (w/ USB-to-Serial firmware).</p>\n\n\n<p>\n\n\n	<strong>Documents: </strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Boards/Arduino-Ethernet-v112pg.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Boards/Arduino-Ethernet-v11.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/W5100_Datasheet_v1_1_6.pdf\" target=\"_blank\">Datasheet</a> (W5100)</li>\n\n\n	<li>\n\n\n		<a href=\"http://arduino.cc/en/Main/ArduinoEthernetShield\" target=\"_blank\">Arduino EthernetShield Page</a></li>\n\n\n</ul>','Ethernet Pro','','publish','open','open','','ethernet-pro','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/ethernet-pro/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3725,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> It&#39;s blue! It&#39;s thin (0.8mm)! It&#39;s the Arduino Pro Mini! SparkFun&#39;s minimal design approach to Arduino. This is a 3.3V Arduino running the 8MHz bootloader (select &#39;Arduino Duemilanove w/ 328&#39; within the Arduino software). Arduino Pro Mini does not come with connectors populated so that you can solder in any connector or wire with any orientation you need. We recommend first time Arduino users start with the Duemilanove. It&#39;s a great board that will get you up and running quickly. The Arduino Pro series is meant for users that understand the limitations of system voltage (3.3V), lack of connectors, and USB off board.</p>\n\n\n<p>\n\n\n	We really wanted to minimize the cost of an Arduino. The Arduino Pro Mini is like the Arduino Mini (same pin out) but to keep the cost low, we used all SMD components, made it two layer, etc. This board connects directly to the FTDI Basic Breakout board and supports auto-reset. The Arduino Pro Mini also works with the FTDI cable but the FTDI cable does not bring out the DTR pin so the auto-reset feature will not work.</p>\n\n\n<p>\n\n\n	Can&#39;t decide which Arduino is right for you? <a classname=\"\" href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=148\" name=\"\" target=\"\">Arduino buying guide</a>!</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		ATmega328 running at 8MHz with external resonator (0.5% tolerance)</li>\n\n\n	<li>\n\n\n		Low-voltage board needs no interfacing circuitry to popular 3.3V devices and modules (GPS, accelerometers, sensors, etc)</li>\n\n\n	<li>\n\n\n		USB connection off board</li>\n\n\n	<li>\n\n\n		Supports auto-reset</li>\n\n\n	<li>\n\n\n		3.3V regulator</li>\n\n\n	<li>\n\n\n		Max 150mA output</li>\n\n\n	<li>\n\n\n		Over current protected</li>\n\n\n	<li>\n\n\n		Reverse polarity protected</li>\n\n\n	<li>\n\n\n		DC input 3.3V up to 12V</li>\n\n\n	<li>\n\n\n		On board Power and Status LEDs</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		0.7x1.3&quot; (18x33mm)</li>\n\n\n	<li>\n\n\n		Less than 2 grams</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents: </span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Boards/Arduino-Pro-Mini-v12.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Boards/Arduino-Pro-Mini-v12.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.arduino.cc/en/Main/ArduinoBoardProMini\" name=\"\" target=\"_blank\">Arduino Pro Mini Homepage</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.arduino.cc/en/Guide/ArduinoProMini\" name=\"\" target=\"_blank\">Getting Started Tutorial</a></li>\n\n\n</ul>','Arduino Pro Mini 3.3V','','publish','open','open','','arduino-pro-mini-3-3v','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/arduino-pro-mini-3-3v/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3726,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','<p>\n\n\n	<b>Description: </b>The Bluetooth Mate is very similar to our BlueSMiRF modem, but it is designed specifically to be used with our <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9219\" name=\"\" target=\"_self\">Arduino Pros</a> and <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9266\" name=\"\" target=\"_self\">LilyPad Arduinos</a>. These modems work as a serial (RX/TX) pipe, and are a great wireless replacement for serial cables. Any serial stream from 9600 to 115200bps can be passed seamlessly from your computer to your target.</p>\n\n\n<p>\n\n\n	Bluetooth Mate has the same pin out as the FTDI Basic, and is meant to plug directly into an Arduino Pro, Pro Mini, or LilyPad Mainboard. Because we&#39;ve arranged the pins to do this, you cannot directly plug the Bluetooth Mate to an FTDI Basic board (you&#39;ll have to swap TX and RX).</p>\n\n\n<p>\n\n\n	The RN-42 is perfect for short range, battery powered applications.&nbsp; The RN-42 uses only 26uA in sleep mode while still being discoverable and connectable.&nbsp; Multiple user configurable power modes allow the user to dial in the lowest power profile for a given application. If you need longer range, check out the Bluetooth Mate Gold.</p>\n\n\n<p>\n\n\n	The Bluetooth Mate has on-board voltage regulators, so it can be powered from any 3.3 to 6VDC power supply. We&#39;ve got level shifting all set up so the RX and TX pins on the remote unit are 3-6VDC tolerant. <span style=\"font-weight: bold;\">Do not</span> attach this device directly to a serial port. You will need an <a href=\"http://www.sparkfun.com/products/449\" target=\"_blank\">RS232 to TTL converter circuit</a> if you need to attach this to a computer.</p>\n\n\n<p>\n\n\n	Unit comes without a connector; if you want to connect it to an Arduino Pro, we&#39;d suggest the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9429\" name=\"\" target=\"_self\">6-pin right-angle female header</a>.</p>\n\n\n<p>\n\n\n	<strong>Note: </strong>The hardware reset pin of the RN-42 module is broken out on the bottom side of the board. This pin is mislabeled as &#39;PIO6&#39;, it is actually PIO4. Should you need to reset the Mate, pull this pin high upon power-up, and then toggle it 3 times.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features</span><b>:</b></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Designed to work directly with Arduino Pro&#39;s and LilyPad main boards</li>\n\n\n	<li>\n\n\n		FCC Approved Class 2 Bluetooth<sup><font face=\"Tahoma, sans-serif\"><b>&reg; </b></font></sup>Radio Modem!</li>\n\n\n	<li>\n\n\n		Low power consumption : 25mA avg</li>\n\n\n	<li>\n\n\n		Hardy frequency hopping scheme - operates in harsh RF environments like WiFi, 802.11g, and Zigbee</li>\n\n\n	<li>\n\n\n		Encrypted connection</li>\n\n\n	<li>\n\n\n		Frequency: 2.4~2.524 GHz</li>\n\n\n	<li>\n\n\n		Operating Voltage: 3.3V-6V</li>\n\n\n	<li>\n\n\n		Serial communications: 2400-115200bps</li>\n\n\n	<li>\n\n\n		Operating Temperature: -40 ~ +70C</li>\n\n\n	<li>\n\n\n		Built-in antenna</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Dimensions: </span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Board: 1.75x0.65&quot;<br />\n\n\n		<span style=\"font-weight: bold;\"> </span></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<b>Documents:</b> <a href=\"http://www.sparkfun.com/datasheets/RF/BlueSMiRF_v1.pdf\" target=\"_blank\"><br />\n\n\n	</a></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Wireless/Bluetooth/ArduinoBluetoothMatev13.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Wireless/Bluetooth/ArduinoBluetoothMatev13.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Wireless/Bluetooth/rn-bluetooth-um.pdf\" name=\"\" target=\"_blank\">RN-42 AT Command Set</a><a href=\"http://www.sparkfun.com/datasheets/RF/RN_BlueportII-ref-guide.pdf\" id=\"Roving Networks Bluetooth Command Set\" name=\"Roving Networks Bluetooth Command Set\" target=\"_blank\"></a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.rovingnetworks.com/documents/RN-41.pdf\" name=\"Roving Networks Bluetooth module datasheet\" target=\"_blank\">Roving Networks Bluetooth<sup><font face=\"Tahoma, sans-serif\"><b>&reg;</b></font></sup> module datasheet</a><br />\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/RF/RN-24-guide.pdf\" id=\"Roving Networks RN-24 Usage Guide\" name=\"Roving Networks RN-24 Usage Guide\" target=\"_blank\"></a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/tutorials/67\" target=\"_blank\">Check out our Bluetooth Tutorial</a></li>\n\n\n</ul>','Bluetooth Mate Silver','','publish','open','open','','bluetooth-mate-silver','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/bluetooth-mate-silver/',0,'fz_fzp','',0);
