INSERT INTO `wp_posts` VALUES (3728,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> The new version of this shield allows for either 3.3 or 5v logic, a separate and more robust VIN connection, and the PWM input has moved to pin 3.</p>\n\n\n<p>\n\n\n	This is a motor shield for Arduino&nbsp;that will control two DC motors. Based on the L298 H-bridge, the Ardumoto can drive up to 2 amps per channel. The board takes its power from the same Vin line as the Arduino board,&nbsp; includes blue and yellow LEDs to indicate active direction, and all driver lines are diode protected from back EMF.<br />\n\n\n	<br />\n\n\n	Control for motor attached to OUT1/2 is connected to digital line 12 (direction A) and digital line 3 (PWM A).<br />\n\n\n	<br />\n\n\n	Control for motor attached to OUT3/4 is connected to digital line 13 (direction B) and digital line 11 (PWM B).<br />\n\n\n	<br />\n\n\n	Compatible screw terminals and connectors are listed below.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Ardumoto_v13.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Ardumoto%20v13.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Robotics/L298_H_Bridge.pdf\" name=\"\" target=\"_blank\">L298 H Bridge data sheet</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Ardumoto_test_3.pde\" target=\"_blank\">Example Arduino sketch</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=183\" target=\"_blank\">Assembly Guide</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=195\" target=\"_blank\">Quickstart Guide</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9213\" target=\"_blank\">DEV-09213</a></p>','Arduino Motor Shield','','publish','open','open','','arduino-motor-shield','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/arduino-motor-shield/',0,'fz_fzp','',0);
