INSERT INTO `wp_posts` VALUES (3730,1,'2013-04-08 08:51:17','2013-04-08 08:51:17','It\'s amazing what you can accomplish with this well-proven microcontroller and its simple PBASIC 1 language.  All vital components (processor, clock source, memory, power regulator) are provided on the BS1\'s tiny PCB; just connect power and go!  The BASIC Stamp 1 (BS1-IC) is an ideal fit for applications that don\'t require the speed, I/O, and memory of the BASIC Stamp 2 series of microcontrollers.','BASIC Stamp 1','','publish','open','open','','basic-stamp-1','','','2013-04-08 08:51:17','2013-04-08 08:51:17','',0,'http://localhost/fz-parts/fzp/basic-stamp-1/',0,'fz_fzp','',0);
