INSERT INTO `wp_posts` VALUES (3738,1,'2013-04-08 08:51:18','2013-04-08 08:51:18','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>This is a simple breakout board for the BMP085 high-precision, low-power barometric pressure sensor. The BMP085 offers a measuring range of 300 to 1100 hPa with an absolute accuracy of down to 0.03 hPa. It&#39;s based on piezo-resistive technology for EMC robustness, high accuracy and linearity as well as long term stability. This sensor supports a voltage supply between 1.8 and 3.6VDC. It is designed to be connected directly to a micro-controller via the I&sup2;C bus</p>\n\n\n<p>\n\n\n	This breadboard-friendly board breaks out all pins of the BMP085 to a 6-pin 0.1&quot; pitch header. The analog and digital supplies (VDDD and VDDA) of the BMP085 are tied together and broken out to a single pin. We&#39;ve also put two 4.7k pull-up resistors on the I<sup>2</sup>C lines.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Digital two wire (I<sup>2</sup>C) interface</li>\n\n\n	<li>\n\n\n		Wide barometric pressure range</li>\n\n\n	<li>\n\n\n		Flexible supply voltage range</li>\n\n\n	<li>\n\n\n		Ultra-low power consumption</li>\n\n\n	<li>\n\n\n		Low noise measurement</li>\n\n\n	<li>\n\n\n		Fully calibrated</li>\n\n\n	<li>\n\n\n		Temperature measurement included</li>\n\n\n	<li>\n\n\n		Ultra-flat, small footprint</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		0.65 x 0.65&quot; (16.5 x 16.5 mm)</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Pressure/BMP085 Breakout-v12.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/General/BST-BMP085-DS000-05.pdf\" name=\"\" target=\"_blank\">Datasheet</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/Weather/BMP085 Breakout-v13.zip\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/tutorials/253\">Quickstart Guide</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/tutorial/Barometric/BMP085_Example_Code.pde\" target=\"_blank\">Example Arduino Sketch</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Pressure/BMP085 Example Code.zip\" target=\"_blank\">Example Code</a> (ATmega328)</li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/General/BMP085_Flyer_Rev.0.2_March2008.pdf\" name=\"\" target=\"_blank\">Product Flyer</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.opencircuits.com/SFE_Footprint_Library_Eagle\" name=\"\" target=\"_blank\">SFE Eagle Library</a> has this part!</li>\n\n\n	<li>\n\n\n		<a href=\"http://wiring.org.co/learning/libraries/bmp085.html\" target=\"_blank\">Wiring Example</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://mbed.org/users/tkreyche/notebook/bmp085-pressure-sensor/\" target=\"_blank\">mbed User Review</a></li>\n\n\n</ul>','Barometric Pressure Sensor - BMP085 Breakout','','publish','open','open','','barometric-pressure-sensor-bmp085-breakout','','','2013-04-08 08:51:18','2013-04-08 08:51:18','',0,'http://localhost/fz-parts/fzp/barometric-pressure-sensor-bmp085-breakout/',0,'fz_fzp','',0);
