INSERT INTO `wp_posts` VALUES (3742,1,'2013-04-08 08:51:18','2013-04-08 08:51:18','<p>\n\n\n	<b>Description: </b>This is a very simple board that takes a 6-12V input voltage and outputs a selectable 5V or 3.3V regulated voltage. All headers are 0.1&quot; pitch for simple insertion into a breadboard.</p>\n\n\n<p>\n\n\n	Input power can be supplied to either the DC barrel jack or the two pin header labeled + and -. Output power is supplied to the pins labeled GND and VCC. Board has both an On/Off switch and a voltage select switch (3.3V/5V).&nbsp;</p>\n\n\n<p>\n\n\n	The two pairs of GND and VCC pins are spaced such that when connected to our <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=112\" name=\"\" target=\"\">Basic Breadboard</a> both power busses will be powered.</p>\n\n\n<p>\n\n\n	Check out our <a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=103\" target=\"_blank\">Unregulated Power Supply Tutorial</a>!</p>\n\n\n<p>\n\n\n	<b>Dimensions:</b> 2.15x0.65&quot;</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		6-12V input voltage via barrel jack or 2-pin header</li>\n\n\n	<li>\n\n\n		3.3V or 5V regulated output voltage</li>\n\n\n	<li>\n\n\n		ON/OFF switch</li>\n\n\n	<li>\n\n\n		Output voltage select switch</li>\n\n\n	<li>\n\n\n		Power status LED</li>\n\n\n	<li>\n\n\n		PTC fuse protected power</li>\n\n\n	<li>\n\n\n		5.5x2.1mm center positive barrel jack</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<b>Documents:</b></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Prototyping/Breadboard Power Supply - SMD v13.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Prototyping/Breadboard Power Supply - SMD v13.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces: </strong><a href=\"http://www.sparkfun.com/products/9319\" target=\"_blank\">PRT-09319</a></p>\n\n\n','Breadboard Power Supply Board SMD','','publish','open','open','','breadboard-power-supply-board-smd','','','2013-04-08 08:51:18','2013-04-08 08:51:18','',0,'http://localhost/fz-parts/fzp/breadboard-power-supply-board-smd/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3743,1,'2013-04-08 08:51:18','2013-04-08 08:51:18','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is a small buzzer for the LilyPad system. Use 2 I/O pins on the LilyPad main board and create different noises based on the different frequency of I/O toggling. Loud enough to hear inside a pocket but not obtrusively loud.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\"> Please note:</span> This is an inductive buzzer meaning that is will act as a short to ground if you are not actively driving it. We recommend you put both I/O pins to low (0V) when the buzzer is not used.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		20mm outer diameter</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-Buzzer.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		LilyPad Buzzer Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPad-Buzzer-08463.pdf\" target=\"_blank\">PDF</a></li>\n\n\n	<li>\n\n\n		All LilyPad Product Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPadFPO-Stickers-MASTER.pdf\" target=\"_blank\">PDF</a></li>\n\n\n</ul>','LilyPad Buzzer','','publish','open','open','','lilypad-buzzer','','','2013-04-08 08:51:18','2013-04-08 08:51:18','',0,'http://localhost/fz-parts/fzp/lilypad-buzzer/',0,'fz_fzp','',0);
