INSERT INTO `wp_posts` VALUES (3745,1,'2013-04-08 08:51:18','2013-04-08 08:51:18','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>The Color LCD Shield, recommended by and designed in partnership with an SFE customer, provides an easy method of connecting the popular <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=569\" name=\"\" target=\"_self\">Nokia 6100 LCD</a> to your <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=666\" name=\"\" target=\"_self\">Arduino USB</a> or <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9219\" name=\"\" target=\"_self\">Pro</a>. The board comes as shown with the 128x128 mini color LCD, as well as a backlight driver circuit (boosts to 7V), and three momentary push-buttons (tied through a jumper to pins D3-5).<br />\n\n\n	<br />\n\n\n	The Nokia 6100 LCD is controlled through a 9-bit SPI interface. The control pins of the LCD are connected to the hardware SPI pins of the Arduino (D13 -SCK, D11 - DIO), the CS pin is tied to D9 and the reset pin is connected to D8. Voltage from the &#39;5V&#39; pin of the Arduino is boosted to 7V to power the LCD backlight.<br />\n\n\n	<br />\n\n\n	The Nokia 6100 LCD is included with the Color LCD Shield. Headers are not soldered on, we recommend the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" name=\"\" target=\"_self\">6</a> and <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">8-pin stackable headers</a>.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Color-LCD-Shield-v12.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Color-LCD-Shield-Example.zip\" name=\"\" target=\"_blank\">Example Code</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://peterdavenport.blogspot.com/p/lcd-library.html\" target=\"_blank\">Example Arduino Library</a> (Thanks Peter!)</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.cbxdragbike.com/arduino/sparkfunlcd/index.html\" target=\"_blank\">Example Arduino Code</a> (Thanks Mark!)</li>\n\n\n</ul>','Arduino Color LCD Shield','','publish','open','open','','arduino-color-lcd-shield','','','2013-04-08 08:51:18','2013-04-08 08:51:18','',0,'http://localhost/fz-parts/fzp/arduino-color-lcd-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3746,1,'2013-04-08 08:51:18','2013-04-08 08:51:18','<p><b>Description:</b></p>\n      <p>The ADJD-S311-CR999 is a great little color light sensor. In fact, it\'s so little that it can be pretty difficult to play with, so we made this evaluation board! It provides all the necessary support circuitry to discern the smallest differences between visible colors.</p>\n\n      <p><b>Dimensions:</b> 21.6x12.7mm (0.85x0.50\")</p>\n\n      <p><b>Documents:</b></p>\n      <ul>\n        <li>\n          <a classname=\"\" href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/LightImaging/ADJD-S311_Breakout-v10.pdf\" name=\"\" target=\"_blank\">Schematic</a>\n        </li>\n        <li>\n          <a classname=\"\" href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/LightImaging/ADJD-S311_Breakout-v10.zip\" name=\"\" target=\"_blank\">Eagle Files</a>\n        </li>\n        <li>\n          <a classname=\"\" href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/LightImaging/datasheetCR999.pdf\" name=\"\" target=\"_blank\">Datasheet (ADJD-S311)</a>\n        </li>\n        <li>\n          <a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Imaging/adjd_s311_cr99_example.pde\" name=\"\" target=\"_blank\">Example Arduino Code</a>\n        </li>\n        <li>\n          <a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Imaging/ADJD-S371-v11.zip\" name=\"\" target=\"_blank\">Example PIC code</a>\n        </li>\n        <li>\n          <a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Imaging/ADJD-S371-v10-ARM.zip\" name=\"\" target=\"_blank\">Example ARM code</a>\n        </li>\n        <li>\n          <a classname=\"\" href=\"http://bildr.org/2012/01/adjd-s311_arduino/\" name=\"\" target=\"_blank\">Bildr Tutorial</a>\n        </li>\n','Color Sensor Breakout ADJD-S311','','publish','open','open','','color-sensor-breakout-adjd-s311','','','2013-04-08 08:51:18','2013-04-08 08:51:18','',0,'http://localhost/fz-parts/fzp/color-sensor-breakout-adjd-s311/',0,'fz_fzp','',0);
