INSERT INTO `wp_posts` VALUES (3752,1,'2013-04-08 08:51:18','2013-04-08 08:51:18','<p>\n\n\n	<strong>Description:</strong> Here is a real time clock based on the DS3234 Real Time Clock IC. The DS3234 is a low-cost, extremely accurate SPI bus real-time clock with an integrated temperature-compensated crystal oscillator and crystal.</p>\n\n\n<p>\n\n\n	The RTC maintains seconds, minutes, hours, day, date, month, and year information. The date at the end of the month is automatically adjusted for months with fewer than 31 days, including corrections of leap year. The clock operates in either the 24-hour or 12-hour format with AM/PM indicator. Two programmable time-of-day alarms and a programmable square-wave output are provided.</p>\n\n\n<p>\n\n\n	The underside of the board holds a 12mm coin-cell battery holder for battery backup.</p>\n\n\n<p>\n\n\n	<strong>Note:</strong> These do not include a battery. See the related products below for a battery.</p>\n\n\n<p>\n\n\n	<strong>Features:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		+-2ppm accuracy</li>\n\n\n	<li>\n\n\n		Two alarms</li>\n\n\n	<li>\n\n\n		SPI output</li>\n\n\n	<li>\n\n\n		Low power consumption</li>\n\n\n	<li>\n\n\n		Accurate calendar up to year 2100</li>\n\n\n	<li>\n\n\n		Battery backup included</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/DeadOn%20RTC%20-%20DS3234%20Breakout-v11.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/DeadOn RTC - DS3234 Breakout-v11.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/DS3234.pdf\" target=\"_blank\">Datsheet</a> (DS3234)</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/DS3234_Example_Code.c\" target=\"_blank\">Example Code</a></li>\n\n\n</ul>','DeadOn RTC - DS3234 Breakout','','publish','open','open','','deadon-rtc-ds3234-breakout','','','2013-04-08 08:51:18','2013-04-08 08:51:18','',0,'http://localhost/fz-parts/fzp/deadon-rtc-ds3234-breakout/',0,'fz_fzp','',0);
