INSERT INTO `wp_posts` VALUES (3756,1,'2013-04-08 08:51:18','2013-04-08 08:51:18','<p>\n\n	<strong>Replacement:</strong> <a href=\"http://www.sparkfun.com/products/10267\" target=\"_blank\">ROB-10267</a>. The new version fixes the silkscreen error. This page is for reference only.</p>\n\n<p>\n\n	<span style=\"font-weight: bold;\">Description:</span> The EasyDriver is a simple to use stepper motor driver, compatible with anything that can output a digital 0 to 5V pulse. EasyDriver requires a 7V to 30V supply to power the motor, and has an on board voltage regulator for the digital interface. Connect a 4-wire stepper motor and a microcontroller and you&#39;ve got precision motor control! EasyDriver drives bi-polar motors, and motors wired as bi-polar. I.e. 4,6, or 8 wire stepper motors.</p>\n\n<p>\n\n	This is the newest version of EasyDriver V4 co-designed with <a classname=\"\" href=\"http://www.schmalzhaus.com/\" name=\"\" target=\"_blank\">Brian Schmalz</a>. It provides much more flexibility and control over your stepper motor, when compared to older versions.&nbsp;The microstep select (MS1 and MS2) pins of the A3967 are broken out allowing adjustments to the microstepping resolution. The sleep and enable pins are also broken out for further control.<br />\n\n	<br />\n\n	<span style=\"font-weight: bold;\">Caution:</span> Do not connect or disconnect a motor while the driver is energized. This will cause permanent damage to the A3967 IC.</p>\n\n<p>\n\n	<strong>Note:</strong> Version 4.3 of the PCB has an error on the Current Adjustment silkscreen. The Min/Max labels are reversed. The correct direction for maximum current is counter-clockwise.<br />\n\n	<br />\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n<ul>\n\n	<li>\n\n		A3967 microstepping driver</li>\n\n	<li>\n\n		MS1 and MS2 pins broken out to change microstepping resolution to full, half, quarter and eigth steps</li>\n\n	<li>\n\n		Compatible with 4, 6, and 8 wire stepper motors</li>\n\n	<li>\n\n		Adjustable current control from 150mA/phase to 750mA/phase</li>\n\n	<li>\n\n		Power supply range from 7V to 30V. The higher the voltage, the higher the torque.</li>\n\n</ul>\n\n<p>\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n<ul>\n\n	<li>\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Robotics/EasyDriver_v43.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n	<li>\n\n		<a href=\"http://www.sparkfun.com/datasheets/Robotics/A3967.pdf\" target=\"_blank\">A3967 Datasheet</a></li>\n\n	<li>\n\n		<a classname=\"\" href=\"http://schmalzhaus.com/EasyDriver/\" name=\"\" target=\"_blank\">EasyDriver Website</a></li>\n\n	<li>\n\n		Example <a classname=\"\" href=\"http://www.tigoe.net/pcomp/code/circuits/motors/controlling-dc-motors\" target=\"_blank\">Stepper Motor Control</a></li>\n\n	<li>\n\n		Example <a classname=\"\" href=\"http://lusorobotica.com/index.php/topic,106.0.html\" name=\"\" target=\"_blank\">Arduino Tutorial</a> in Portuguese</li>\n\n</ul>\n\n<p>\n\n	&nbsp;</p>\n\n<ul>\n\n</ul>','EasyDriver_v44','','publish','open','open','','easydriver_v44','','','2013-04-08 08:51:18','2013-04-08 08:51:18','',0,'http://localhost/fz-parts/fzp/easydriver_v44/',0,'fz_fzp','',0);
