INSERT INTO `wp_posts` VALUES (3759,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is the newest revision of our <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9115\">FTDI Basic</a>. We now use a SMD 6-pin header on the bottom, which makes it smaller and more compact. Functionality has remained the same.</p>\n\n\n<p>\n\n\n	This is a basic breakout board for the FTDI FT232RL USB to serial IC. The pinout of this board matches the FTDI cable to work with official Arduino and cloned 5V Arduino boards. It can also be used for general serial applications. The major difference with this board is that it brings out the DTR pin as opposed to the RTS pin of the FTDI cable. The DTR pin allows an Arduino target to auto-reset when a new Sketch is downloaded. This is a really nice feature to have and allows a sketch to be downloaded without having to hit the reset button. This board will auto reset any Arduino board that has the reset pin brought out to a 6-pin connector.<br />\n\n\n	<br />\n\n\n	The pins labeled BLK and GRN correspond to the colored wires on the FTDI cable. The black wire on the FTDI cable is GND, green is CTS. Use these BLK and GRN pins to align the FTDI basic board with your Arduino target.<br />\n\n\n	<br />\n\n\n	This board has TX and RX LEDs that make it a bit better to use over the FTDI cable. You can actually see serial traffic on the LEDs to verify if the board is working.<br />\n\n\n	<br />\n\n\n	This board was designed to decrease the cost of Arduino development and increase ease of use (the auto-reset feature rocks!). Our Arduino Pro boards and LilyPads use this type of connector.<br />\n\n\n	<br />\n\n\n	One of the nice features of this board is a jumper on the back of the board that allows the board to be configured to either 3.3V or 5V (both power output and IO level). This board ship default to 5V, but you can cut the default trace and add a solder jumper if you need to switch to 3.3V.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents: </span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/FTDI%20Basic-v21-5V.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/FTDI Basic-v21-5V.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.google.com/url?sa=t&amp;ct=res&amp;cd=1&amp;url=http%3A%2F%2Fwww.ftdichip.com%2FFTDrivers.htm&amp;ei=D7WlSMGOJKOKiAGx-82BDQ&amp;usg=AFQjCNE2pWdUmKFsw6OAb9hwsC8CtftzFQ&amp;sig2=HQApwDh2F68V38PkMHy6jg\" target=\"_blank\">FTDI Drivers</a></li>\n\n\n</ul>','FTDI Basic Programmer','','publish','open','open','','ftdi-basic-programmer','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/ftdi-basic-programmer/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3760,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is the newest revision of our <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8772\">FTDI Basic</a>. We now use a SMD 6-pin header on the bottom, which makes it smaller and more compact. Functionality has remained the same.</p>\n\n\n<p>\n\n\n	This is a basic breakout board for the FTDI FT232RL USB to serial IC. The pinout of this board matches the FTDI cable to work with official Arduino and cloned 3.3V Arduino boards. It can also be used for general serial applications. The major difference with this board is that it brings out the DTR pin as opposed to the RTS pin of the FTDI cable. The DTR pin allows an Arduino target to auto-reset when a new Sketch is downloaded. This is a really nice feature to have and allows a sketch to be downloaded without having to hit the reset button. This board will auto reset any Arduino board that has the reset pin brought out to a 6-pin connector.<br />\n\n\n	<br />\n\n\n	The pins labeled BLK and GRN correspond to the colored wires on the FTDI cable. The black wire on the FTDI cable is GND, green is DTR. Use these BLK and GRN pins to align the FTDI basic board with your Arduino target.<br />\n\n\n	<br />\n\n\n	There are pros and cons to the FTDI Cable vs the FTDI Basic. This board has TX and RX LEDs that allow you to actually see serial traffic on the LEDs to verify if the board is working, but this board requires a Mini-B cable. The FTDI Cable is well protected against the elements, but is large and cannot be embedded into a project as easily. The FTDI Basic uses DTR to cause a hardware reset where the FTDI cable uses the RTS signal.<br />\n\n\n	<br />\n\n\n	This board was designed to decrease the cost of Arduino development and increase ease use (the auto-reset feature rocks!). Our Arduino Pro and LilyPad boards use this type of connector<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents: </span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/FTDI Basic-v22-3.3V.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/FTDI Basic-v22-3.3V.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.google.com/url?sa=t&amp;ct=res&amp;cd=1&amp;url=http%3A%2F%2Fwww.ftdichip.com%2FFTDrivers.htm&amp;ei=D7WlSMGOJKOKiAGx-82BDQ&amp;usg=AFQjCNE2pWdUmKFsw6OAb9hwsC8CtftzFQ&amp;sig2=HQApwDh2F68V38PkMHy6jg\" target=\"_blank\">FTDI Drivers</a></li>\n\n\n</ul>\n\n\n','FTDI Basic Programmer','','publish','open','open','','ftdi-basic-programmer-2','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/ftdi-basic-programmer-2/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3761,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is the LilyPad revision of our <a href=\"http://www.sparkfun.com/products/9716\">FTDI Basic</a>. It is the same as our other FTDI Basic, but has a purple LilyPad board which is half the thickness.</p>\n\n\n<p>\n\n\n	This is a basic breakout board for the FTDI FT232RL USB to serial IC. The pinout of this board matches the FTDI cable to work with official Arduino and cloned 5V Arduino boards. It can also be used for general serial applications. The major difference with this board is that it brings out the DTR pin as opposed to the RTS pin of the FTDI cable. The DTR pin allows an Arduino target to auto-reset when a new Sketch is downloaded. This is a really nice feature to have and allows a sketch to be downloaded without having to hit the reset button. This board will auto reset any Arduino board that has the reset pin brought out to a 6-pin connector.<br />\n\n\n	<br />\n\n\n	The pins labeled BLK and GRN correspond to the colored wires on the FTDI cable. The black wire on the FTDI cable is GND, green is CTS. Use these BLK and GRN pins to align the FTDI basic board with your Arduino target.<br />\n\n\n	<br />\n\n\n	This board has TX and RX LEDs that make it a bit better to use over the FTDI cable. You can actually see serial traffic on the LEDs to verify if the board is working.<br />\n\n\n	<br />\n\n\n	This board was designed to decrease the cost of Arduino development and increase ease of use (the auto-reset feature rocks!). Our Arduino Pro boards and LilyPads use this type of connector.<br />\n\n\n	<br />\n\n\n	One of the nice features of this board is a jumper on the back of the board that allows the board to be configured to either 3.3V or 5V (both power output and IO level). This board ship as 5V, but you can cut the default trace and add a solder jumper if you need to switch to 3.3V.</p>\n\n\n<p>\n\n\n	<strong>Note:</strong> A portion of this sale is given back to Dr. Leah Buechley for continued development and education of e-textiles.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents: </span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad%20FTDI%20Basic-v21-5V.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad FTDI Basic-v21-5V.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.google.com/url?sa=t&amp;ct=res&amp;cd=1&amp;url=http%3A%2F%2Fwww.ftdichip.com%2FFTDrivers.htm&amp;ei=D7WlSMGOJKOKiAGx-82BDQ&amp;usg=AFQjCNE2pWdUmKFsw6OAb9hwsC8CtftzFQ&amp;sig2=HQApwDh2F68V38PkMHy6jg\" target=\"_blank\">FTDI Drivers</a></li>\n\n\n</ul>\n\n\n','FTDI Basic Programmer','','publish','open','open','','ftdi-basic-programmer-3','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/ftdi-basic-programmer-3/',0,'fz_fzp','',0);
