INSERT INTO `wp_posts` VALUES (3764,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>Adding GPS to your Arduino has never been easier. The multiple GPS receivers attach easily to the shield, and with the <a href=\"http://www.sparkfun.com/tutorial/GPSQuickStart/gps_parsing_v13.pde\">example sketch</a>, you will be able to locate your exact position within a few meters. Here&#39;s where <a href=\"http://maps.google.com/maps?q=40.06477,+-105.20997\" target=\"_blank\">we are</a>. GPS also gives you amazingly accurate time! A <a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=173\">GPS quickstart guide</a> is available for this product.</p>\n\n\n<p>\n\n\n	With the GPS Shield you can add GPS functionality to your Arduino. A connector for the popular <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=465\" name=\"\" target=\"_blank\">EM-406</a> GPS receiver is populated on the board, and footprints for <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8288\" name=\"\" target=\"_self\">EM-408</a> and <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8297\" name=\"\" target=\"_self\">EB-85A</a> connectors are also made available (connectors are not soldered on or included and can be found below in the related items). There is also a spot for the <a href=\"http://www.sparkfun.com/products/9758\" target=\"_blank\">SUP500</a> GPS module. The regular GPS pins (RX, TX, PPS, etc.) are also broken out to a 10-pin 0.1&quot; pitch header, and a small protoyping area is also provided.</p>\n\n\n<p>\n\n\n	The DLINE/UART switch switches the GPS module&#39;s input/output between Arduino&#39;s standard TX/RX pins or any digital pins on the Arduino (default setting uses pins 3 and 2 connected to TX and RX, respectively). The regular GPS pins (RX, TX, PPS, etc.) are broken out to a 10-pin 0.1&quot; pitch header, and a small protoyping area is also provided. An ON/OFF switch is included which controls power to the GPS module. Additionally, the Arduino reset switch is also brought out.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Note: </span>The DLINE/UART switch must be set to DLINE in order to upload code through the Arduino IDE.</p>\n\n\n<p>\n\n\n	The shield also includes the footprint for a <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=7948\" name=\"\" target=\"_blank\">12mm coin cell battery holder</a> to provide battery backup to the optional EB-85A gps module.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Note: </span>GPS modules are not included with the GPS Shield, and only the EM-406 connector is populated. Headers are also not installed or included, we recommend the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" name=\"\" target=\"_self\">6</a> and <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">8-pin stackable headers</a>.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		EM-406 connector populated</li>\n\n\n	<li>\n\n\n		EM-408 and EB-85A connector footprints provided and connected for optional use</li>\n\n\n	<li>\n\n\n		SUP500 connector and footprint</li>\n\n\n	<li>\n\n\n		Coin cell battery socket footprint provided and connected for optional battery backup of EB-85A GPS module</li>\n\n\n	<li>\n\n\n		Standard Arduino sized shield</li>\n\n\n	<li>\n\n\n		Prototyping area</li>\n\n\n	<li>\n\n\n		GPS serial and PPS signals broken out to a 0.1&quot; header for additional device connections</li>\n\n\n	<li>\n\n\n		Arduino reset button</li>\n\n\n	<li>\n\n\n		DLINE/UART switch controls serial communications</li>\n\n\n	<li>\n\n\n		ON/OFF switch controls power to GPS module</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=173\">GPS Quickstart Guide</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=184\">Assembly Guide</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/tutorial/GPSQuickStart/gps_parsing_v13.pde\">Example Sketch</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/GPSShield-v14.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/GPSShield-v14.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces: </strong><a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9487\" target=\"_blank\">GPS-09487</a></p>','Arduino GPS Shield','','publish','open','open','','arduino-gps-shield','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/arduino-gps-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3765,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> Simple breakout board for the MQ - 3, MQ - 4, MQ - 6 and MQ - 7 gas sensors.&nbsp; All you need is VCC at 5V, GND, and a resistor to an ADC, that is it.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Note: </span>This is the PCB only. Sensors listed below.<br style=\"font-weight: bold;\" />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span> 16.8mm diameter<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Gas_Sensor_Breakout-v11.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://wiring.org.co/learning/basics/airqualitymq135.html\" target=\"_blank\">Wiring Example</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<br />\n\n\n	&nbsp;</p>','Gas Sensor Breakout Board','','publish','open','open','','gas-sensor-breakout-board','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/gas-sensor-breakout-board/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3766,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','(Identical part HCF4094)\n\nThe HEF4094 is an 8-stage serial shift register. It has a storage latch associated with each stage for strobing data from the serial input to parallel buffered 3-state outputs. \n\nThe parallel outputs may be connected directly to common bus lines. \n\nData is shifted on positive-going clock transitions. The data in each shift register stage is transferred to the storage register when the strobe input is HIGH. Data in the storage register appears at the outputs whenever the output enable signal is HIGH.\n\nTwo serial outputs are available for cascading a number of HEF4094 devices. \n\nSerial data is available at QS on positive-going clock edges to allow high-speed operation in cascaded systems with a fast clock rise time. The same serial data is available at Q\'S on the next negative going clock edge. This is used for cascading HEF4094 devices when the clock has a slow rise time.\n\nIt operates over a recommended VDD power supply range of 3 V to 15 V referenced to VSS (usually ground). Unused inputs must be connected to VDD, VSS, or another input. \n','HEF4094','','publish','open','open','','hef4094','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/hef4094/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3767,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is a breakout board for Honeywell&#39;s HIH-4030 humidity sensor. The HIH-4030 measures relative humidity (%RH) and delivers it as an analog output voltage. You can connect the output of the sensor directly to an ADC on a microcontroller; and, thanks to the sensor&#39;s near linear voltage output, the data is very easy to process.<br />\n\n\n	<br />\n\n\n	Voltage applied to the supply pins should be within 4-5.8VDC, and optimally at 5V. The sensor will typically only consume about 200&mu;A.<br />\n\n\n	<br />\n\n\n	This product comes as shown in the picture, with the HIH-4030 soldered onto the breakout board. The pins of the 3-pin header are spaced by 0.1&quot;.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Near linear, analog output</li>\n\n\n	<li>\n\n\n		4-5.8VDC voltage supply</li>\n\n\n	<li>\n\n\n		All pins broken out to a 0.1&quot; pitch header</li>\n\n\n	<li>\n\n\n		Laser trimmed interchangeability</li>\n\n\n	<li>\n\n\n		Low power design, typical current draw of only 200&mu;A</li>\n\n\n	<li>\n\n\n		Enhanced accuracy</li>\n\n\n	<li>\n\n\n		Fast response time</li>\n\n\n	<li>\n\n\n		Stable, low drift performance</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span> 0.75 x 0.30 &quot; (19.05 x 7.62 mm)<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Weather/HIH-4030_Breakout-v10.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Weather/SEN-09569-HIH-4030-datasheet.pdf\" name=\"\" target=\"_blank\">HIH-4030 Humidity Sensor Datasheet</a></li>\n\n\n</ul>','Humidity Sensor - HIH-4030 Breakout','','publish','open','open','','humidity-sensor-hih-4030-breakout','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/humidity-sensor-hih-4030-breakout/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3768,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','This is a breakout board for Honeywell\'s HMC5883, a 3-axis digital compass. Communication with the HMC5883 is simple and all done through an I2C interface. There is no on-board regulator, so a regulated voltage of 2.16-3.6VDC should be supplied.\n\n\n\nThe breakout board includes the HMC584843 sensor and all filtering capacitors as shown. The power and 2-wire interface pins are all broken out to a 0.1\" pitch header.\n\n\n\nFeatures:\n\n\n\n   * Simple I2C interface\n\n   * 2.16 to 3.6VDC supply range\n\n   * Low current draw\n\n   * 5 milli-gauss resolution\n\n\n\nDimensions: 0.7x0.7\" (17.78x17.78mm) ','Triple Axis Magnetometer - HMC5883 Breakout','','publish','open','open','','triple-axis-magnetometer-hmc5883-breakout','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/triple-axis-magnetometer-hmc5883-breakout/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3769,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<b>Description:</b> This is a very simple breakout board for the popular HMC6352. Remember the KISS mantra? We really enjoy the simplicity and ease of use with the HMC6352. If you need simple, clean, degree resolution compass heading, this is the way to go.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Simple I2C interface</li>\n\n\n	<li>\n\n\n		2.7 to 5.2V supply range</li>\n\n\n	<li>\n\n\n		1 to 20Hz selectable update rate</li>\n\n\n	<li>\n\n\n		True drop-in solution</li>\n\n\n	<li>\n\n\n		0.5 degree heading resolution</li>\n\n\n	<li>\n\n\n		1 degree repeatability</li>\n\n\n	<li>\n\n\n		Supply current : 1mA @ 3V</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:<br />\n\n\n	</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Magneto/HMC6352-v16.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/HMC6352.pdf\" target=\"_blank\">HMC6352 Datasheet</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.ssec.honeywell.com/magnetic/hmc6352.html\" target=\"_blank\">Honeywell Product Page</a></li>\n\n\n	<li>\n\n\n		<a href=\"../../../../Code/LPC2138_Test_IIC.zip\" target=\"_blank\">Example I2C project</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://wiring.org.co/learning/libraries/hmc6352sparkfun.html\" name=\"\" target=\"_blank\">Wiring Example</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://lusorobotica.com/index.php/topic,36.0.html\" name=\"\" target=\"_blank\">Example project</a> in Portuguese - Thanks Tiago!</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.youtube.com/watch?v=sBKHdt0OdPg\" target=\"_blank\">Digital Compass How-To Video</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://mbed.org/cookbook/HMC6352-Digital-Compass\" target=\"_blank\">mbed Example</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://bildr.org/2011/01/hmc6352/\">Bildr Tutorial</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span> 0.6x0.6&quot; (15x15mm)</p>','Compass Module - HMC6352','','publish','open','open','','compass-module-hmc6352','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/compass-module-hmc6352/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3770,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','A breadboard for easily prototyping circuits','Half breadboard','','publish','open','open','','half-breadboard','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/half-breadboard/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3771,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p><b>Description:</b></p>\n      <p>This is a simple breakout board for the SHT15 humidity sensor from Sensirion. The SHT15 digital humidity and temperature sensor is fully calibrated and offers high precision and excellent long-term stability at low cost. The digital CMOSens Technology integrates two sensors and readout circuitry on one single chip.\n\n      These sensors are really impressive! Very sensitive and straight forward to use. Board comes assembled and tested with the SHT15.</p>\n\n      <p><b>Features:</b></p>\n\n<ul>\n	<li>2 factory calibrated sensors for relative humidity & temperature</li>\n	<li>Digital 2-wire interface</li>\n	<li>Precise dewpoint calculation possible</li>\n	<li>Measurement range: 0-100% RH</li>\n	<li>Absolute RH accuracy: +/- 2% RH (10...90% RH)</li>\n	<li>Repeatability RH: +/- 0.1% RH</li>\n	<li>Temp. accuracy: +/- 0.3°C @ 25°C</li>\n	<li>Fast response time < 4 sec.</li>\n	<li>Low power consumption (typ. 30 µW)</li>\n	<li>Low cost</li>\n	<li>High precision sensor at low cost</li>\n	<li>Leading CMOSens Technology for superior long-term stability</li>\n</ul>\n\n<p><b>Applications:</b></p>\n\n<ul>\n	<li>Precise data logging</li>\n	<li>Transmitters</li>\n	<li>Automation & process control</li>\n	<li>Building control and HVAC</li>\n	<li>Test & Measurement</li>\n	<li>Medical</li>\n</ul>\n\n<p><b>Documents:</b></p>\n\n<ul>\n  <li>\n    <a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Pressure/SHT1x-Breakout-v13.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n  </li>\n  <li>\n     <a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Pressure/SHT1x-Breakout-v13.zip\" name=\"\" target=\"_blank\">Eagle Files</a></li>\n  </li>\n  <li>\n    <a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Datasheet-humidity-sensor-SHT1x.pdf\" name=\"\" target=\"_blank\"> SHT1x Datasheet</a></li>\n  </li>\n  <li>\n     <a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/SHT15-Testing-v11.zip\" name=\"\" target=\"_blank\">Example C Code (PIC 16F88)</a></li>\n  </li>\n  <li>\n     <a classname=\"\" href=\"http://wiring.org.co/learning/basics/humiditytemperaturesht15.html\" name=\"\" target=\"_blank\">Wiring Example</a></li>\n  </li>\n  <li>\n     <a classname=\"\" href=\"http://www.sensirion.com/en/02_sensors/03_humidity/00_humidity_temperature_sensor/03_humidity_sensor_sht15.htm\" name=\"\" target=\"_blank\">Application Notes</a></li>\n  </li>\n  <li>\n     <a classname=\"\" href=\"http://www.sensirion.com/images/getFile?id=11\" name=\"\" target=\"_blank\">Calibration Certificate</a></li>\n  </li>\n  <li>\n     <a classname=\"\" href=\"http://www.sensirion.com/images/getFile?id=123\" name=\"\" target=\"_blank\">RoHS Certificate</a></li>\n  </li>\n</ul>','Humidity Temperature Sensor SHT15','','publish','open','open','','humidity-temperature-sensor-sht15','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/humidity-temperature-sensor-sht15/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3772,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','Digital relative humidity & temperature sensor RHT03','Humidity and Temperature Sensor RHT03','','publish','open','open','','humidity-and-temperature-sensor-rht03','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/humidity-and-temperature-sensor-rht03/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3773,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<strong>Description: </strong>The IOIO (pronounced &quot;yo-yo&quot;) is a board specially designed to work with your Android device (OS versions 1.5 and greater). The board provides robust connectivity to an Android device via a USB connection and is fully controllable from within an Android application using a simple and intuitive Java API -<a href=\"http://codaset.com/ytai/ioio/wiki/The-IOIO-Manager-Application\" target=\"_blank\"><strong><em> </em></strong>no embedded programming or external programmer will ever be needed</a>!</p>\n\n\n<p>\n\n\n	So far, the devices proven to work are: G1, Nexus One, Nexus S, Motorola Droid X. If you get the IOIO working on your Android device, please let us know in the comments below, thanks!</p>\n\n\n<p>\n\n\n	The IOIO board contains a single MCU that acts as a USB host and interprets commands from an Android app. In addition, the IOIO can interact with peripheral devices in the same way as most MCUs. Digital Input/Output, PWM, Analog Input, I2C, SPI, and UART control can all be used with the IOIO. Code to control these interfaces is written in the same way as you write an Android app with the help of a simple to use app-level library. In other words, you can combine the awesome computing power, Internet/Bluetooth connectivity, touch screen, and a variety of sensors from your Android device with the ability to easily add peripheral devices to interact with the outside world. Also, using the IOIO does not require any hardware or software modifications to your Android device, thus preserving the warranty as well as making the functionality available to non-hackers.</p>\n\n\n<p>\n\n\n	If you are new to the IOIO or developing apps with Android, please use these resources to help get started:</p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/tutorials/280\" target=\"_blank\">Beginner&#39;s Guide</a></li>\n\n\n	<li>\n\n\n		<a href=\"http:// http://codaset.com/ytai/ioio/wiki/Downloads\" target=\"_blank\">Example Projects</a> (see the &#39;Application&#39; directory in the latest download)</li>\n\n\n</ul>\n\n\n<p>\n\n\n	For firmware upgrades, you can download the <a href=\"https://market.android.com/details?id=ioio.manager\" target=\"_blank\">IOIO Manager app</a> (see the QR code in the images to the right). Also featured is a Programmer function, which lets you upgrade the bootloader of your IOIO using another IOIO as a programmer! See the <a href=\"http://codaset.com/ytai/ioio/wiki/The-IOIO-Manager-Application\" target=\"_blank\">IOIO Manager wiki</a> for more information.</p>\n\n\n<p>\n\n\n	<strong>Update</strong>: The IOIO now has beta firmware available which supports Google&#39;s Open Accessory (ADK) protocol. The code base can be found <a href=\"http://codaset.com/ytai/ioio/wiki/IOIO-Over-OpenAccessory-Beta\" target=\"_blank\">here</a>.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Android/IOIO-v15.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Android/IOIO-v15.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://codaset.com/ytai/ioio/wiki/Downloads\" target=\"_blank\">Firmware Downloads</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://codaset.com/ytai/ioio/source\" target=\"_blank\">IOIO Code Base</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/tutorials/280\" target=\"_blank\">Beginner&#39;s Guide</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://codaset.com/ytai/ioio/wiki\" target=\"_blank\">IOIO Wiki Home</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://codaset.com/ytai/ioio/wiki/The-IOIO-Manager-Application\" target=\"_blank\">IOIO Manager Wiki</a></li>\n\n\n	<li>\n\n\n		<a href=\"https://market.android.com/details?id=ioio.manager\" target=\"_blank\">IOIO Manager Application</a></li>\n\n\n	<li>\n\n\n		<a href=\"https://groups.google.com/forum/?pli=1#%21forum/ioio-users\" target=\"_blank\">IOIO Discussion/Support Group</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/10585\" target=\"_blank\">DEV-10585</a></p>','IOIO for Android','','publish','open','open','','ioio-for-android','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/ioio-for-android/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3774,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is a very small infrared receiver based on the TSOP85 receiver from Vishay. This receiver has all the filtering and 38kHz demodulation built into the unit. Simply point a IR remote at the receiver, hit a button, and you&#39;ll see a stream of 1s and 0s out of the data pin.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Infrared/tsop853.pdf\" name=\"\" target=\"_blank\">Datasheet</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Infrared/IR-Receiver-Schematic.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://en.wikipedia.org/wiki/Consumer_IR\" target=\"_blank\">Consumer IR Information</a></li>\n\n\n</ul>','IR Receiver Breakout','','publish','open','open','','ir-receiver-breakout','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/ir-receiver-breakout/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3775,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is a breakout board for the ISD1932, a<span id=\"RadEditorPlaceHolderControl1\"> multiple-message record/playback device.</span> This single chip can record up to 64 seconds worth of voice messages. Microphone inputs and speaker outputs are all handled by the ISD1932.<br />\n\n\n	<br />\n\n\n	A switch is connected to allow selection of the ISD1932&#39;s operating mode - <span id=\"RadEditorPlaceHolderControl1\">address trigger or direct trigger.</span> You must cycle the power after switching the mode. An LED is also populated on the board and will illuminate when the device is recording.<br />\n\n\n	<br />\n\n\n	An external resistor is necessary to select the record duration and sampling frequency, which can range from 21.2 - 64 seconds (4-12kHz sampling frequency).<br />\n\n\n	<br />\n\n\n	The board breaks out all pins of the ISD1932 to 0.1&quot; spaced headers. This product comes as shown in the pictures with filtering capacitors, an LED, mode selecting switch and the ISD1932 IC.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Operating mode selector switch</li>\n\n\n	<li>\n\n\n		2.4V to 5VDC supply voltage</li>\n\n\n	<li>\n\n\n		LED indicates if the board is recording</li>\n\n\n	<li>\n\n\n		Record up to 64 seconds of audio</li>\n\n\n	<li>\n\n\n		All pins of the ISD1932 broken out to 0.1&quot; headers</li>\n\n\n	<li>\n\n\n		Breadboard friendly</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Dimensions: </span>1.0 x 1.3 &quot; (25.4 x 33.02 mm)<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/BOB-09579-ISD1932%20Breakout-v11.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/BOB-09579-ISD1900.pdf\" name=\"\" target=\"_blank\">ISD1932 Datasheet</a></li>\n\n\n</ul>','ISD1932 Voice Recorder w/ Mic','','publish','open','open','','isd1932-voice-recorder-w-mic','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/isd1932-voice-recorder-w-mic/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3776,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<strong>Description: </strong>This is a breakout board for InvenSense&#39;s ITG-3200, a groundbreaking triple-axis, digital output gyroscope. The ITG-3200 features three 16-bit analog-to-digital converters (ADCs) for digitizing the gyro outputs, a user-selectable internal low-pass filter bandwidth, and a Fast-Mode I<sup>2</sup>C (400kHz) interface. Additional features include an embedded temperature sensor and a 2% accurate internal oscillator.</p>\n\n\n<p>\n\n\n	The ITG-3200 can be powered at anywhere between 2.1 and 3.6V. For power supply flexibility, the ITG-3200 has a separate VLOGIC reference pin (labeled VIO), in addition to its analog supply pin (VDD) which sets the logic levels of its serial interface. The VLOGIC voltage may be anywhere from 1.71V min to VDD max. For general use, VLOGIC can be tied to VCC. The normal operating current of the sensor is just 6.5mA.</p>\n\n\n<p>\n\n\n	Communication with the ITG-3200 is achieved over a two-wire (I<sup>2</sup>C) interface. The sensor also features a interrupt output, and an optional clock input. A jumper on the top of the board allows you to easily select the I<sup>2</sup>C address, by pulling the AD0 pin to either VCC or GND; the board is shipped with this jumper tied to VCC. If you don&#39;t plan on using the CLKIN pin, you can short the jumper on the bottom of the board to tie it to GND.</p>\n\n\n<p>\n\n\n	This breakout board is shipped as shown in the images. Note that there are two <em>unpopulated</em> resistors on the I<sup>2</sup>C lines, these can be added later by the customer if desired.</p>\n\n\n<p>\n\n\n	Not sure which gyro is right for you? Our <a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=167\" target=\"_self\">Accelerometer and Gyro Buying Guide</a> might help!</p>\n\n\n<p>\n\n\n	<strong>Features:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Digital-output X-, Y-, and Z-Axis angular rate sensors (gyros) on one integrated circuit</li>\n\n\n	<li>\n\n\n		Digitally-programmable low-pass filter</li>\n\n\n	<li>\n\n\n		Low 6.5mA operating current consumption for long battery life</li>\n\n\n	<li>\n\n\n		Wide VDD supply voltage range of 2.1V to 3.6V</li>\n\n\n	<li>\n\n\n		Standby current: 5&mu;A</li>\n\n\n	<li>\n\n\n		Digital-output temperature sensor</li>\n\n\n	<li>\n\n\n		Fast Mode I<sup>2</sup>C (400kHz) serial interface</li>\n\n\n	<li>\n\n\n		Optional external clock inputs of 32.768kHz or 19.2MHz to synchronize with system clock</li>\n\n\n	<li>\n\n\n		Pins broken out to a breadboard friendly 7-pin 0.1&quot; pitch header</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Dimensions: </strong>0.70 x 0.55&quot; (17.78 x 13.97mm)</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Gyro/ITG-3200-v10.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/tutorials/265\" target=\"_blank\">Quickstart Guide</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Gyro/PS-ITG-3200-00-01.4.pdf\" target=\"_blank\">ITG-3200 Datasheet</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Gyro/IDG-3200-ATmega328-4-30-10.zip\" target=\"_blank\">Example Code</a> (ATmega328)</li>\n\n\n	<li>\n\n\n		<a href=\"http://mbed.org/cookbook/ITG-3200-Gyroscope\" target=\"_blank\">mbed Example</a></li>\n\n\n</ul>','Triple Axis Gyro Breakout ITG-3200','','publish','open','open','','triple-axis-gyro-breakout-itg-3200','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/triple-axis-gyro-breakout-itg-3200/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3777,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>This is the breakout board for the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9032\" name=\"\" target=\"\">thumb joystick</a>. Pins are broken out to a 0.1&quot; header and includes 4 mounting holes in the corners.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span> 1&quot; x 1.25&quot;</p>','Thumb Joystick','','publish','open','open','','thumb-joystick-2','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/thumb-joystick-2/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3778,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> The Joystick Shield sits on top of your Arduino and turns it into a simple controller. Five momentary push buttons (4+ joystick select button) and a two-axis thumb joystick gives your Arduino functionality on the level of old <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8978\" name=\"\" target=\"_self\">Nintendo controllers</a>.</p>\n\n\n<p>\n\n\n	<strong>Please note:</strong> This is an older version of the PCB that does not have the prototyping area. The examples and assembly guides still apply. We&#39;re just trying to give these PCBs a happy home before we move on to the next revision.<br />\n\n\n	<br />\n\n\n	The momentary push buttons are connected to Arduino digital pins 2-6; when pressed they will pull the pin low (utilizing the internal pull-ups of the Arduino). Vertical movement of the joystick will produce a proportional analog voltage on analog pin 0, likewise, horizontal movement of the joystick can be tracked on analog pin 1.<br />\n\n\n	<br />\n\n\n	This product is only the Joystick Shield PCB - you&#39;ll need to purchase the buttons and joystick separately, and assemble the controller yourself. Here&#39;s what you&#39;ll need in addition to the shield:</p>\n\n\n<ul>\n\n\n	<li>\n\n\n		4 x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9190\" name=\"\" target=\"_self\">Momentary Push Button Switch - 12mm Square</a></li>\n\n\n	<li>\n\n\n		1 x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9032\" name=\"\" target=\"_blank\">Thumb Joystick</a></li>\n\n\n	<li>\n\n\n		1 x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=97\" name=\"\" target=\"_blank\">Mini Push Button Switch</a> (breaks out Arduino&#39;s reset switch)</li>\n\n\n	<li>\n\n\n		2 x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" name=\"\" target=\"_self\">6-pin Arduino Stackable Header</a></li>\n\n\n	<li>\n\n\n		2 x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">8-pin Arduino Stackable Header</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=161\" target=\"_blank\">Joystick Assembly Tutorial</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=171\" target=\"_blank\">Joystick Quickstart Guide</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Joystick_Shield-v12.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Joystick_Shield-v13.zip\" name=\"\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/Code/Joystick_Shield_Example.zip\" name=\"\" target=\"_blank\">Arduino Sample Sketch</a></li>\n\n\n</ul>','Arduino Joystick Shield','','publish','open','open','','arduino-joystick-shield','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/arduino-joystick-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3779,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','A low-dropout or LDO regulator is a DC linear voltage regulator which can operate with a very small input–output differential voltage. The advantages of a low dropout voltage include a lower minimum operating voltage, higher efficiency operation and lower heat dissipation. [Wikipedia]','KA78R05 Low Dropout Voltage Regulator','','publish','open','open','','ka78r05-low-dropout-voltage-regulator','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/ka78r05-low-dropout-voltage-regulator/',0,'fz_fzp','',0);
