INSERT INTO `wp_posts` VALUES (3781,1,'2013-04-08 08:51:19','2013-04-08 08:51:19','<p>\n\n\n	<strong>Description:</strong> This is a breakout board for the L3G4200D low-power three-axis angular rate sensor. The L3G4200D has a full scale of &plusmn;250/&plusmn;500/&plusmn;2000 dps and is capable of measuring rates with a user-selectable bandwidth. These work great in gaming and virtual reality input devices, GPS navigation systems and robotics.</p>\n\n\n<p>\n\n\n	<strong>Features:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Three selectable full scales (250/500/2000 dps)</li>\n\n\n	<li>\n\n\n		I2C/SPI digital output interface</li>\n\n\n	<li>\n\n\n		16 bit-rate value data output</li>\n\n\n	<li>\n\n\n		8-bit temperature data output</li>\n\n\n	<li>\n\n\n		Wide supply voltage: 2.4 V to 3.6 V</li>\n\n\n	<li>\n\n\n		Low voltage-compatible IOs (1.8 V)</li>\n\n\n	<li>\n\n\n		Embedded power-down and sleep mode</li>\n\n\n	<li>\n\n\n		Embedded temperature sensor</li>\n\n\n	<li>\n\n\n		High shock survivability</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/Gyros/3-Axis/L3G4200D-Breakout-v10.pdf\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/Gyros/3-Axis/L3G4200D-Breakout-v10.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/Gyros/3-Axis/17116.pdf\" target=\"_blank\">Datasheet</a> (L3G4200D)</li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Sensors/Gyros/3-Axis/L3G4200D_Example.zip\" target=\"_blank\">Example Code</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://bildr.org/2011/06/l3g4200d-arduino/\" target=\"_blank\">Bildr Tutorial</a></li>\n\n\n</ul>','Tri-Axis Gyro Breakout - L3G4200D','','publish','open','open','','tri-axis-gyro-breakout-l3g4200d','','','2013-04-08 08:51:19','2013-04-08 08:51:19','',0,'http://localhost/fz-parts/fzp/tri-axis-gyro-breakout-l3g4200d/',0,'fz_fzp','',0);
