INSERT INTO `wp_posts` VALUES (3788,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<strong>Description:</strong> The LSM303DLH is a triple axis accelerometer combined with a triple axis magnetic sensor. This breakout board uses the LSM303DLH to give a you the data you need to feed into a microcontroller and calculate tilt-compensated output.</p>\n\n\n<p>\n\n\n	<strong>Features:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		+- 2/4/8 g dynamically selectable full-scale</li>\n\n\n	<li>\n\n\n		+-1.3 to +- 8.1 gauss magnetic field full-scale</li>\n\n\n	<li>\n\n\n		16-bit data out</li>\n\n\n	<li>\n\n\n		I2C interface</li>\n\n\n	<li>\n\n\n		Embedded self-test</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Magneto/LSM303%20breakout%20board-v11.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Magneto/LSM303 breakout board-v11.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Magneto/LSM303%20Datasheet.pdf\" target=\"_blank\">Datasheet</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Magneto/Tilt%20Compensated%20Compass.pdf\" target=\"_blank\">Application Notes</a></li>\n\n\n</ul>','LSM303 Breakout Board - Tilt Compensated Compass','','publish','open','open','','lsm303-breakout-board-tilt-compensated-compass','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lsm303-breakout-board-tilt-compensated-compass/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3789,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','	<div id=\"idTab1\" class=\"rte\"><p>The LCD shield for Arduino by Snootlab</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>LCD 2x16 characters alphanumeric for Arduino</p>\n\n\n\n<p>Principal features :</p>\n\n\n\n<ul>\n\n\n\n<li>2 lines of 16 characters dispaly</li>\n\n\n\n<li>1 joystick 5 positions (up, down, left, right, action) using only one analog input pin (A0 defaut, can be changed if necessary)</li>\n\n\n\n<li>I2C managed display; all the digital input/output of the Arduino are available</li>\n\n\n\n<li>One library available</li>\n\n\n\n<li>Software configured backlight (can be unactivated)</li>\n\n\n\n<li>Contrast control on the shield</li>\n\n\n\n<li>Strong mechanical mounting of the display maintained by spacers and screws</li>\n\n\n\n<li>Reset buton on top of the shield</li>\n\n\n\n</ul>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>This <strong>new 1.1 release</strong>&nbsp;has now three holes compatible with Arduino making mechanical connection between the Arduino-Shield-LCD very strong and make it embeddable on robots.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Assembly guide : <a href=\"http://shop.snootlab.com/attachment.php?id_attachment=59\" target=\"_blank\">link</a></p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Library on GitHub : <a href=\"https://github.com/Snootlab/Deuligne\" target=\"_blank\">link</a></p>\n\n\n\n<p>Our libraries are available for Arduino and Arduino 1.0 (select the branch on Github).</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>The official support forum:&nbsp;<a href=\"http://forum.snootlab.com\" target=\"_blank\">forum.snootlab.com</a></p>\n\n','DeuLigne 1.1 - The Snootlab\'s LCD shield for Arduino','','publish','open','open','','deuligne-1-1-the-snootlabs-lcd-shield-for-arduino','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/deuligne-1-1-the-snootlabs-lcd-shield-for-arduino/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3790,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> If you&#39;ve ever tried to connect a 3.3V device to a 5V system, you know what a challenge it can be. The SparkFun logic level converter is a small device that safely steps down 5V signals to 3.3V and steps up 3.3V to 5V. This level converter also works with 2.8V and 1.8V devices. Each level converter has the capability of converting 4 pins on the high side to 4 pins on the low side. Two inputs and two outputs are provided for each side.<br />\n\n\n	<br />\n\n\n	Bread board friendly! Can be used with normal serial, I2C, SPI, and any other digital signal. Does not work with an analog signal.<br />\n\n\n	<br />\n\n\n	The level converter is very easy to use. The board needs to be powered from the two voltages sources (high voltage and low voltage) that your system is using. High voltage (5V for example) to the &#39;HV&#39; pin, low voltage (2.8V for example) to &#39;LV&#39;, and ground from the system to the &#39;GND&#39; pin.<br />\n\n\n	<br />\n\n\n	Pins are labeled as <span style=\"font-weight: bold;\">I</span>nputs and <span style=\"font-weight: bold;\">O</span>utputs. These are relative to the board. A digital one going into the RXI pin on the 5V side will show up on the RXO pin on the 3.3V side as 3.3V. A digital one going into the TXI pin on the 3.3V side will show up on the TXO pin on the 5V side as 5V.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span> 0.5x0.6&quot;<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span> <a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Level-Converter-v10.pdf\" target=\"_blank\">Schematic</a></p>','Logic Level Converter','','publish','open','open','','logic-level-converter','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/logic-level-converter/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3791,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<b>Description:</b> If you need to charge LiPo batteries, this simple charger will do just that, and do it fast! The USB LiPo Charger is a basic charging circuit that allows you to charge 3.7V LiPo cells at a rate of 500mA or 100mA per hour. It is designed to charge single-cell Li-Ion or Li-Polymer batteries. Check the datasheet below to see if it will work with your battery.</p>\n\n\n<p>\n\n\n	The board incorporates a charging circuit, status LED, selectable solder jumper for 500mA or 100mA charging current, external LED footprint, USB input, mounting holes, and various holes for your own connectors. We include a single JST-tpye connector which connects directly to our LiPo batteries. The connector comes unsoldered, so you can use it or not.</p>\n\n\n<p>\n\n\n	There is also a &#39;SYS OUT&#39; which allows you to connect the charging circuit directly to your project so you don&#39;t need to disconnect the charger each time you want to use it.</p>\n\n\n<p>\n\n\n	<b>Documents:</b></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Prototyping/Batteries/LiPo-USB-Charger-v21(2).pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Prototyping/Batteries/LiPo-USB-Charger-v21(2).zip\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Prototyping/Batteries/MCP73831T.pdf\" target=\"_blank\">Datasheet</a> (MCP73831T)</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/726\" target=\"_blank\">PRT-00726</a></p>','USB LiPoly Charger','','publish','open','open','','usb-lipoly-charger','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/usb-lipoly-charger/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3792,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<strong>Description:</strong> The LilyPad Battery Connect simply gives you a connection point for a battery or anything else you might want to plug in to your LilyPad system. It consists of a single 2-pin JST connector on a small LilyPad board with positive and negative terminals.</p>\n\n\n<p>\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!</p>\n\n\n<p>\n\n\n	LilyPad Battery Connect is a design concepted by Felicia Williams of Boulder, Colorado.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad%20Battery-Connect-v11.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad Battery-Connect-v11.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n</ul>','Lilypad Battery Connect','','publish','open','open','','lilypad-battery-connect','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-battery-connect/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3793,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n	<strong>Description:</strong> If you&#39;re looking for a simple way to add a battery to your LilyPad project, the LilyPad Coin Cell Battery Holder might do the trick. It&#39;s a simple board which holds a 20mm coin cell battery (such as a CR2032) and gives you 4 connection points (two positive and two negative) for sewing into your project.</p>\n\n<p>\n\n	<strong>Note:</strong> The LilyPad Coin Cell Battery Holder is a design conceived by Felicia Williams of Boulder, Colorado. Also, a portion of this sale is given back to Dr. Leah Buechley for continued development and education of e-textiles.&nbsp;</p>\n\n','LilyPad Coin Cell Battery Holder','','publish','open','open','','lilypad-coin-cell-battery-holder','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-coin-cell-battery-holder/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3794,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<strong>Description: </strong>The LilyPad Simple Power is a board that lets you connect a battery (or other power source) and switch it on or off, that&#39;s it! We provide you with a JST connector and a slide switch. You can solder in your own surface mount (or through-hole) resistor in line with the output, or solder the jumper closed if you don&#39;t require a resistor.</p>\n\n\n<p>\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!</p>\n\n\n<p>\n\n\n	LilyPad Simple Power is a design concepted by Felicia Williams of Boulder, Colorado.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad%20SimplePower-v12.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad SimplePower-v12.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n</ul>','LilyPad Simple Power','','publish','open','open','','lilypad-simple-power','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-simple-power/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3795,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is a three axis accelerometer for the LilyPad system. Based on the ADXL335 accelerometer from Analog Devices, the LilyPad Accelerometer can detect joint movement as well as inclination and vibration.<br />\n\n\n	<br />\n\n\n	The ADXL335 outputs a 0V to 3V analog signal on each of the X, Y, and Z axis. You will need to convert this analog voltage to a gravity amount and use trigonometry to calculate a true &#39;angle&#39;. If you are not looking for tilt, it is very easy to use this sensor for basic motion sensing.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		20mm outer diameter</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-Accelerometer-v17.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/ADXL335.pdf\" name=\"\" target=\"_blank\">ADXL335 Datasheet</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-Accelerometer-v17Eagle.zip\" name=\"\" target=\"_blank\">Eagle files</a> released under the Creative Commons Attribution</li>\n\n\n	<li>\n\n\n		Example <a href=\"http://www.pyrofersprojects.com/3dcube.php\" target=\"_blank\">3D cube project</a> using a PIC</li>\n\n\n</ul>','LilyPad Accelerometer ADXL335','','publish','open','open','','lilypad-accelerometer-adxl335','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-accelerometer-adxl335/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3796,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> We designed this board to give the user a very discrete button without any sharp edges. Button closes when you push it and opens when you release (momentary push button).<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		8x16mm</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-Button.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		LilyPad Button Board Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPad-ButtonBoard-08776.pdf\" target=\"_blank\">PDF</a></li>\n\n\n	<li>\n\n\n		All LilyPad Product Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPadFPO-Stickers-MASTER.pdf\" target=\"_blank\">PDF</a></li>\n\n\n</ul>','LilyPad Button Board','','publish','open','open','','lilypad-button-board','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-button-board/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3797,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is a simple to use light sensor that outputs an analog value from 0 to 5V. With exposure to daylight, this sensor will output 5V. Covering the sensor with your hand, the sensor will output 0V. In a normal indoor lighting situation, the sensor will output from 1 to 2V.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		20mm outer diameter</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"/datasheets/DevTools/LilyPad/LilyPad-LightSensor.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		LilyPad Light Sensor Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPad-LightSensor-08464.pdf\" target=\"_blank\">PDF</a></li>\n\n\n	<li>\n\n\n		All LilyPad Product Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPadFPO-Stickers-MASTER.pdf\" target=\"_blank\">PDF</a></li>\n\n\n</ul>','LilyPad Light Sensor','','publish','open','open','','lilypad-light-sensor','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-light-sensor/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3798,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<strong>Description:</strong> This is the LilyPad Arduino Simple Board. It&#39;s controlled by an ATmega328 with the Arduino bootloader. It has fewer pins than the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9266\" name=\"\" target=\"\">LilyPad Arduino Main Board</a>, a built in power supply socket, and an on/off switch. Any of our LiPo batteries can be plugged right into the socket. The Simple board is designed to streamline your next sewable project by keeping things simple and giving you more room to work&nbsp; and eliminating the need to sew a power supply. This revision does away with the ISP header and adds a charging circuit based on the MCP73831 IC.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	Can&#39;t decide which Arduino is right for you? <a classname=\"\" href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=148\" name=\"\" target=\"\">Arduino buying guide</a>!<br />\n\n\n	<br />\n\n\n	<strong>Dimensions:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		50mm outer diameter</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-Simple-v22.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-Simple-v22.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Prototyping/Batteries/MCP73831T.pdf\" target=\"_blank\">Datasheet</a> (MCP73831T)</li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://web.media.mit.edu/%7Eleah/LilyPad/\" name=\"\" target=\"_blank\">Leah Buechley&#39;s LilyPad Tutorial</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.arduino.cc/en/Main/ArduinoBoardLilyPad\" target=\"_blank\">LilyPad Arduino Documentation</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces: </strong><a 9725=\"\" href=\"http://&lt;a href=\" http:=\"\" products=\"\" www.sparkfun.com=\"\">DEV-09725</a></p>','LilyPad Arduino Simple Board','','publish','open','open','','lilypad-arduino-simple-board','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-arduino-simple-board/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3799,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> Detecting temperature changes has never been easier. The MCP9700 is a small thermistor type temperature sensor. This sensor will output 0.5V at 0 degrees C, 0.75V at 25 C, and 10mV per degree C. Doing an analog to digital conversion on the signal line will allow you to establish the local ambient temperature. Detect physical touch based on body heat and ambient conditions with this small sensor.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		20mm outer diameter</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"/datasheets/DevTools/LilyPad/LilyPad-TempSensor.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"/datasheets/DevTools/LilyPad/MCP9700.pdf\" target=\"_blank\">MCP9700 Datasheet</a></li>\n\n\n	<li>\n\n\n		LilyPad Temp. Sensor Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPad-TemperatureSensor-08777.pdf\" target=\"_blank\">PDF</a></li>\n\n\n	<li>\n\n\n		All LilyPad Product Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPadFPO-Stickers-MASTER.pdf\" target=\"_blank\">PDF</a></li>\n\n\n</ul>','LilyPad Temperature Sensor','','publish','open','open','','lilypad-temperature-sensor','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-temperature-sensor/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3800,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> The is a breakout board for the popular XBee modules. Board includes easy-to-sew tabs and all the necessary power regulation to run on the LilyPad system.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	LilyPad XBee was co-developed by Kate Hartman and Rob Faludi. It works with all the popular XBee module types but does not ship with a module. Please see the related items below.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		50mm outer diameter</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-XBee-v13.pdf\" name=\"\" target=\"_blank\"> Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-XBee-v13-Eagle.zip\" name=\"\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://lilypadxbee.katehartman.com/\" name=\"\" target=\"_blank\">Additional Information</a></li>\n\n\n	<li>\n\n\n		LilyPad XBee Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPad-XBee-08937.pdf\" target=\"_blank\">PDF</a></li>\n\n\n	<li>\n\n\n		All LilyPad Product Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPadFPO-Stickers-MASTER.pdf\" target=\"_blank\">PDF</a></li>\n\n\n</ul>','LilyPad XBee','','publish','open','open','','lilypad-xbee','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-xbee/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3801,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is a simple slide switch for the LilyPad. Use it as a simple ON/OFF switch, or to control LEDs, buzzers, sensors, etc.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		7.75x18.1mm</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-slide-switch11.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n</ul>','LilyPad Slide Switch','','publish','open','open','','lilypad-slide-switch','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-slide-switch/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3802,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> A simple, very bright, 250mcd, white LED LilyPad. Light up the night!<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		5x11mm</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-LED.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/APT3216QWF-D.pdf\" target=\"_blank\">LED Datasheet</a></li>\n\n\n	<li>\n\n\n		LilyPad Bright White LED Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPad-BrightWhiteLED-08735.pdf\" target=\"_blank\">PDF</a></li>\n\n\n	<li>\n\n\n		All LilyPad Product Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPadFPO-Stickers-MASTER.pdf\" target=\"_blank\">PDF</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/8735\" target=\"_blank\">DEV-08735</a></p>','LilyPad LED','','publish','open','open','','lilypad-led','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-led/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3803,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> A small, but mighty power supply. This board was designed to be as small and inconspicuous as possible. Pop in a AAA battery, flip the power switch, and you will have a 5V supply to power your LilyPad network. Good up to 100mA. Short circuit protected.<br />\n\n\n	<br />\n\n\n	This board has AAA battery clips but can use an input from 1.2V to 5V. Our lithium polymer batteries are a good, rechargable alternative.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable - but be sure to remove the battery!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		56x26mm</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-PowerSupply.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		LilyPad Power Supply Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPad-PowerSupply-08466.pdf\" target=\"_blank\">PDF</a></li>\n\n\n	<li>\n\n\n		All LilyPad Product Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPadFPO-Stickers-MASTER.pdf\" target=\"_blank\">PDF</a></li>\n\n\n</ul>','LilyPad Power Supply','','publish','open','open','','lilypad-power-supply','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/lilypad-power-supply/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3804,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','The M5450 is a monolithic MOS integrated circuit produced with an N-channel silicon gate technology.  A single pin controls the LED display brightness by setting a reference current through a variable resistor connected to Vdd or to a separate supply of 13.2V maximum.','M5450 LED Driver','','publish','open','open','','m5450-led-driver','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/m5450-led-driver/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3805,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<strong>Description:</strong> Do you ever wish your Arduino was more musically talented? Or maybe your project could use some cool sound effects. The Musical Instrument Shield is an easy way to add great sounding MIDI sound to your next Arduino project. This board is built around the VS1053 MP3 and MIDI codec IC, wired in MIDI mode. Simply connect a speaker/stereo/pair of headphones to the 1/8&quot; stereo jack on the shied and pass the proper serial commands to the IC and you&#39;ll be playing music in no time!</p>\n\n\n<p>\n\n\n	The VS1053 contains two large tonebanks including various piano, woodwinds, brass, synth, SFX and percussion sounds. The shield is also capable of playing several tones simultaneously (maximum polyphony of up to 31 sounds!). Take a look at our example code to get an idea of how easy it is to add musical zest to your next Arduino gadget.</p>\n\n\n<p>\n\n\n	In this version, we&#39;re using a better regulator, corrected the speaker connectors, and have the reset pin pulled high. We&#39;ve also included solder jumpers for pin 3 and 4 so they&#39;re selectable.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MIDI Music Shield-v13.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MIDI Music Shield-v13.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MusicIntrument_Example.pde\" target=\"_blank\">Example Code 1</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MusicIntrument_Example2.pde\" target=\"_blank\">Example Code 2<br />\n\n\n		</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/SMD/vs1053.pdf\" target=\"_blank\">Datasheet</a> (VS1053)</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/10529\" target=\"_blank\">DEV-10529</a></p>','Arduino Musical Instrument Shield','','publish','open','open','','arduino-musical-instrument-shield','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/arduino-musical-instrument-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3806,1,'2013-04-08 08:51:20','2013-04-08 08:51:20','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>The MIDI Shield board gives your Arduino access to the powerful <a classname=\"\" href=\"http://en.wikipedia.org/wiki/Musical_Instrument_Digital_Interface\" name=\"\" target=\"_blank\">MIDI communication protocol</a>, so you can control synthesizers, sequencers, and other musical devices. The MIDI protocol shares many similarities with standard asynchronous serial interfaces, so you can use the UART pins of your Arduino to send and receive MIDI&#39;s event messages.<br />\n\n\n	<br />\n\n\n	The MIDI Shield provides an opto-isolated MIDI-IN port as well as a MIDI-OUT port. The MIDI Shield can be mounted directly on top of an Arduino, connecting the MIDI-IN to the Arduino&#39;s hardware RX pin and the MIDI-OUT to TX. Potentiometers are connected to analog pins 1 and 2, and can be used to control volume, pitch, tone or anything else you&#39;d like. Also connected on the shield are three momentary push buttons (connected to D2-4), a reset button, and green and red stat LEDs. The RUN/PROG switch allows you to program the Arduino over serial without having to remove the shield.<br />\n\n\n	<br />\n\n\n	<strong>Note:</strong> The MIDI Shield does not come with the through-hole MIDI connectors or trimpots soldered on. All of these components (2 MIDI connectors and 2 trimpots) are included with the product, however.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/MIDI_Shield-v13.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Midi_Shield.zip\" name=\"\" target=\"_blank\">Example Arduino Sketch</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://arduino.cc/en/Tutorial/Midi\" name=\"\" target=\"_blank\">Arduino MIDI Tutorial</a></li>\n\n\n</ul>','Arduino Midi Shield','','publish','open','open','','arduino-midi-shield','','','2013-04-08 08:51:20','2013-04-08 08:51:20','',0,'http://localhost/fz-parts/fzp/arduino-midi-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3807,1,'2013-04-08 08:51:21','2013-04-08 08:51:21','<p>\n\n\n	<strong>Description: </strong>This new revision of the MP3 player shield retains the awesome MP3 decoding abilities of the last version but adds the storage functionality of the SD card shield. Now you can pull MP3 files from an SD card and play them using only one shield, effectively turning any Arduino into a fully functional stand-alone&nbsp; MP3 player! The MP3 Shield still utilizes the <a href=\"http://www.sparkfun.com/products/8892\">VS1053B</a> MP3 audio decoder IC to decode audio files. The VS1053 is also capable of decoding Ogg Vorbis/MP3/AAC/WMA/MIDI audio and encoding IMA ADPCM and user-loadable Ogg Vorbis.</p>\n\n\n<p>\n\n\n	The VS1053 receives its input bitstream through a serial input bus (SPI). After the stream has been decoded by the IC, the audio is sent out to both a 3.5mm stereo headphone jack, as well as a 2-pin 0.1&quot; pitch header.</p>\n\n\n<p>\n\n\n	This shield comes populated with all components as shown in the images and schematic; but it does not come with headers installed. We recommend the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" name=\"\" target=\"_self\">6</a> and <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">8-pin stackable headers</a>.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MP3 Shield-v13.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MP3 Shield-v13.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/SMD/vs1053.pdf\" target=\"_blank\">Datasheet</a> (VS1053B)</li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MP3_Player_Example.pde\" target=\"_blank\">MP3 Player Example Code</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MP3_Player_Files.zip\" target=\"_blank\">Sample MP3 Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MP3_Player_Example_Control.pde\" target=\"_blank\">MP3 Player Control Example</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MP3_Shield_Example.zip\" target=\"_blank\">MP3 Decoding Example Sketch</a></li>\n\n\n</ul>','Arduino MP3 Player Shield','','publish','open','open','','arduino-mp3-player-shield','','','2013-04-08 08:51:21','2013-04-08 08:51:21','',0,'http://localhost/fz-parts/fzp/arduino-mp3-player-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3808,1,'2013-04-08 08:51:21','2013-04-08 08:51:21','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is LilyPad Arduino - the main board consisting of an ATmega328 with the Arduino bootloader and a minimum number of external components to keep it as small (and as simple) as possible. Board will run from 2V to 5V. The latest version of the LilyPad supports automatic reset for even easier programming. The back side of the LilyPad is now completely flat! We now use a surface mount programming connector to keep the header from poking through.<br />\n\n\n	<br />\n\n\n	This version of the LilyPad now uses the new ATmega328 at 8MHz. Arduino 0016 supports the Arduino Pro Mini 328/8MHz. Use this setting when using this new LilyPad 328.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	Can&#39;t decide which Arduino is right for you? <a classname=\"\" href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=148\" name=\"\" target=\"\">Arduino buying guide</a>!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		50mm outer diameter</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://web.media.mit.edu/%7Eleah/LilyPad/\" name=\"\" target=\"_blank\">Leah Buechley&#39;s LilyPad Tutorial</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/Mainboard-v18.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.atmel.com/dyn/resources/prod_documents/8271S.pdf\" target=\"_blank\">ATmega328 Datasheet</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.arduino.cc/en/Main/ArduinoBoardLilyPad\" target=\"_blank\">LilyPad Arduino Documentation</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-Mainboard-v18.zip\" name=\"\" target=\"_blank\">LilyPad Eagle Files</a> released under <a href=\"http://creativecommons.org/licenses/by-sa/3.0/\" target=\"_blank\">Creative Commons License</a></li>\n\n\n</ul>','LilyPad Arduino Main Board','','publish','open','open','','lilypad-arduino-main-board','','','2013-04-08 08:51:21','2013-04-08 08:51:21','',0,'http://localhost/fz-parts/fzp/lilypad-arduino-main-board/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3809,1,'2013-04-08 08:51:21','2013-04-08 08:51:21','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> The Arduino Mega now has its very own prototyping shield! The MegaShield mates with the Arduino Mega board and gives the user a prototyping area, two general LEDs, and, most important of all, the Arduino Mega reset switch is brought to the top level. The shield also works with our small breadboards if you don&#39;t want to solder to the prototyping area.<br />\n\n\n	<br />\n\n\n	This comes in kit form and must be soldered together by the end user. Please note - we do not ship assembly instructions! All soldering is through-hole (relatively easy) but always check your component orientation before soldering!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Kit Includes:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		1x MegaShield PCB</li>\n\n\n	<li>\n\n\n		11x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">8-pin Arduino Stackable Header</a></li>\n\n\n	<li>\n\n\n		1x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8285\" name=\"\" target=\"_self\">Bright 5mm Green LED</a></li>\n\n\n	<li>\n\n\n		1x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=528\" name=\"\" target=\"_self\">Bright 5mm Red LED</a></li>\n\n\n	<li>\n\n\n		2x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8377\" name=\"\" target=\"_self\">330 Ohm resistors</a></li>\n\n\n	<li>\n\n\n		1x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=97\" name=\"\" target=\"_self\">Momentary push button </a></li>\n\n\n	<li>\n\n\n		1x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8374\" name=\"\" target=\"_self\">10k resistor</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		All Arduino Mega pins are brought to the top level</li>\n\n\n	<li>\n\n\n		5V and GND power busses</li>\n\n\n	<li>\n\n\n		Power and stat (connected to D13) LEDs</li>\n\n\n	<li>\n\n\n		Reset Button brought to top level</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Mega_Shield-v12.pdf\" name=\"\" target=\"_blank\">Protoshield Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Mega_Shield-v13.zip\" name=\"\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.atomicsalad.com/archive/2010/02/07/tutorial_assembling_the_sparkfun_megashield.php\" name=\"\" target=\"_blank\">Assembly Tutorial</a> by Bob Gallup</li>\n\n\n	<li>\n\n\n		<a href=\"http://arduino.berlios.de/\" target=\"_blank\">Arduino Home Page</a></li>\n\n\n</ul>','Arduino Mega Proto Shield','','publish','open','open','','arduino-mega-proto-shield','','','2013-04-08 08:51:21','2013-04-08 08:51:21','',0,'http://localhost/fz-parts/fzp/arduino-mega-proto-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3810,1,'2013-04-08 08:51:21','2013-04-08 08:51:21','	<div id=\"idTab1\" class=\"rte\"><p>SD log shield with RTC and a square pads prototyping area for Arduino</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p><strong>SD Card support</strong></p>\n\n\n\n<ul>\n\n\n\n<li>Allows backup of a large amount of data on SD card and PC retrieval</li>\n\n\n\n<li>Support SdFat library for SD FAT16/FAT32 SC/HC cards</li>\n\n\n\n<li>3V3 regulator on the shield</li>\n\n\n\n</ul>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p><strong>Real Time Clock</strong></p>\n\n\n\n<ul>\n\n\n\n<li>Adding date and time data based on the component I2C DS1307</li>\n\n\n\n<li>Support the standard library DS1307</li>\n\n\n\n<li>Date accessed using the format year / month / day of week / hour / minute / seconds</li>\n\n\n\n<li>Time adjustable 12h with info AM / PM or 24H</li>\n\n\n\n<li>Backup Time on lithium battery (lasting 10 years if 48mAh)</li>\n\n\n\n<li>Corrections leap years, months with less than 31 days</li>\n\n\n\n<li>SQW output signal (square wave) Programmable 1Hz (for pulse every second, or 4kHz or 8kHz or 32kHz)</li>\n\n\n\n<li>Clock not subject to bug date before 100 years</li>\n\n\n\n</ul>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p><strong>And more ...</strong></p>\n\n\n\n<ul>\n\n\n\n<li>Square pads prototyping area&nbsp;to add sensors, actuators, RF, ...</li>\n\n\n\n<li>5V and GND lines available on the sides of the prototyping area</li>\n\n\n\n<li>Arduino reset button on top</li>\n\n\n\n<li>LED display available on pin D9</li>\n\n\n\n<li>Simple modification provided for adapting the shield to an Arduino Mega</li>\n\n\n\n</ul>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Compatible with Arduino Uno, Uno CMS and Duemilanove</p>\n\n\n\n<p>Compatible with Arduino Mega with a simple modification</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p><img style=\"height: auto; font-family: Arial, Helvetica, sans-serif; color: #323232; list-style-type: none; list-style-position: initial; list-style-image: initial; padding: 0px; margin: 0px; border: 0px initial initial;\" title=\"Guide de montage\" src=\"https://shop.snootlab.com/img/p/86-324.jpg\" alt=\"Guide de montage\" width=\"168\" height=\"79\" /></p>\n\n\n\n<p>Documentation and installation guide : on going</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>The official support forum: <a href=\"http://forum.snootlab.com\" target=\"_blank\">forum.snootlab.com</a></p>\n\n\n\n<p>&nbsp;</p></div>\n\n\n\n					<ul id=\"idTab9\">\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=26\">Assembly guide M&eacute;moire FR.pdf</a><br />Assembly guide of M&eacute;moire shield FR</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=28\">Topside M&eacute;moire.pdf</a><br />Topside M&eacute;moire</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=29\">Schema M&eacute;moire.pdf</a><br />Schema M&eacute;moire</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=30\">Eagle M&eacute;moire.zip</a><br />Eagle files of M&eacute;moire</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=42\">Manual M&eacute;moire EN.pdf</a><br />Assembly guide of M&eacute;moire shield EN</li>\n\n\n\n				</ul>\n\n\n\n\n\n<p>&nbsp;</p>\n\n\n\n','Memoire 1.0 - SD card log shield','','publish','open','open','','memoire-1-0-sd-card-log-shield','','','2013-04-08 08:51:21','2013-04-08 08:51:21','',0,'http://localhost/fz-parts/fzp/memoire-1-0-sd-card-log-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3811,1,'2013-04-08 08:51:21','2013-04-08 08:51:21','<p>\n\n\n	<strong>Description:</strong> The Modkit MotoProto Shield for Arduino that makes it easy to connect up to 4 sensors and control two DC motors as well as a 16X2 character LCD. The sensor jacks accept 2.5mm cables and provide access to VCC, GND, and an analog input.</p>\n\n\n<p>\n\n\n	Sensors can be soldered to a 2.5mm cable and you can begin plug-and-play prototyping with a wide assortment of our sensors including line sensors, ultrasonic distance sensors, light sensors, photo interrupter, etc. There is also a large programmable button and a space for an i2c header to connect more advanced sensors such as an accelerometer.</p>\n\n\n<p>\n\n\n	The motor driver circuit is based on the L298 H-bridge and can drive up to 2 amps per channel. The board takes its power from the same Vin line as the Arduino board, includes blue and yellow LEDs to indicate active direction, and all driver lines are diode protected from back EMF.</p>\n\n\n<p>\n\n\n	<a href=\"http://modk.it\" target=\"_blank\">Modkit</a> develops a drag-and-drop graphical programming environment inspired by <a href=\"http://scratch.mit.edu\" target=\"_blank\">Scratch</a> for <a href=\"http://arduino.cc\" target=\"_blank\">Arduino</a> and Arduino compatible boards, making it easier than ever to program your physical project. The Modkit MotoProto Shield is well suited for general projects, prototyping, and educational robotics.<br />\n\n\n	<br />\n\n\n	For a limited time, purchase a Modkit MotoProto Shield and receive a free invite to try Modkit&#39;s programming environment before it is released to the public. The shield can also be programmed with the Arduino development environment.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Modkit%20Shield-v1a.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/Modkit Shield-v1a.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/MotoProto_LCD.zip\" target=\"_blank\">Example Code</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/General/L298N.pdf\" target=\"_blank\">Datasheet</a> (L298)</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.modk.it/software\" target=\"_blank\">Modkit Software</a></li>\n\n\n</ul>','Arduino Modkit Shield','','publish','open','open','','arduino-modkit-shield','','','2013-04-08 08:51:21','2013-04-08 08:51:21','',0,'http://localhost/fz-parts/fzp/arduino-modkit-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3812,1,'2013-04-08 08:51:21','2013-04-08 08:51:21','<p>\n\n\n	<strong>Description:</strong> This is essentially a ramped up version of our Ardumoto motor driver shield. For this monster shield we&#39;ve replaced the L298 H-bridge with a pair of VNH2SP30 full-bridge motor drivers. We&#39;ve also beefed up the support circuitry so this board is capable of driving a pair of high-current motors! The VIN and motor out are pitched for our 5mm screw terminals (not included), making it easy to connect larger gauge wires.</p>\n\n\n<p>\n\n\n	<strong>Note:</strong> When using this board in extreme high-demand applications it may be necessary to improve thermal performance with a heat-sink or fan and to solder the wires directly to the board instead of using a screw terminal (in addition to the myriad other complications present in a 30A system) However, when using the board at currents up to 6A the chips will barely become noticeably warm.</p>\n\n\n<p>\n\n\n	<strong>Features:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Voltage max: 41V</li>\n\n\n	<li>\n\n\n		Maximum current rating: 30 A</li>\n\n\n	<li>\n\n\n		Current sensing available to Arduino analog pin</li>\n\n\n	<li>\n\n\n		MOSFET on-resistance: 19 m&Omega; (per leg)</li>\n\n\n	<li>\n\n\n		Maximum PWM frequency: 20 kHz</li>\n\n\n	<li>\n\n\n		Thermal Shutdown</li>\n\n\n	<li>\n\n\n		Undervoltage and Overvoltage shutdown</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MonsterMoto-Shield-v12.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MonsterMoto-Shield-v12.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/10832.pdf\" target=\"_blank\">Datasheet</a> (VNH2SP30)</li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/MonsterMoto_Shield_Example.pde\" target=\"_blank\">Example Code</a></li>\n\n\n</ul>','Monster Moto Shield','','publish','open','open','','monster-moto-shield','','','2013-04-08 08:51:21','2013-04-08 08:51:21','',0,'http://localhost/fz-parts/fzp/monster-moto-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3813,1,'2013-04-08 08:51:21','2013-04-08 08:51:21','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>The NCP1400 is a 3.3V DC-DC converter. The breakout board will accept voltage inputs between 1 and 3 Volts (such as 1 or 2 AA batteries) and output a constant, low ripple 3.3V output capable of sourcing up to 100 mA. This board is great for supplying power to 3.3V sensors or providing 3.3V from a a single AA battery.<br />\n\n\n	<br />\n\n\n	The breakout board includes the necessary peripheral components. The input, ouput and ground pins are broken out on a 0.1&quot; grid to allow easy access on a breadboard.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Prototyping/Batteries/NCP1400_33V_Step-Up_v11.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Prototyping/Batteries/Voltage_Switcher-NCP1400A-D.pdf\" name=\"\" target=\"_blank\">Datasheet</a></li>\n\n\n</ul>','NCP1400 Step-Up Breakout','','publish','open','open','','ncp1400-step-up-breakout','','','2013-04-08 08:51:21','2013-04-08 08:51:21','',0,'http://localhost/fz-parts/fzp/ncp1400-step-up-breakout/',0,'fz_fzp','',0);
