INSERT INTO `wp_posts` VALUES (3842,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','<p>\n\n\n	<strong>Description:</strong> This is the Arduino shield version of our TLC5940 Breakout. The PWM Shield will allow you to generate up to 16 PWM signals from your Arduino by utilizing the power of the TLC5940 IC. All 16 PWM channels are broken out to standard 0.1&quot; headers, which run alongside convenient voltage and ground rails. Because the IC can be daisy-chained, output headers are broken out on one side of the shield and can be connected to our TLC5940 Breakout to further expand your PWM capabilities.&nbsp;</p>\n\n\n<p>\n\n\n	Use this board to increase the number of PWM pins available to your microcontroller for applications such as monocolor, multicolor or full-color LED displays, LED signboards, display backlighting, servo control, or any other project where a large number of PWM drivers are necessary.</p>\n\n\n<p>\n\n\n	<strong>Note: </strong>While each 3-pin PWM header is 0.1&quot; spaced, the space between each header is slightly larger in order to accommodate servo connections. In order to make this board suitable for use with servos, 2.2k pull-up resistors have been included on each output as well. Finally, the 2.2k resistor on the Iref pin sets the output current to 17.8mA but a parallel through-hole connection is provided for an additional resistor to increase the current if necessary. To determine the resistor value you need for a given output check the equations provided on the schematic below.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/PWM-Shield-v12.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/PWM-Shield-v12.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/General/tlc5940.pdf\" target=\"_blank\">Datasheet</a> (TLC5940)</li>\n\n\n	<li>\n\n\n		<a href=\"http://code.google.com/p/tlc5940arduino/\" target=\"_blank\">Arduino Library</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.arduino.cc/playground/Learning/TLC5940\" target=\"_blank\">Arduino Example</a></li>\n\n\n</ul>','PWM Shield','','publish','open','open','','pwm-shield','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/pwm-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3843,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','\n\n<div id=\"idTab1\" class=\"rte\"><p>Easy screw terminals and SMD prototyping on Arduino.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>The plate is adapted to the dimensions of the Arduino Duemilanove Uno, it has a pads area allowing you to easily add additional components necessary to your circuits.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>The pads area can also receive a mini breadboard for initial testing of your prototypes. The pads are square to facilitate the achievement of solder bridges.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>The stackable connectors include all such signals from the arduino making them available for your prototypes. The signals are clearly indicated by the silkscreen on the top and bottom.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>A specific area allows you to solder a SMD component directly on the plate.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>A molex connector allows power supplies to your installation and your Arduino with a simple ATX PC power supply, your Arduino easily becomes autonomous.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>For advanced users, when the Arduino is powered by molex plug, a specific pads area receive 12V (if selected by solder bridge located on the shield). It allows you to controle 12V equipments, perfect to controle transistor fans, motors, lamps, LED ribbon, relays, ...</p>\n\n\n\n<p>Finally, the status LED can be used (X) into your prototypes with a cutting track on the bottom (SJ2)</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>The shield can be mounted on the Arduino Mega however, pins 14 (TX3) and A7 are difficult to use because partially covered by the shield.</p>\n\n\n\n<p>Pins A8 to A15, Digital 22 to 53 and Com 15 to 21 (rear part of the Mega) are not included on the shield.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p style=\"height: auto; font-family: Arial, Helvetica, sans-serif; color: #323232; list-style-type: none; list-style-position: initial; list-style-image: initial; padding: 0px; margin: 0px;\"><a style=\"height: auto; font-family: Arial, Helvetica, sans-serif; color: #5d717e; list-style-type: none; list-style-position: initial; list-style-image: initial; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; text-decoration: none; outline-style: none; outline-width: initial; outline-color: initial; background-position: initial initial; background-repeat: initial initial; padding: 0px; margin: 0px;\" title=\"Assembly guide\" href=\"http://shop.snootlab.com/attachment.php?id_attachment=23\" target=\"_blank\"><img style=\"height: auto; font-family: Arial, Helvetica, sans-serif; color: #323232; list-style-type: none; list-style-position: initial; list-style-image: initial; outline-style: none; outline-width: initial; outline-color: initial; text-decoration: none; padding: 0px; margin: 0px; border: 0px none initial;\" title=\"Guide de montage\" src=\"https://shop.snootlab.com/img/p/55-288.jpg\" alt=\"Guide de montage\" width=\"169\" height=\"80\" /></a></p>\n\n\n\n<p style=\"height: auto; font-family: Arial, Helvetica, sans-serif; color: #323232; list-style-type: none; list-style-position: initial; list-style-image: initial; padding: 0px; margin: 0px;\">Documentation and installation guide&nbsp;: <a title=\"Assembly guide\" href=\"http://shop.snootlab.com/attachment.php?id_attachment=23\" target=\"_blank\">direct link</a></p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>The official support forum: forum.snootlab.com</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p style=\"height: auto; font-family: Arial, Helvetica, sans-serif; color: #323232; list-style-type: none; list-style-position: initial; list-style-image: initial; padding: 0px; margin: 0px;\"><img style=\"height: auto; font-family: Arial, Helvetica, sans-serif; color: #323232; list-style-type: none; list-style-position: initial; list-style-image: initial; padding: 0px; margin: 0px; border: 0px initial initial;\" src=\"http://shop.snootlab.com/themes/matrice/img/logos_ext/RoHS-Logo.jpg\" alt=\"Logo RoHS\" width=\"45\" height=\"60\" /></p></div>\n\n\n\n					<ul id=\"idTab9\">\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=18\">Power ScrewShield diagram.pdf</a><br />Operating diagram of the Power ScrewShield</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=19\">Power ScrewShield topside.pdf</a><br />Power ScrewShield implementation of  the components </li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=20\">Eagle PowerScrewShield.zip</a><br />Eagle files of the Power ScrewSchield (schema and board)</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=22\">Power ScrewShield guide FR.pdf</a><br />Power ScrewShield assembly guide FR</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=23\">Power ScrewShield guide EN.pdf</a><br />Power ScrewShield Assembly guide EN</li>\n\n\n\n				</ul>\n\n','Power Screwshield - Easy screw terminals and SMD prototyping','','publish','open','open','','power-screwshield-easy-screw-terminals-and-smd-prototyping','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/power-screwshield-easy-screw-terminals-and-smd-prototyping/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3844,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','power plug','Power plug','','publish','open','open','','power-plug','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/power-plug/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3845,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','<p>\n\n\n	<strong>Description:</strong> This shield allows you to use a computer power supply (or other power source) to use your Arduino to switch high current. With RFP30N06LE MOSFETS, you can easily control a lot of current directly from your Arduino.</p>\n\n\n<p>\n\n\n	The board provides 6 PWM outputs via screw terminals. Check the datasheet for the MOSFET below for full specifications on how much current this board can handle.This board is a very easy way to start using MOSFETS for your next high current project.</p>\n\n\n<p>\n\n\n	<strong>Note:</strong> If you want to stack another shield on top of this one, you will want to double-up on the stackable headers to clear the MOSFETs.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/PowerDriver-Shield-v12.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/PowerDriver-Shield-v12.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/General/RFP30N06LE.pdf\" target=\"_blank\">Datasheet</a> (RFP30N06L)</li>\n\n\n</ul>','Arduino Power Driver Shield','','publish','open','open','','arduino-power-driver-shield','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/arduino-power-driver-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3846,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','<p>\n\n\n	<strong>Description:</strong> Infrared LEDs are awesome. Along with an IR receiver they can be used for remote control and even basic remote data communication. The only problem is that your Arduino won&#39;t drive them to their full potential. The Max Power IR LED kit solves this problem by providing you with everything you need to drive a 950nm IR LED properly. Simply solder together this easy through-hole kit and you can switch the LED using a transistor.</p>\n\n\n<p>\n\n\n	Once the kit is assembled, simply provide it with voltage (5V), ground, and connect the CTL pin to a digital pin on your Arduino, and you can drive this kit just like a normal LED.&nbsp; Although the LED won&#39;t be visible to your naked eye, you can use a video camera, cell phone camera, or digital camera to see if the LED is working properly.</p>\n\n\n<p>\n\n\n	<strong>Note:</strong> This revision fixes our mistake from the last version and should now source the 50mA maximum current that the LED is rated for.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Kits/PowerIR-v11.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Kits/PowerIR-v11.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Sensors/Infrared/YSL-R531FR1C-F1.pdf\" name=\"\" target=\"_blank\">Datasheet</a> (IR LED)</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/10662\" target=\"_blank\">KIT-10662</a></p>','Max Power IR LED Kit','','publish','open','open','','max-power-ir-led-kit','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/max-power-ir-led-kit/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3847,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> A small, but very mighty power supply. This board was designed to be as small and inconspicuous as possible. The nice thing about LiPower is the ability to use rechargable Lithium Polymer batteries. These batteries are smaller, flatter, and last much longer than a AAA battery. Attach a single cell LiPo battery, flip the power switch, and you will have a 5V supply to power your LilyPad network. Good up to 150mA. Short circuit protected.<br />\n\n\n	<br />\n\n\n	This board has a JST connector, which will connect to our JST terminated single cell 3.7V LiPo batteries. It also has terminals for charging the LiPo battery with one of our LiPo chargers.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable e-textile technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable - but be sure to remove the battery!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		18mm outer diameter</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-PowerSupply-Lipo.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		LilyPad LiPower Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPad-LiPower-08786.pdf\" target=\"_blank\">PDF</a></li>\n\n\n	<li>\n\n\n		All LilyPad Product Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPadFPO-Stickers-MASTER.pdf\" target=\"_blank\">PDF</a></li>\n\n\n</ul>','LilyPad LiPower','','publish','open','open','','lilypad-lipower','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/lilypad-lipower/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3848,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','<p>\n\n\n	<strong>Description: </strong>This is a small prototyping shield for the Arduino Pro Mini. If your project requires just a little bit more space for your external circuitry, this might be a perfect addition. 38 unconnected PTHs are provided for your prototyping needs.</p>\n\n\n<p>\n\n\n	The shield fits the small form factor of the Arduino Pro Mini - connecting to the &#39;top&#39; four pins on each side of the Mini (&#39;GND&#39;-&#39;TXO&#39; &amp; &#39;VCC&#39;-&#39;RAW&#39;). There are small buses for VCC, GND and RAW. In addition to the power buses, the serial pins are also broken out on the shield. The analog and digital pins are not broken out on the shield.</p>\n\n\n<p>\n\n\n	<strong>Features:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		VCC, RAW and GND buses</li>\n\n\n	<li>\n\n\n		Serial (RXI &amp; TXO) pins broken out to small buses</li>\n\n\n	<li>\n\n\n		Works with both 5V and 3.3V Pro Mini versions</li>\n\n\n	<li>\n\n\n		Upholds the Pro Mini&#39;s small form factor</li>\n\n\n	<li>\n\n\n		38 unconnected PTHs for prototyping</li>\n\n\n</ul>','Arduino Mini Proto Shield','','publish','open','open','','arduino-mini-proto-shield','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/arduino-mini-proto-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3849,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> Riding on the waves of the very popular Arduino USB board is this small prototyping shield. Originally spawned with collaboration between the folks at <a href=\"http://www.sparkfun.com\" target=\"_blank\">SFE</a> and <a href=\"http://itp.nyu.edu/itp/\" target=\"_blank\">ITP @ NYU</a>, the ProtoShield mates with the Arduino USB board and gives the user a small soldering area, two general LEDs, access to a BlueSMiRF socket, a general pushbutton switch, and most important of all - the Arduino reset switch is brought to the top level. A <a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=191\">ProtoShield quickstart guide</a> is available!<br />\n\n\n	<br />\n\n\n	This comes in kit form and must be soldered together by the end user. Please note - we do not ship assembly instructions, but you can find a big, clean photographed assembly guide <a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=181\">here</a>! There are a few tutorials on assembly listed below. All soldering is through-hole (relatively easy) but always check your component orientation before soldering!<br />\n\n\n	<br />\n\n\n	The kit is pictured with the bread-board option. We highly recommend this breadboard! See the related items below for all the colorful options of breadboards you have.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Kit Includes:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		1x ProtoShield bare PCB</li>\n\n\n	<li>\n\n\n		2x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" name=\"\" target=\"_self\">Stackable Headers 6-pin</a></li>\n\n\n	<li>\n\n\n		2x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">Stackable Headers 8-pin</a></li>\n\n\n	<li>\n\n\n		2x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=532\" name=\"\" target=\"_self\">5mm Basic Yellow LEDs</a></li>\n\n\n	<li>\n\n\n		2x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8377\" name=\"\" target=\"_self\">330 Ohm resistors </a></li>\n\n\n	<li>\n\n\n		1x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8374\" name=\"\" target=\"_self\">10k resistor</a></li>\n\n\n	<li>\n\n\n		2x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=97\" name=\"\" target=\"_self\">Momentary push buttons</a></li>\n\n\n	<li>\n\n\n		2x <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8375\" name=\"\" target=\"_self\">0.1uF Ceramic Capacitors </a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features:<br />\n\n\n	</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		All Arduino pins are brought to the top level</li>\n\n\n	<li>\n\n\n		5V, GND, and Vin pins are exposed as well</li>\n\n\n	<li>\n\n\n		BlueSMiRF socket for wireless communication between Arduinos</li>\n\n\n	<li>\n\n\n		2 general use LEDs</li>\n\n\n	<li>\n\n\n		1 general use button</li>\n\n\n	<li>\n\n\n		Reset button brought to top level</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=191\">ProtoShield Quickstart Guide</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=181\">Assembly Instructions</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/ProtoShield-v25.pdf\" name=\"\" target=\"_blank\">ProtoShield Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://arduino.cc\" target=\"_blank\">Arduino Home Page</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.atomicsalad.com/archive/2010/02/02/tutorial_sparkfun_protoshield_for_arduino_assembly_updated.php\" name=\"\" target=\"_blank\">Assembly Tutorial</a> by Bob Gallup</li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/ProtoShield-v25.zip\" name=\"\" target=\"\">ProtoShield Eagle Files</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Standalone Circuit Board:</strong><span style=\"font-weight: bold;\"> </span><a href=\"http://batchpcb.com/index.php/Products/31479\" target=\"_blank\">BatchPCB: Arduino ProtoShield</a></p>','Arduino ProtoShield','','publish','open','open','','arduino-protoshield','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/arduino-protoshield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3850,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','The Arduino Prototyping Shield makes it easy for you to design custom circuits. You can solder parts to the prototyping area to create your project, or use it with a small solderless breadboard (not included) to quickly test circuit ideas without having to solder. It\'s got extra connections for all of the Arduino I/O pins, and it\'s got space to mount through-hole and surface mount integrated circuits. It\'s a convenient way to make your custom circuit and Arduino into a single module.','Arduino Prototyping Shield','','publish','open','open','','arduino-prototyping-shield','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/arduino-prototyping-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3851,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> The RFID USB Reader is a simple to use, USB to serial base unit for the ID-2, ID-12, and ID-20 readers. Simply plug a reader into the headers and attach a miniUSB cable. Open a terminal program of your choice at 9600bps 8N1, then scan your 125kHz ID tag and the unique 32-bit ID will be shown on the screen. The unit is based on a FTDI chip and comes with a read LED and buzzer.</p>\n\n\n<p>\n\n\n	This new revision uses SMD headers for the RFID module, and has a solder jumper which allows you to disable or enable the buzzer.<br />\n\n\n	<br />\n\n\n	<strong>Note: </strong>This product does not come with the RFID reader. Check below for compatible readers.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span> 1.4x1.2x0.57&quot;<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/ID/RFID_USB_Reader-v14.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/ID/RFID_USB_Reader-v14Eagl.zip\" name=\"\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.ftdichip.com/FTDrivers.htm\" name=\"\" target=\"_blank\">USB FTDI Drivers for Linux, MAC, and PC</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/8852\" target=\"_blank\">SEN-08852</a></p>\n\n\n<p>\n\n\n	&nbsp;</p>\n\n\n<p>\n\n\n	&nbsp;</p>\n\n\n<p>\n\n\n	<object height=\"300\" width=\"560\"><param name=\"movie\" value=\"http://www.youtube.com/v/2ioDBOOAFvM&amp;hl=en_US&amp;fs=1&amp;rel=0\" /><param name=\"allowFullScreen\" value=\"true\" /><param name=\"allowscriptaccess\" value=\"always\" /><embed allowfullscreen=\"true\" allowscriptaccess=\"always\" height=\"300\" src=\"http://www.youtube.com/v/2ioDBOOAFvM&amp;hl=en_US&amp;fs=1&amp;rel=0\" type=\"application/x-shockwave-flash\" width=\"560\"></embed></object></p>','RFID USB Reader','','publish','open','open','','rfid-usb-reader','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/rfid-usb-reader/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3852,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is a large sized RGB LED Matrix with a backpack that has been designed to take SPI serial input and display any graphics you pass it. All the refreshing and communication control is taken care of by the backpack. It&#39;s even reprogrammable! 7 software selectable colors are available!<br />\n\n\n	<br />\n\n\n	Unit comes with a Red/Green/Blue LED Matrix assembled with a RGB Matrix Backpack Controller.<br />\n\n\n	<br />\n\n\n	Check out the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=91\" name=\"\" target=\"_blank\">LED Coffee Table</a> tutorial!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/rgbmatrixbackpack_userguide.pdf\" name=\"\" target=\"_blank\">Matrix Backpack Controller Datasheet</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/RGB_Backpack_v4.zip\" name=\"\" target=\"\">RGB Serial Matrix Firmware</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/Code/RGB_Sample_Interface_Code.zip\" name=\"\" target=\"\">Sample Interface Code</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/Code/RGBMatrixBackpackSketch.zip\" name=\"\" target=\"_blank\">Sample Arduino Sketch</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/RGB_matrix_v25.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/YSM-2388CRGBC.pdf\" name=\"\" target=\"_blank\">Triple Color LED Matrix Datasheet</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Example Projects:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/LED_MATRIX_CODE.zip\" target=\"_blank\">Example Software for older RGB Serial Matrix</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://wiring.org.co/learning/basics/rbgbackpack.html\" name=\"\" target=\"_blank\">Wiring Example</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.nokinomo.com/films/films.php?Id=13\" target=\"_blank\">Example deployment</a> by Nokinomo</li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.youtube.com/watch?v=hEKEM6ZOsZE\" name=\"\" target=\"_blank\">Example Project</a> by Mr. Nick Hall</li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.halfmachine.dk/posts/60\" name=\"\" target=\"_blank\">Ladies and Mens Room Mixup</a> by Vanessa Carpenter</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/tutorials/44\">Ethernet LED Matrix</a> tutorial by Owen Osborn</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		2.38x2.38&quot; square</li>\n\n\n	<li>\n\n\n		Max width of backpack including connector pins - 1.1&quot;</li>\n\n\n</ul>','LED Matrix - Serial Interface - Red/Green/Blue','','publish','open','open','','led-matrix-serial-interface-redgreenblue','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/led-matrix-serial-interface-redgreenblue/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3853,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','RJ45 Connector with 10/100 Base-T Integrated Magnetics and 2 LED (TRJ0011BANL)','RJ45-TRXCOM','','publish','open','open','','rj45-trxcom','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/rj45-trxcom/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3854,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> This is a simple breakout for the Roving Networks Bluetooth<sup><font face=\"Tahoma, sans-serif\"><b> </b></font></sup>module. All pertinent pins are broken out and labeled. This new version&#39;s headers are unpopulated. Check below for appropriate headers.<br />\n\n\n	<br />\n\n\n	The module from Roving Networks is powerful, small, and very easy to use. This Bluetooth module is designed to replace serial cables. The Bluetooth<sup><font face=\"Tahoma, sans-serif\"><b> </b></font></sup>stack is completely encapsulated. The end user just sees serial characters being transmitted back and forth. Press the &#39;A&#39; character from a terminal program on your computer and an &#39;A&#39; will be pushed out the TX pin of the Bluetooth<sup><font face=\"Tahoma, sans-serif\"><b> </b></font></sup>module.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Do not</span> attach this device directly to a serial port. You will need an <a href=\"http://www.sparkfun.com/products/718\" target=\"_blank\">RS232 to TTL converter circuit</a> if you need to attach this device to a computer.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Fully qualified Bluetooth module</li>\n\n\n	<li>\n\n\n		FCC Certified</li>\n\n\n	<li>\n\n\n		Fully configurable UART</li>\n\n\n	<li>\n\n\n		UART Data rates up to 3Mbps</li>\n\n\n	<li>\n\n\n		Over air data rate of 721kbps to 2.0Mbps</li>\n\n\n	<li>\n\n\n		Low power sleep mode</li>\n\n\n	<li>\n\n\n		Compatible with all Bluetooth<sup><font face=\"Tahoma, sans-serif\"><b> </b></font></sup>products that support SPP (almost all do)</li>\n\n\n	<li>\n\n\n		Includes support for BCSP, DUN, LAN, GAP SDP, RFCOMM, and L2CAP protocols</li>\n\n\n	<li>\n\n\n		3.3V operation</li>\n\n\n	<li>\n\n\n		Status pin</li>\n\n\n	<li>\n\n\n		Bluetooth Technology v2.0 compatible</li>\n\n\n	<li>\n\n\n		Class 1 power output</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span> 1.0x0.9&quot;</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Wireless/Bluetooth/RN41-v14.pdf\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Wireless/Bluetooth/RN41-v14.zip\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.rovingnetworks.com/documents/RN-41.pdf\" target=\"_blank\">RN-41 Datasheet</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Wireless/Bluetooth/rn-bluetooth-um.pdf\" name=\"\" target=\"_blank\">RN-41 AT Command Set</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Wireless/Bluetooth/pic-example-1-1.pdf\" name=\"\" target=\"_blank\">PIC Example</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=65\" name=\"\" target=\"_blank\">Tutorial</a> (interfacing a 3.3V device to a 5V micro)</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/10144\" target=\"_blank\">WRL-10144</a></p>','Bluetooth Module Breakout - Roving Networks (RN-41)','','publish','open','open','','bluetooth-module-breakout-roving-networks-rn-41','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/bluetooth-module-breakout-roving-networks-rn-41/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3855,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','This a custom designed module for the DS1307 Real Time Clock. The module comes fully assembled and pre-programmed with the current time (ok, so it\'s our current time - MST). The included Lithium coin cell battery (CR1225 41mAh) will run the module for a minimum of 9 years (17 years typical) without external 5V power. The DS1307 is accessed via the I2C protocol. We\'ve written a test-bed to program the modules. This test-bed code should give you some insight on how to interface the module to any microcontroller using our example software I2C and BCD routines.\n\n\n\n\n\n\n\n\n\n\n\nFeatures:\n\n\n\n\n\n\n\n\n\n\n\nTwo wire I2C interface \n\n\n\n\n\n\n\n\n\n\n\nHour : Minutes : Seconds AM/PM \n\n\n\n\n\n\n\n\n\n\n\nDay Month, Date - Year \n\n\n\n\n\n\n\n\n\n\n\nLeap year compensation \n\n\n\n\n\n\n\n\n\n\n\nAccurate calendar up to year 2100 \n\n\n\n\n\n\n\n\n\n\n\nBattery backup included \n\n\n\n\n\n\n\n\n\n\n\n1Hz output pin \n\n\n\n\n\n\n\n\n\n\n\n56 Bytes of Non-volatile memory available to user\n\n\n\n\n\n\n\n\n\n\n\nDimensions: 0.75x0.75\" (20x20mm)\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nDocuments:\n\n\n\n\n\n\n\n\n\n\n\nRTC Module Schematic \n\n\n\n\n\n\n\n\n\n\n\nRTC Module Dimensional Drawing \n\n\n\n\n\n\n\n\n\n\n\nDS1307 Datasheet \n\n\n\n\n\n\n\n\n\n\n\nWiring Example\n\n\n\n\n\n\n\n\n\n\n\nSoftware: \n\n\n\n\n\n\n\n\n\n\n\nExample 16F88 code \n\n\n\n\n\n\n\n\n\n\n\nArduino Tutorial. Thanks John Vaughters! \n\n\n\n\n\n\n\n\n\n\n\nArduino Tutorial in Portuguese. Thanks Daniel Gonçalves! \n\n\n\n\n\n\n\n\n\n\n\nBildr Tutorial','Real Time Clock Module - DS1307 RTC Breakout Board','','publish','open','open','','real-time-clock-module-ds1307-rtc-breakout-board','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/real-time-clock-module-ds1307-rtc-breakout-board/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3856,1,'2013-04-08 08:51:22','2013-04-08 08:51:22','Rotary Encoder from ALPS STEC12E07.','Rotary Encoder','','publish','open','open','','rotary-encoder','','','2013-04-08 08:51:22','2013-04-08 08:51:22','',0,'http://localhost/fz-parts/fzp/rotary-encoder/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3857,1,'2013-04-08 08:51:23','2013-04-08 08:51:23','	<div id=\"idTab1\" class=\"rte\"><p>Put your electronic assemblies in motion !</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>A motor driver shield for Arduino Uno, Mega and Duemilanove.</p>\n\n\n\n<ul>\n\n\n\n</ul>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Use the integrated circuit L293DNE (Quad Half H-bridge) that provides 0.6A per bridge (1.2A peak) with thermal protection and kickback diodes integrated.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>DC motors from 4.5VDC to 20VDC</p>\n\n\n\n<ul>\n\n\n\n<li>Can control up to four DC motors individually controlled speed (256 levels)</li>\n\n\n\n<li>Can control up to 2 stepper motors.</li>\n\n\n\n</ul>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Features :</p>\n\n\n\n<ul>\n\n\n\n<li>4 bi-color LED to indicate the direction of rotation for each motor.</li>\n\n\n\n<li>I2C bus used to minimize digital output pin used.</li>\n\n\n\n<li>Only 4 Arduino PWM outputs and 2 analog input are used</li>\n\n\n\n<li>Easy programming thanks to the library developed for this shield (see below).</li>\n\n\n\n<li>Pull down resistors built to disable the motors during board startup.</li>\n\n\n\n</ul>\n\n\n\n<ul>\n\n\n\n<li>2 screw terminals to simplify wiring to the motors;</li>\n\n\n\n<li>1 screw terminal dedicated to motor power supply (anti-interference improvment).</li>\n\n\n\n<li>ATX power supply header on the board. ATX 12VDC can be used for motor power by shorting dedicated solder jumper.</li>\n\n\n\n<li>8 additional outputs available on 16 PWM intensity levels</li>\n\n\n\n<li>Control sensors and outputs using the same shield.</li>\n\n\n\n</ul>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Arduino reset button brought the shield.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Compatible with Arduino Uno, Uno CMS, Duemilanove and Mega</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=43\" target=\"_blank\"><img style=\"height: auto; font-family: Arial, Helvetica, sans-serif; color: #323232; list-style-type: none; list-style-position: initial; list-style-image: initial; padding: 0px; margin: 0px; border: 0px initial initial;\" title=\"Assembly guide\" src=\"https://shop.snootlab.com/img/p/87-340.jpg\" alt=\"Assembly guide\" width=\"210\" height=\"78\" /></a></p>\n\n\n\n<p>Documentation and installation guide : <a href=\"http://shop.snootlab.com/attachment.php?id_attachment=43\" target=\"_blank\">link</a></p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>The official support forum: <a href=\"http://forum.snootlab.com\" target=\"_blank\">forum.snootlab.com</a></p>\n\n\n\n<p>Example of derivative use of Rotoshield to control an output voltage, manage engine, etc.. on the forum.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Library on GitHub : <a href=\"https://github.com/Snootlab/Snootor\" target=\"_blank\">link</a></p>\n\n\n\n<p>Our libraries are available for Arduino and Arduino 1.0 (select the branche you want on the Git).</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Soldering kit comes in a reusable zip ESD packaging.</p>\n\n\n\n<p>&nbsp;</p>\n\n\n\n<p>Like all our products, this kit is RoHS.</p>\n\n\n\n<p><img style=\"height: auto; font-family: Arial, Helvetica, sans-serif; color: #323232; list-style-type: none; list-style-position: initial; list-style-image: initial; padding: 0px; margin: 0px; border: 0px initial initial;\" src=\"http://shop.snootlab.com/themes/matrice/img/logos_ext/RoHS-Logo.jpg\" alt=\"\" width=\"45\" height=\"60\" /></p>\n\n\n\n<p>&nbsp;</p></div>\n\n\n\n					<ul id=\"idTab9\">\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=27\">Topside Rotoshield.pdf</a><br />Topside Rotoshield</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=31\">Manual Rotoshield FR.pdf</a><br />Assembly guide for Rotoshield FR</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=32\">Library snootor.zip</a><br />Library snootor for Rotoshield</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=33\">Schema Rotoshield.pdf</a><br />Schema of the Rotoshield</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=34\">Eagle Rotoshield.zip</a><br />Eagle files of the Rotoshield</li>\n\n\n\n					<li><a href=\"http://shop.snootlab.com/attachment.php?id_attachment=43\">Manual Rotoshield EN.pdf</a><br />Assembly guide Rotoshield EN</li>\n\n\n\n				</ul>\n\n\n\n			 <!-- accessories -->\n\n','Rotoshield - Motor driver shield for Arduino','','publish','open','open','','rotoshield-motor-driver-shield-for-arduino','','','2013-04-08 08:51:23','2013-04-08 08:51:23','',0,'http://localhost/fz-parts/fzp/rotoshield-motor-driver-shield-for-arduino/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3858,1,'2013-04-08 08:51:23','2013-04-08 08:51:23','S1133 photodiode with low dark current by Hamamatsu.','S1133 Si Photodiode','','publish','open','open','','s1133-si-photodiode','','','2013-04-08 08:51:23','2013-04-08 08:51:23','',0,'http://localhost/fz-parts/fzp/s1133-si-photodiode/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3859,1,'2013-04-08 08:51:23','2013-04-08 08:51:23','<p>\n\n\n	<strong>Description:</strong> The Si4735 is the first digital CMOS AM/FM radio receiver IC that integrates the complete tuner function from antenna input to audio output. This feature-rich solution includes advanced seek algorithms, soft mute, auto-calibrated digital tuning, and FM stereo processing. The chip also incorporates a digital processor for the European Radio Data System (<a href=\"http://en.wikipedia.org/wiki/Radio_Data_System\" target=\"_blank\">RDS</a>) and the North American Radio Broadcast Data System (<a href=\"http://en.wikipedia.org/wiki/RBDS\" target=\"_blank\">RBDS</a>), including all required symbol decoding, block synchronization, error detection, and error correction functions. Basically it&#39;s an entire AM/FM, LW/SW radio in a single chip.</p>\n\n\n<p>\n\n\n	Now that we&#39;ve mounted it on a shield, you can harness all of that sweet radio-playing power right from your Arduino. Simply stack the shield onto your Arduino board, plug in some speakers (headphones don&#39;t seem to work as well without a preamp) and use the library below to control the volume, channel selection, etc. The library also allows you to send a variety of other commands constructed by consulting the Si4735 Programmers Guide.</p>\n\n\n<p>\n\n\n	This board seems to get decent reception compared to other stereos around the office even using a simple wire antenna. If you happen to have an antenna that you&#39;d like to use it can be soldered right to the via marked &quot;antenna&quot;.</p>\n\n\n<p>\n\n\n	<strong>Documents: </strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/SI4735 Shield-v13.pdf\" target=\"_blank\">Schematic </a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/SI4735 Shield-v13.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/Si4735 Datasheet.pdf\" target=\"_blank\">Datasheet</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/Si4735.zip\" target=\"_blank\">Arduino Library</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/Si4735 Programming Guide.pdf\" target=\"_blank\">Programming Guide</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/RBDS Standard.pdf\" target=\"_blank\">RBDS Standard</a></li>\n\n\n</ul>','Si4735 AM & FM Receiver Shield','','publish','open','open','','si4735-am-fm-receiver-shield','','','2013-04-08 08:51:23','2013-04-08 08:51:23','',0,'http://localhost/fz-parts/fzp/si4735-am-fm-receiver-shield/',0,'fz_fzp','',0);
