INSERT INTO `wp_posts` VALUES (3930,1,'2013-04-08 08:51:25','2013-04-08 08:51:25','<p>\n\n\n	<strong>Description:</strong> This is a breakout board for the Silicon Laboratories Si4703 FM tuner chip. Beyond being a simple FM radio, the Si4703 is also capable of detecting and processing both Radio Data Service (RDS) and Radio Broadcast Data Service (RBDS) information. The Si4703 even does a very good job of filtering and carrier detection. It also enables data such as the station ID and song name to be displayed to the user.</p>\n\n\n<p>\n\n\n	Using this board we are able to pick up multiple stations just as well as with a standard FM radio. The board breaks out all major pins and makes it easy to incorporate this great chip into your next radio project. Also, by plugging headphones into the 3.5mm audio jack, you effectively use the cable in your headphones as an antenna! Therefore, this board does not require an external antenna if using headphones or a 3.5mm audio cable longer than 3 feet.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Si470x-Eval-v11.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Si470x-Eval-v11.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Si4702-03-C19-1.pdf\">Datasheet</a> (Si4703)</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/tpa6111a2.pdf\" target=\"_blank\">Datasheet</a> (TPA6111A2)</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/Si4703_Example.pde\" target=\"_blank\">Arduino Example Code</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/AN230_0.61.pdf\" target=\"_blank\">Programming Guide</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/8972\" target=\"_blank\">WRL-08972</a></p>','Digital FM Radio Receiver','','publish','open','open','','digital-fm-radio-receiver','','','2013-04-08 08:51:25','2013-04-08 08:51:25','',0,'http://localhost/fz-parts/fzp/digital-fm-radio-receiver/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3931,1,'2013-04-08 08:51:25','2013-04-08 08:51:25','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> Basic breakout board for the TEMT6000 Ambient Light Sensor. Only what you need, nothing you don&#39;t. Sensor acts like a transistor - the greater the incoming light, the higher the analog voltage on the signal pin.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Imaging/TEMT6000.pdf\" name=\"\" target=\"_blank\">Datasheet</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://wiring.org.co/learning/basics/ambientlighttemt6000.html\" name=\"\" target=\"_blank\">Wiring Example</a></li>\n\n\n</ul>','Ambient Light Sensor (TEMT6000 Breakout Board)','','publish','open','open','','ambient-light-sensor-temt6000-breakout-board','','','2013-04-08 08:51:25','2013-04-08 08:51:25','',0,'http://localhost/fz-parts/fzp/ambient-light-sensor-temt6000-breakout-board/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3932,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','<p>\n\n\n	<b>Description: </b>This is a breakout board for the incredibly small TMP102 digital temperature sensor. The TMP102 is a digital sensor (I2C a.k.a. TWI), has a resolution of 0.0625&deg;C, and is accurate up to 0.5&deg;C. The sensor requires very low-current, and is loaded with features.</p>\n\n\n<p>\n\n\n	Communication with the TMP102 is achieved through a two-wire serial interface. There is no on-board voltage regulator, so supplied voltage should be between 1.4 to 3.6VDC. Filtering capacitors and pull-up resistors are included as shown.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		12-bit, 0.0625&deg;C resolution</li>\n\n\n	<li>\n\n\n		Accuracy: 0.5&deg;C (-25&deg;C to +85&deg;C)</li>\n\n\n	<li>\n\n\n		Low quiescent current\n\n\n		<ul>\n\n\n			<li>\n\n\n				10&micro;A Active (max)</li>\n\n\n			<li>\n\n\n				1&micro;A Shutdown (max)</li>\n\n\n		</ul>\n\n\n	</li>\n\n\n	<li>\n\n\n		1.4V to 3.6VDC supply range</li>\n\n\n	<li>\n\n\n		Two-wire serial interface</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<b>Documents:</b></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Temperature/TMP102_Breakout-v11.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Temperature/tmp102.pdf\" name=\"\" target=\"_blank\">TMP102 Datasheet</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Sensors/Temperature/tmp102.zip\" name=\"\" target=\"_blank\">Example Code</a> (ATmega328)</li>\n\n\n	<li>\n\n\n		<a href=\"http://wiring.org.co/learning/libraries/tmp102sparkfun.html\" target=\"_blank\">Wiring Example</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://mbed.org/cookbook/TMP102-Temperature-Sensor\" target=\"_blank\">mbed Example</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://bildr.org/2011/01/tmp102-arduino/\" target=\"_blank\">bildr blog - TMP102</a></li>\n\n\n</ul>','Digital Temperature Sensor Breakout - TMP102','','publish','open','open','','digital-temperature-sensor-breakout-tmp102','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/digital-temperature-sensor-breakout-tmp102/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3933,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','The Teensy is a complete USB-based microcontoller development system, in a very small footprint, capable of implementing many types of projects. All programming is done via the USB port. No special programmer is needed, only a standard \"Mini-B\" USB cable and a PC or Macintosh with a USB port.','Teensy++ 2.0','','publish','open','open','','teensy-2-0','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/teensy-2-0/',0,'fz_fzp','',0);
