INSERT INTO `wp_posts` VALUES (3936,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','<p>\n\n\n	<strong>Description:</strong> The MPR121 IC is a great way to build simple capacitive touch interfaces, and now it&#39;s even easier to incorporate into your Arduino projects with the touch shield. The touch shield has 9 capacitive touch pads, with headers for the remaining 3 electrode connections. With this shield you can have a total of 12 touch sensitive buttons. An on-board logic level converter allows it to work with 5V and 3.3V Arduino boards. Simply solder on some header pins and stack it on to your Arduino for a convenient input device. Check below for some example code to get you started.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/Touch_Shield-v11.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/Touch_Shield-v11.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Dev/Arduino/Shields/Touch_Shield_Example.zip\" target=\"_blank\">Example Code</a></li>\n\n\n</ul>','Arduino Cap Sense Shield','','publish','open','open','','arduino-cap-sense-shield','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/arduino-cap-sense-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3937,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','<p>\n\n\n	<b>Description: </b>This is a breakout board for our <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9308\" name=\"\" target=\"\">Blackberry Trackball</a>. The four spindles on the trackball have a tiny circular magnet the end; each of these are paired with an SMD hall effect sensor, which are used to measure up, down, left and right movements of the trackball. An SMD momentary switch is placed under the trackball to give you a select switch. The BTN line will be pulled low when the switch is pressed.</p>\n\n\n<p>\n\n\n	Also included on the Trackballer are 4 LEDs: red, blue, green and white. These can be powered to light the clear trackball up any color you can imagine.</p>\n\n\n<p>\n\n\n	All features are broken out to a 0.1&quot; pitch header. Regulated, 2.5-5.25VDC power must be provided to power the Hall sensors. The trackball is attached with strong CA glue. Board comes as shown, with all components populated.</p>\n\n\n<p>\n\n\n	The hall-effect sensors and trackball combo are surprisingly sensitive. A slight roll of the trackball creates multiple high/low transitions on the four axis pins, easily picked up by any microcontroller. A 360&deg; rotation of the trackball, along a single axis, will result in about 9 high/low transitions.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Center select button</li>\n\n\n	<li>\n\n\n		360&deg; direction</li>\n\n\n	<li>\n\n\n		Hall effect sensors measure up/down/left/right movements of trackball</li>\n\n\n	<li>\n\n\n		Red, blue, green, white LEDs to light up the trackball</li>\n\n\n	<li>\n\n\n		All pins broken out to 0.1&quot; pitch header</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span> 1.1x0.85&quot;<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/Trackball-v11.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/Trackballer-v12-Eagle.zip\" name=\"\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/SPC00019AEB.pdf\" name=\"\" target=\"_blank\">Hall sensor datasheet</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.freescale.com/files/wireless_comm/doc/reports_presentations/eet_teardown_bbpearl_jan07.pdf\" name=\"\" target=\"_blank\">Blackberry Teardown</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www2.electronicproducts.com/Research_In_Motion_-_BlackBerry_Pearl_8100-whatsinside_text-12.aspx\" name=\"\" target=\"_blank\">Inside the Blackberry (BOM)</a></li>\n\n\n</ul>','Blackberry Trackballer Breakout','','publish','open','open','','blackberry-trackballer-breakout','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/blackberry-trackballer-breakout/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3938,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> Blink any color you need! Use the Tri-Color LED board as a simple indicator, or by pulsing the red, green, and blue channels, you can create any color. Very bright output. This is a common anode design - to turn on a channel you simply need to ground one of the R/G/B pins to illuminate that channel.<br />\n\n\n	<br />\n\n\n	LilyPad is a wearable technology developed by Leah Buechley and cooperatively designed by Leah and SparkFun. Each LilyPad was creatively designed to have large connecting pads to allow them to be sewn into clothing. Various input, output, power, and sensor boards are available. They&#39;re even washable!<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		20mm outer diameter</li>\n\n\n	<li>\n\n\n		Thin 0.8mm PCB</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/LilyPad/LilyPad-TriColorLED.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		LilyPad Tri-Color LED Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPad-Tri-ColorLED-08467.pdf\" target=\"_blank\">PDF</a></li>\n\n\n	<li>\n\n\n		All LilyPad Product Sticker Sheet <a href=\"http://www.sparkfun.com/marcomm/SFE03-0010-Packaging-LilyPadFPO-Stickers-MASTER.pdf\" target=\"_blank\">PDF</a></li>\n\n\n</ul>','LilyPad Tri-Color LED','','publish','open','open','','lilypad-tri-color-led','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/lilypad-tri-color-led/',0,'fz_fzp','',0);
