INSERT INTO `wp_posts` VALUES (3942,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','<p>\n\n\n	<strong>Description:&nbsp; </strong>This new version corrects the pin out for the GPX and RESET pins. The USB Host Shield contains all of the digital logic and analog circuitry necessary to implement a full-speed USB peripheral/host controller with your Arduino. This means you could use your Arduino to interface with and control any USB slave device - thumbdrives, digital cameras, bluetooth dongles, and much more!</p>\n\n\n<p>\n\n\n	A four-wire serial interface is used to communicate with the host controller chip, so the shield connects the Arduino&#39;s hardware SPI pins (D10-13) to the MAX3421E. A USB type A female connector is wired up to the IC, and it also supplies 5V as any normal USB port would.</p>\n\n\n<p>\n\n\n	The Host Shield takes its power from the &#39;Vin&#39; pin on your Arduino. Power from that pin is regulated to both 5V and 3.3V on the shield. All SPI signals are sent through a hex converter to step them down to 3.3V.</p>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/USBHostShield-v13.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/USBHostShield-v13.zip\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/MAX3421E.pdf\" target=\"_blank\">Datasheet</a> (MAX3421E)</li>\n\n\n	<li>\n\n\n		<a href=\"http://www.circuitsathome.com/arduino_usb_host_shield_projects\" target=\"_blank\">Projects and Code</a> (Thanks Oleg!)</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9628\" target=\"_blank\">DEV-09628</a></p>','Arduino USB Host Shield','','publish','open','open','','arduino-usb-host-shield','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/arduino-usb-host-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3943,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','Plug-in Network Module having W5200 & Mag Jack','WIZ820io','','publish','open','open','','wiz820io','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/wiz820io/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3944,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>This new version breaks out the PI09, FORCE WAKE, and the hardware reset lines. It also has a different crystal and uses the RN-131C.</p>\n\n\n<p>\n\n\n	The WiFly Shield equips your Arduino the ability to connect to 802.11b/g wireless networks. The featured components of the shield are a Roving Network&#39;s RN-131C wireless module and an SC16IS750 SPI-to-UART chip. The SPI-to-UART bridge is used to allow for faster transmission speed and to free up the Arduino&#39;s UART.<br />\n\n\n	<br />\n\n\n	Power is taken from the Vin pin of your Arduino, regulated to 3.3V, and provided to both the RN-131C and the SC16IS750. You&#39;ll communicate with the WiFly Shield over SPI using Arduino digital pins 10-13 (CS, MOSI, MISO, SCLK respectively).<br />\n\n\n	<br />\n\n\n	The shield includes the RN-131C, SC16IS750 and their supporting components. The shield also provides a small prototyping area, with 0.1&quot; spaced holes. Headers are not soldered on, we recommend the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" name=\"\" target=\"_self\">6</a> and <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">8-pin stackable headers</a>.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/WiFly_Shield-v17.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/WiFly_Shield-v17.zip\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Wireless/WiFi/rn-131-ds.pdf\" target=\"_blank\">Datasheet (RN-131C)</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Wireless/WiFi/WiFlyGSX-um2.pdf\" target=\"_blank\">Reference Guide (RN-131C)</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Components/SMD/SC16IS740_750_760.pdf\" target=\"_blank\">SC16IS750 Datasheet</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=158\" name=\"\" target=\"_blank\">Talking Wireless Server Tutorial</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://forum.sparkfun.com/viewtopic.php?p=115626#p115626\">Experimental WiFly Arduino Library</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://forum.sparkfun.com/viewtopic.php?f=32&amp;t=25129\" target=\"_blank\">WiFly Troubleshooting</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://lifeboat.co.nz/the-finished-wireless-water-sensor/\" target=\"_blank\">Wireless Water Sensor Project</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9367\" target=\"_blank\">WRL-09367</a></p>','Arduino WiFly Shield','','publish','open','open','','arduino-wifly-shield','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/arduino-wifly-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3945,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','The Wireless SD shield allows an Arduino board to communicate wirelessly using a wireless module. It is based on the Xbee modules from Digi, but can use any module with the same footprint. The module can communicate up to 100 feet indoors or 300 feet outdoors (with line-of-sight). It can be used as a serial/usb replacement or you can put it into a command mode and configure it for a variety of broadcast and mesh networking options. The shields breaks out each of the Xbee\'s pins to a through-hole solder pad.\n\nIncluded on board is a SD card slot. When using the SD Library to access the card, Pin 4 is CS and cannot be used otherwise. SPI also relies on pins 11, 12, and 13 for communication.\n\nAlso on board is a switch allowing for control via USB or the microcontroller.','Arduino Wireless SD Shield','','publish','open','open','','arduino-wireless-sd-shield','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/arduino-wireless-sd-shield/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3946,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','An open source hardware platform based on the Atmel ATmega644P(A) microcontroller.  Programmable and powered via USB.  Can also be powered by external power supply.\n\n\n\n\n\n\n\n\n\nhttp://wiring.org.co/','Wiring S','','publish','open','open','','wiring-s','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/wiring-s/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (3947,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> The XBee Explorer Regulated takes care of the 3.3V regulation, signal conditioning, and basic activity indicators (Power, RSSI and DIN/DOUT activity LEDs). It translates the 5V signals to 3.3V so that you can connect a 5V (down to 3.3V) system to any XBee module. The board was conveniently designed to mate directly with Arduino Pro boards for <a classname=\"\" href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=122\" name=\"\" target=\"_blank\">wireless bootloading</a> and USB based configuration.<br />\n\n\n	<br />\n\n\n	This unit works with all XBee modules including the Series 1 and Series 2.5, standard and Pro versions. Plug an XBee into this breakout and you will have direct access to the serial and programming pins on the XBee unit and will be able to power the XBee with 5V.<br />\n\n\n	<br />\n\n\n	This board comes fully populated with 3.3V regulator (16V max input), XBee socket, four status LEDs, and a diode to allow 5V systems to communicate safely with the 3.3V XBees. This board does not include and XBee module. XBee modules sold below.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Wireless/Zigbee/XBee-Regulated-v10.pdf\" name=\"\" target=\"_blank\">Schematic<br />\n\n\n		</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Wireless/Zigbee/XBee-Regulated-v12.zip\" name=\"\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.digi.com/support/kbase/kbaseresultdetl.jsp?kb=125\" target=\"_blank\">X-CTU Software</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/tutorials/257\" target=\"_blank\">XBee Introduction and Buying Guide</a></li>\n\n\n</ul>','XBee Explorer Regulated','','publish','open','open','','xbee-explorer-regulated','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/xbee-explorer-regulated/',0,'fz_fzp','',0);
