INSERT INTO `wp_posts` VALUES (3949,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>This is a simple breakout board for Analog Device&#39;s AD5330 8-bit digital-to-analog converter (DAC). The AD5330 has a parallel interface, and can operate from a 2.5 to 5.5V supply consuming just 115uA (at 3V).<br />\n\n\n	<br />\n\n\n	The DB0-7 pins, the parallel data inputs, are used to configure the analog output voltage. CS selects the device, and data is loaded into the input registers on the rising edge of WR. The GAIN pin allows the output range to be set at either 0V to VCC or 0V to 2VCC.<br />\n\n\n	<br />\n\n\n	Input data to the AD5330 is double-buffered, allowing simultaneous update of multiple DACs in a system using the LDAC pin. An asynchronous CLR input resets the contents of the input register and the DAC register to all zeros. The AD5330 also incorporates a power-on reset circuit that ensures that the DAC output powers on to 0V and remains there until valid data is written to the device.<br />\n\n\n	<br />\n\n\n	This breadboard friendly board breaks out every necessary pin of the AD5330 to 0.1&quot; spaced headers. The board includes a decoupling capacitor, but does not do any voltage regulation; voltage supplied to the board should be within the specified range.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Dimensions: </span>0.80 x 1.10&quot;<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/ad5330%20breakout-v11.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.analog.com/static/imported-files/data_sheets/AD5330_5331_5340_5341.pdf\" name=\"\" target=\"_blank\">AD5330 Datasheet</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/tutorial/AD5330_Play_Wavs/AD5330%20Arduino%20Library.zip\" name=\"\" target=\"_blank\">Arduino Library</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=160\" name=\"\" target=\"_blank\">Tutorial</a></li>\n\n\n</ul>','DAC Breakout','','publish','open','open','','dac-breakout','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/dac-breakout/',0,'fz_fzp','',0);
