INSERT INTO `wp_posts` VALUES (3955,1,'2013-04-08 08:51:26','2013-04-08 08:51:26','The Xbee shield allows an Arduino board to communicate wirelessly using Zigbee. It is based on the Xbee module from MaxStream. The module can communicate up to 100 feet indoors or 300 feet outdoors (with line-of-sight). It can be used as a serial/usb replacement or you can put it into a command mode and configure it for a variety of broadcast and mesh networking options. The shields breaks out each of the Xbee\'s pins to a through-hole solder pad. It also provides female pin headers for use of digital pins 2 to 7 and the analog inputs, which are covered by the shield (digital pins 8 to 13 are not obstructed by the shield, so you can use the headers on the board itself).\n\nThe Xbee shield was created in collaboration with Libelium, who developed it for use in their SquidBee motes (used for creating sensor networks).','Arduino Xbee Libellium Shield','','publish','open','open','','arduino-xbee-libellium-shield','','','2013-04-08 08:51:26','2013-04-08 08:51:26','',0,'http://localhost/fz-parts/fzp/arduino-xbee-libellium-shield/',0,'fz_fzp','',0);
