INSERT INTO `wp_posts` VALUES (3960,1,'2013-04-08 08:51:27','2013-04-08 08:51:27','<p>\n\n\n	<strong>Replacement:</strong> <a href=\"http://www.sparkfun.com/products/10588\" target=\"_blank\">PRT-10588</a>. The new revision corrects the silkscreen so that the pins are now labeled correctly. This page is for reference only.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Description:</span> Simple breakout board for the 3.5mm audio jack. Use this breakout (shipped bare) to allow breadboard or SIP access to the super-common 3.5mm audio jack. All five pins are broken out.<br />\n\n\n	<br />\n\n\n	<strong><span style=\"font-weight: bold;\">Note: </span></strong>This is for the bare PCB only.</p>\n\n\n<p>\n\n\n	<strong>Note:</strong> The silkscreen is incorrect. We are working on a revision. However, the board is still usable, but the labeling isn&#39;t even close to correct. Here is the correct pin labeling (from top to bottom):</p>\n\n\n<ul>\n\n\n	<li>\n\n\n		GND (Ground)</li>\n\n\n	<li>\n\n\n		RNG (Ring)</li>\n\n\n	<li>\n\n\n		RSH (Ring Shunt)</li>\n\n\n	<li>\n\n\n		TIP (Tip)</li>\n\n\n	<li>\n\n\n		TSH (Tip Shunt)</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span> <a href=\"http://www.sparkfun.com/datasheets/BreakoutBoards/audiojack_breakoutsch.pdf\" target=\"_blank\">Schematic</a></p>','Audio Jack Breakout','','publish','open','open','','audio-jack-breakout','','','2013-04-08 08:51:27','2013-04-08 08:51:27','',0,'http://localhost/fz-parts/fzp/audio-jack-breakout/',0,'fz_fzp','',0);
