INSERT INTO `wp_posts` VALUES (3972,1,'2013-04-08 08:51:27','2013-04-08 08:51:27','<div>\n\n\n	<strong>Description:</strong> This shield gives the Arduino CAN-Bus capability. It uses the Microchip MCP2515 CAN controller with MCP2551 CAN transceiver. CAN connection is via a standard 9-way sub-D for use with&nbsp;OBDII cable. Ideal for automative CAN application. The shield also has a uSD card holder, serial LCD connector and connector for an&nbsp;EM406 GPS module. Making this shield ideal for data logging application.</div>\n\n\n<div>\n\n\n	<strong>Features</strong></div>\n\n\n<div>\n\n\n	<ul>\n\n\n		<li>\n\n\n			CAN v2.0B upto 1 Mb/s</li>\n\n\n		<li>\n\n\n			High speed SPI Interface (10 MHz)</li>\n\n\n		<li>\n\n\n			Standard and extened data and remote frames</li>\n\n\n		<li>\n\n\n			CAN connection via standard 9-way sub-D connector</li>\n\n\n		<li>\n\n\n			9-way sub-D standard&nbsp;OBDII connection cable</li>\n\n\n		<li>\n\n\n			Power can supply to Arduino by sub-D via resettable fuse and reverse polarity protection.</li>\n\n\n		<li>\n\n\n			Socket for&nbsp;EM406 GPS module</li>\n\n\n		<li>\n\n\n			Micro SD card holder</li>\n\n\n		<li>\n\n\n			Connector for&nbsp;serial LCD</li>\n\n\n		<li>\n\n\n			Reset button</li>\n\n\n		<li>\n\n\n			Joystick control menu navigation control</li>\n\n\n		<li>\n\n\n			Two LED indicator</li>\n\n\n	</ul>\n\n\n	<p>\n\n\n		<strong>Documents:</strong></p>\n\n\n	<ul>\n\n\n		<li>\n\n\n			<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/canbus_shield-v12.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n		<li>\n\n\n			<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/canbus_shield-v12.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n		<li>\n\n\n			<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/MCP2515.pdf\" target=\"_blank\">Datasheet </a>(MCP2515)</li>\n\n\n		<li>\n\n\n			<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/MCP2551.pdf\" target=\"_blank\">Datasheet </a>(MCP2551)</li>\n\n\n	</ul>\n\n\n</div>','Arduino Can-Bus Shield','','publish','open','open','','arduino-can-bus-shield','','','2013-04-08 08:51:27','2013-04-08 08:51:27','',0,'http://localhost/fz-parts/fzp/arduino-can-bus-shield/',0,'fz_fzp','',0);
