INSERT INTO `wp_posts` VALUES (3980,1,'2013-04-08 08:51:28','2013-04-08 08:51:28','<p>\n\n\n	<strong>D</strong><span style=\"font-weight: bold;\">escription: </span>The Cellular Shield for Arduino includes all the parts needed to interface your Arduino with an <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9533\" name=\"\" target=\"_self\">SM5100B</a> cellular module. This allows you to easily add SMS, GSM/GPRS, and TCP/IP functionalities to your Arduino-based project. All you need to add cellular functionality to your Arduino project is a SIM card (pre-paid or straight from your phone) and an antenna and you can start sending Serial.print statements to make calls, send texts and serve web pages!</p>\n\n\n<p>\n\n\n	&nbsp;The main components of the Cellular Shield are a 60-pin <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9535\" name=\"\" target=\"_self\">SM5100B connector</a>, a <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=548\" name=\"\" target=\"_self\">SIM card socket</a>, and an SPX29302 voltage regulator configured to regulate the Arduino&#39;s raw voltage to 3.8V. The board&#39;s red LED indicates power. The Arduino&#39;s reset button is also brought out on the shield.<br />\n\n\n	<br />\n\n\n	Two solder jumpers on the board allow you to select which serial pins interface with the cellular module - software (D2, D3) or hardware (D0, D1). There is also a 5-pin, 0.1&quot; spaced header with connections for microphone inputs and speaker outputs. Headers are not soldered on, we recommend the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" name=\"\" target=\"_self\">6</a> and <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">8-pin stackable headers</a>.<br />\n\n\n	<br />\n\n\n	The SM5100B cellular module <span style=\"font-style: italic;\">is</span> included with this product, however an antenna is not. It is pre-configured to 9600bps.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\">Documents:</span></span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/cellular%20shield-v12.pdf\" name=\"\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/Code/Cellular_Shield_Passthrough.zip\" name=\"\" target=\"_blank\">Sample Sketch</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/CellularShield/SM5100B%20Datasheet.pdf\" name=\"\" target=\"_blank\">SM5100B Datasheet</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/CellularShield/SM5100B%20AT%20Command%20Set.pdf\" name=\"\" target=\"_blank\">SM5100B AT Command Set</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/CellularShield/SM5100B%20SMS%20App%20Note.pdf\" name=\"\" target=\"_blank\">SM5100B SMS App Note</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/CellularShield/SM5100B%20TCPIP%20App%20Note.pdf\" name=\"\" target=\"\">SM5100B TCP/IP App Note</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://tronixstuff.wordpress.com/2011/01/19/tutorial-arduino-and-gsm-cellular-part-one/\" target=\"_blank\">Arduino Tutorial</a></li>\n\n\n</ul>','Arduino Cellular Shield','','publish','open','open','','arduino-cellular-shield','','','2013-04-08 08:51:28','2013-04-08 08:51:28','',0,'http://localhost/fz-parts/fzp/arduino-cellular-shield/',0,'fz_fzp','',0);
