INSERT INTO `wp_posts` VALUES (3983,1,'2013-04-08 08:51:28','2013-04-08 08:51:28','The Propeller chip makes it easy to rapidly develop embedded applications. Its eight processors (cogs) can operate simultaneously, either independently or cooperatively, sharing common resources through a central hub. The developer has full control over how and when each cog is employed; there is no compiler-driven or operating system-driven splitting of tasks among multiple cogs. A shared system clock keeps each cog on the same time reference, allowing for true deterministic timing and synchronization. Two programming languages are available: the easy-to-learn high-level Spin, and Propeller Assembly which can execute at up to 160 MIPS (20 MIPS per cog).','Parallax Propeller D40','','publish','open','open','','parallax-propeller-d40','','','2013-04-08 08:51:28','2013-04-08 08:51:28','',0,'http://localhost/fz-parts/fzp/parallax-propeller-d40/',0,'fz_fzp','',0);
