INSERT INTO `wp_posts` VALUES (3995,1,'2013-04-08 08:51:28','2013-04-08 08:51:28','<p>\n\n\n	<strong>Description:</strong> This is a breakout for the GS1011 ultra low-power wireless chip from GainSpan. The GS1011 device is a highly integrated ultra low power wireless single chip which contains an 802.11b radio, media access controller (MAC) and baseband processor, on-chip flash memory and SRAM, and an applications processor all on a single package. Along with its embedded software stack it offers a highly scalable, reliable, manageable and secure wireless link to meet the growing demand of wireless sensor networks utilizing the broadly accepted IEEE 802.11b,g,n standards infrastructure.</p>\n\n\n<p>\n\n\n	<strong>Features:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Supports IEEE 802.11</li>\n\n\n	<li>\n\n\n		Seamlessly integrates with existing 802.11b/g infrastructure and utilizes the 802.11 security, manageability, ease-of-use, and quality of service</li>\n\n\n	<li>\n\n\n		802.11i/WPA2 Authentication, AES Hardware encryption</li>\n\n\n	<li>\n\n\n		Optimized for battery powered application with very low power consumption for multiple years of battery life</li>\n\n\n	<li>\n\n\n		Range 200-300M+ Outdoor (Typical Estimate)</li>\n\n\n	<li>\n\n\n		Two 32-bit ARM7 CPU @44MHz, 1 for applications (APP) : 1 dedicated to radio (WLAN)</li>\n\n\n	<li>\n\n\n		2 UART , I2C, 2 SPI, 2 ADC, 1 PWM, and 32 GPIO</li>\n\n\n	<li>\n\n\n		Operates at 3.3V</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/gs1011_breakout-v11.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/gs1011_breakout-v11.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/BreakoutBoards/GS1011M Datasheet ver 1.0.pdf\" target=\"_blank\">Datasheet</a> (GS1011)</li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Wireless/WiFi/Serial_to_WiFi_Adapter_Guide ver 5_3.pdf\" target=\"_blank\">Command Set</a></li>\n\n\n</ul>','GainSpan WiFi Breakout','','publish','open','open','','gainspan-wifi-breakout','','','2013-04-08 08:51:28','2013-04-08 08:51:28','',0,'http://localhost/fz-parts/fzp/gainspan-wifi-breakout/',0,'fz_fzp','',0);
