INSERT INTO `wp_posts` VALUES (4000,1,'2013-04-08 08:51:28','2013-04-08 08:51:28','The Carrier Card is a prototype board for use with the Carrier Board. This Carrier Card can be separated into two parts. Both parts have a series of +3V pins along their left edge and a series of GND pins along their right edge. All the header pins on the top row are labeled and connected to a free hole below. There\'s a mounting hole to fasten the right side to the center of the bottom ABS shell.','Carrier Card expansion area','','publish','open','open','','carrier-card-expansion-area','','','2013-04-08 08:51:28','2013-04-08 08:51:28','',0,'http://localhost/fz-parts/fzp/carrier-card-expansion-area/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (4001,1,'2013-04-08 08:51:28','2013-04-08 08:51:28','The JeePlug is a general-purpose mini-board which \"happens\" to be particularly convenient for use with \"ports\". It\'s a small 8 x 10 hole prototype board for simple interconnect tasks to components and connectors.','JeePlug experimenter\'s board','','publish','open','open','','jeeplug-experimenters-board','','','2013-04-08 08:51:28','2013-04-08 08:51:28','',0,'http://localhost/fz-parts/fzp/jeeplug-experimenters-board/',0,'fz_fzp','',0);
INSERT INTO `wp_posts` VALUES (4002,1,'2013-04-08 08:51:28','2013-04-08 08:51:28','The JeeNode is a low-cost combination of radio and microcontroller board. Think of the JeeNode as an Arduino + Xbee shield + Xbee, but smaller and less feature-full than the XBee. This is the through-hole kit, but the headers are pin-compatible with the JeeNode SMD, the JeeNode SMD, and the SMD Kit.','JeeNode wireless microcontroller','','publish','open','open','','jeenode-wireless-microcontroller','','','2013-04-08 08:51:28','2013-04-08 08:51:28','',0,'http://localhost/fz-parts/fzp/jeenode-wireless-microcontroller/',0,'fz_fzp','',0);
