INSERT INTO `wp_posts` VALUES (4018,1,'2013-04-08 08:51:29','2013-04-08 08:51:29','<p>\n\n\n	<strong>Update:</strong> After taking a figurative lashing from the comments section we&#39;re begging for mercy by updating the microSD Shield board. All new microSD shields have a voltage converter chip on-board that converts the Arduino 5V signals to 3.3V signals in accordance with SD specifications. No more &#39;blown up&#39; SD cards!</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>Running out of memory space in your Arduino project? The microSD Shield equips your Arduino with mass-storage capability, so you can use it for data-logging or other related projects. A <a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=172\">microSD quickstart guide</a> is available!</p>\n\n\n<p>\n\n\n	Communication with microSD cards is achieved over an SPI interface. The SCK, DI, and DO pins of the microSD socket are broken out to the ATmega168/328&#39;s standard SPI pins (digital 11-13), while the CS pin is broken out to Arduino&#39;s D8 pin. If you decide to use one of the many open source FAT libraries (like FAT16 or SDFat) make sure to change the code to reflect the location of the CS pin. Most libraries assume the CS pin is connected to D10; this will have to be changed to D8. Also for the libraries to work pin D10 will have to be set as an output in the &#39;setup()&#39; section of your sketch. The shield also includes a large prototyping area with a 13x12 grid of 0.1&quot; pitch PTHs.</p>\n\n\n<p>\n\n\n	This shield comes populated with a microSD socket, red power indicator LED, and a reset button; but it does not come with headers installed. We recommend the <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" name=\"\" target=\"_self\">6</a> and <a classname=\"\" href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" name=\"\" target=\"_self\">8-pin stackable headers</a>.<br />\n\n\n	<br />\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/commerce/tutorial_info.php?tutorials_id=172\">microSD Quickstart Guide</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/tutorial/microSD_Shield/SD_SimpleExample.pde\" target=\"_blank\">Example sketch</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/microSD_Shield-v13 Schematic.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/microSD_Shield-v13.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/Code/FAT16.zip\" target=\"_blank\">FAT16 Library</a> (Unzip this folder in the Arduino Libraries Folder. Once unzipped you can find an example by going to File-&gt;Examples-&gt;FAT-&gt;FAT_Example in Arduino. You must re-open Arduino after unzipping the folder.</li>\n\n\n</ul>','Arduino MicroSD Shield','','publish','open','open','','arduino-microsd-shield','','','2013-04-08 08:51:29','2013-04-08 08:51:29','',0,'http://localhost/fz-parts/fzp/arduino-microsd-shield/',0,'fz_fzp','',0);
