INSERT INTO `wp_posts` VALUES (4021,1,'2013-04-08 08:51:29','2013-04-08 08:51:29','<p>\n\n\n	<span style=\"font-weight: bold;\">Description: </span>Created in collaboration with Jamie Robertson, the MP3 Trigger is quite possibly the most versatile, low-cost, low power embedded MP3 Player. The board has 18 external trigger pins that will directly trigger pre-selected MP3 tracks, and a full-duplex serial control port that provides full transport control, remote triggering for up to 256 tracks, and fast real-time volume control. The board plays the MP3 files directly from a FAT16 microSD flash card and supports 192Kbps stereo playback. There is also an on-board navigation switch for local access and playback of all MP3 tracks on the flash card.</p>\n\n\n<p>\n\n\n	New for version 2: Aside from more than doubling the number of trigger inputs, the MP3 Trigger v2 now contains a resident bootloader that enables firmware updates directly from the microSD card without requiring a hardware programmer. The <a href=\"http://www.cypress.com/?id=2522\" target=\"_blank\">PSoC Designer IDE</a> can be used to generate hex files for the bootloader. See the datasheet below for more details on how to use the bootloader.</p>\n\n\n<p>\n\n\n	Firmware version 2&nbsp;also incorporates &ldquo;Quiet Mode&rdquo;, a new feature&nbsp;that can be enabled via the serial control port. In this mode, the triggers don&rsquo;t start tracks directly, but instead produce a serial message indicating which triggers were activated. A host microcontroller (<a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=666\" target=\"_blank\">Arduino</a>, for example) can thus monitor the trigger inputs and then start any track or sequence of tracks via the serial control port, making the triggers much more flexible.</p>\n\n\n<p>\n\n\n	The board uses a Cypress PSoC CY8C29466-24SXI microcontroller and a VLSI VS1053 audio codec.</p>\n\n\n<p>\n\n\n	Board can be powered by an external wall wart, FTDI Basic, or raw 3.3V input (see related items below).</p>\n\n\n<p>\n\n\n	<strong>Firmware update 2.40 Beta:</strong> Check it out <a href=\"http://makerjam.com/mp3-trigger/mp3-trigger-firmware-version-2-40-beta/\" target=\"_blank\">here</a> and be sure to leave feedback on the blog post.</p>\n\n\n<p>\n\n\n	<strong>Firmware update 2.23: compatible with 192kbps audio.</strong></p>\n\n\n<p>\n\n\n	We use the most up-to-date firmware on everything we ship out. However, if you have an older v2.xx model (or want to change the baud rate) and wish to have the newest firmware, you can get it <a href=\"http://makerjam.com/support/\" target=\"_blank\">here</a>.</p>\n\n\n<p>\n\n\n	Instructions on how to update your v2.xx firmware are in the <a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Widgets/MP3Trigger/MP3TriggerV2UserGuide_2010-07-30.pdf\" target=\"_blank\">datasheet</a>, but here&rsquo;s a quick review:</p>\n\n\n<ol>\n\n\n	<li>\n\n\n		Download and unzip one of the files above.</li>\n\n\n	<li>\n\n\n		Copy the resulting hex file to a microSD card and rename it to: &ldquo;MP3TRIGR.HEX&rdquo;. It does not need to be the only file on the card &ndash; it just&nbsp;needs to have that&nbsp;precise filename.</li>\n\n\n	<li>\n\n\n		Insert the microSD card into your MP3 Trigger V2 and turn the power on while holding down the center navigation switch.</li>\n\n\n	<li>\n\n\n		Wait for the Status LED to go solid, then cycle the power. You&rsquo;re now running the new firmware.</li>\n\n\n</ol>\n\n\n<p>\n\n\n	Please refer to the datasheet for a more detailed description of the Status LED indications when running the bootloader.</p>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Features:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Input voltage: 4.5-12VDC</li>\n\n\n	<li>\n\n\n		Current Consumption: 45mA idle, 85mA playing</li>\n\n\n	<li>\n\n\n		File system: FAT16</li>\n\n\n	<li>\n\n\n		Audio out: line level stereo (1/8&quot; stereo jack), see app note below if connecting to larger stereo jack</li>\n\n\n	<li>\n\n\n		Trigger inputs: 3.3-5V, active low inputs with internal pull-ups</li>\n\n\n	<li>\n\n\n		Serial: Full duplex, 8N1, 38.4K baud</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<span style=\"font-weight: bold;\">Documents:</span></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Widgets/MP3Trigger/MP3TriggerV2UserGuide_2010-07-30.pdf\" target=\"_blank\">Datasheet</a></li>\n\n\n	<li>\n\n\n		<a classname=\"\" href=\"http://www.sparkfun.com/datasheets/Widgets/MP3Trigger/mp3-trigger-v21i.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/Widgets/MP3Trigger/vs10XXan_output.pdf\">VLSI Application Note for protecting analog outputs</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://makerjam.com/support/\" target=\"_blank\">Firmware Files</a></li>\n\n\n</ul>','MP3 Trigger','','publish','open','open','','mp3-trigger','','','2013-04-08 08:51:29','2013-04-08 08:51:29','',0,'http://localhost/fz-parts/fzp/mp3-trigger/',0,'fz_fzp','',0);
