INSERT INTO `wp_posts` VALUES (4033,1,'2013-04-08 08:51:30','2013-04-08 08:51:30','<p>\n\n\n	<strong>Description:</strong> The Quadstepper motor driver board allows you to control up to 4 bipolar stepper motors simultaneously using logic level IO pins. Each motor driver has an output drive capacity of 35V and 2Amps. The board is capable of driving motors in full, half, quarter, eight, and sixteenth-step modes. The logic levels are selectable between 3.3V and 5V by way of a jumper. The bus header allows you to control all four motors with only 6 IO pins by controlling the enable (EN pins) for each motor, although each motor will be activated alone, not simultaneously. Be sure to close all of the &#39;Bus Enable&#39; jumpers on the back of the board in order to use the Bus header.</p>\n\n\n<p>\n\n\n	The Quadstepper is a great board for 3D printing applications as well as a host of other applications where it&#39;s necessary to control precise movement from logic level IO pins.</p>\n\n\n<p>\n\n\n	<strong>Note:</strong> Although this board can theoretically supply 2A per motor, you will run into heat issues if you do not have proper thermal management (ie - heatsinks). Without heatsinking, you can expect to drive each motor up to 1A, which would be fine for our <a href=\"http://www.sparkfun.com/products/9238\" target=\"_blank\">stepper motors</a>, or something similar.</p>\n\n\n<p>\n\n\n	<strong>Features:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		Can control up to 4 bipolar stepper motors simultaneously.</li>\n\n\n	<li>\n\n\n		Each motor driver has an output drive capacity of 35V and 2Amps.</li>\n\n\n	<li>\n\n\n		Capable of driving motors in full, half, quarter, eight, and sixteenth-step modes.</li>\n\n\n	<li>\n\n\n		Power input (barrel jack) needs to be less than 30V and supply enough current for your specific stepper motors.</li>\n\n\n	<li>\n\n\n		Jumper (labeled &quot;5V&quot;) controls power to the motor drivers, logic levels, and VOUT pin, selectable 3.3/5V.</li>\n\n\n	<li>\n\n\n		Bus header allows you to control all four motors with only 6 IO pins by controlling the enable (EN pins) for each motor</li>\n\n\n	<li>\n\n\n		2.1mm, center positive barrel jack</li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Widgets/quadstep-v11assembly.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Widgets/quadstep-v11assembly.zip\" target=\"_blank\">Eagle Files</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://dlnmh9ip6v2uc.cloudfront.net/datasheets/Widgets/A4983SETTR-T-Allegro-datasheet-123643.pdf\" target=\"_blank\">Datasheet</a> (A4983SETTR-T)</li>\n\n\n</ul>','QuadStepper','','publish','open','open','','quadstepper','','','2013-04-08 08:51:30','2013-04-08 08:51:30','',0,'http://localhost/fz-parts/fzp/quadstepper/',0,'fz_fzp','',0);
