INSERT INTO `wp_posts` VALUES (4044,1,'2013-04-08 08:51:30','2013-04-08 08:51:30','<p>\n\n\n	<strong>Description: </strong>The ScrewShield extends all pins of the Arduino out to 3.5mm pitch screw terminals. It also has a lot of the utility provided by <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=7914\" target=\"_self\">Arduino Protoshield</a>, including: a large prototyping space of both connected and unconnected 0.1&quot; spaced through-holes, a couple 5V and GND busses, a reset button, general use push button, and a 5mm yellow LED.</p>\n\n\n<p>\n\n\n	This product includes all the parts shown and comes in kit form and must be soldered together by the end user.</p>\n\n\n<p>\n\n\n	<strong>Kit Includes:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		1x ScrewShield PCB</li>\n\n\n	<li>\n\n\n		1x <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9594\" target=\"_self\">5mm Yellow LED</a></li>\n\n\n	<li>\n\n\n		1x <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8377\" target=\"_self\">330&Omega; Resistor</a></li>\n\n\n	<li>\n\n\n		2x <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9280\" target=\"_self\">6-pin Stackable Headers</a></li>\n\n\n	<li>\n\n\n		2x <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=9279\" target=\"_self\">8-pin Stackable Headers</a></li>\n\n\n	<li>\n\n\n		2x <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=97\" target=\"_self\">Momentary Push Buttons</a></li>\n\n\n	<li>\n\n\n		6x <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8084\" target=\"_self\">2-pin 3.5mm Screw Terminals</a></li>\n\n\n	<li>\n\n\n		8x <a href=\"http://www.sparkfun.com/commerce/product_info.php?products_id=8235\" target=\"_self\">3-pin 3.5mm Screw Terminals</a></li>\n\n\n</ul>\n\n\n<p>\n\n\n	<strong>Documents:</strong></p>\n\n\n<ul>\n\n\n	<li>\n\n\n		<a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/screwshield-v15.pdf\" target=\"_blank\">Schematic</a></li>\n\n\n	<li>\n\n\n		<a href=\"http://blog.makezine.com/archive/2011/04/blendophone-project-build-part-1.html\" target=\"_blank\">Maker Faire Project</a></li>\n\n\n</ul>','Arduino ProtoScrew Shield Kit','','publish','open','open','','arduino-protoscrew-shield-kit','','','2013-04-08 08:51:30','2013-04-08 08:51:30','',0,'http://localhost/fz-parts/fzp/arduino-protoscrew-shield-kit/',0,'fz_fzp','',0);
