INSERT INTO `wp_posts` VALUES (4051,1,'2013-04-08 08:51:30','2013-04-08 08:51:30','<p>\n\n	<strong>Description:</strong> This is a thermal printer like you would find on a cash register or adding machine. It will print simple strings passed to it via TTL serial, bitmap images (poorly) and it even generates several different formats of barcodes!</p>\n\n<p>\n\n	The thermal printer takes 2.25&quot; (57mm) wide thermal paper with a max roll diameter of 1.5&quot; (39mm). Thermal paper is inexpensive and commonly found in most office supply stores in 85ft lengths. You may have to remove some paper from these rolls in order for it to fit into the printer. But, you can always use the excess paper in the printer, since you don&#39;t need to have a &#39;core&#39; in the paper for it to work.</p>\n\n<p>\n\n	The back panel has 2 3-pin connectors; one for power and one for serial communications. The thermal printer ships with default 19200bps baud rate. If you&#39;re using this printer in conjunction with an Arduino, you&#39;re going to need to connect it to the &quot;Vin&quot; pin and attach an external power supply, as the printer will draw more current than USB is capable of delivering. We&#39;ve found that a 5V wall adapter works best (see related products below).</p>\n\n<p>\n\n	The print head has a rated life of 50km! That means this printer can handle a marathon&#39;s distance (~30 miles) of printing before the head hits its rated limit.</p>\n\n<p>\n\n	Use this printer in any project where you need a hard-copy of the output, or in an art project where you want to keep the output to stick on your fridge, or to build a DIY cash register for your lemonade stand!</p>\n\n<p>\n\n	<strong>Documents:</strong></p>\n\n<ul>\n\n	<li>\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/General/cashino%20thermal%20printer%20a2.pdf\" target=\"_blank\">Product Sheet</a></li>\n\n	<li>\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/General/A2-user%20manual-1.pdf\" target=\"_blank\">User Manual</a></li>\n\n	<li>\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/General/Driver%20board.pdf\" target=\"_blank\">Command Set</a></li>\n\n	<li>\n\n		<a href=\"http://www.sparkfun.com/datasheets/Components/General/ThermalPrinter_Example.zip\">Example Code</a></li>\n\n	<li>\n\n		<a href=\"http://tronixstuff.wordpress.com/2011/07/08/tutorial-arduino-and-a-thermal-printer//\" target=\"_blank\">Tronixstuff Tutorial</a></li>\n\n	<li>\n\n		<a href=\"http://bildr.org/2011/08/thermal-printer-arduino/\" target=\"_blank\">Bildr Tutorial</a></li>\n\n</ul>\n','Thermal Printer','','publish','open','open','','thermal-printer','','','2013-04-08 08:51:30','2013-04-08 08:51:30','',0,'http://localhost/fz-parts/fzp/thermal-printer/',0,'fz_fzp','',0);
