INSERT INTO `wp_posts` VALUES (4068,1,'2013-04-08 08:51:31','2013-04-08 08:51:31','<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0//EN\" \"http://www.w3.org/TR/REC-html40/strict.dtd\">\n<html><head><meta name=\"qrichtext\" content=\"1\" /><style type=\"text/css\">\np, li { white-space: pre-wrap; }\n</style></head><body style=\" font-family:\'Lucida Grande\'; font-size:13pt; font-weight:400; font-style:normal;\">\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">The TSOP312.., TSOP314.. series are miniaturized receivers for infrared remote control systems. A PIN diode and a preamplifier are assembled on a lead frame, the epoxy package acts as an IR filter.</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">The demodulated output signal can be directly decoded by a microprocessor. The TSOP312.. is compatible with all common IR remote control data formats. The TSOP314.. is optimized to suppress almost all spurious pulses from</p>\n<p style=\" margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\">energy saving fluorescent lamps but will also suppress some data signals. </p></body></html>','TSOP312.., 314..','','publish','open','open','','tsop312-314','','','2013-04-08 08:51:31','2013-04-08 08:51:31','',0,'http://localhost/fz-parts/fzp/tsop312-314/',0,'fz_fzp','',0);
