n be connected to either the UART pins or any digital pin on the Arduino (D2 and D3 default)</li>\n	<li>3.3V power regulation and level shifting on-board</li>\n	<li>12x11 grid of 0.1\" spaced prototyping holes</li>\n	<li>Reset button brought out</li>\n	<li>Power, DIN, DOUT, RSSI and DIO5 indicator LEDs</li>\n</ul>\n<span style=\"font-weight: bold;\">Documents:</span>\n<ul>\n	<li><a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/xbeeshield-v13.pdf\" target=\"_blank\">Schematic</a></li>\n	<li><a href=\"http://www.sparkfun.com/datasheets/DevTools/Arduino/xbeeshield-v13.zip\" target=\"_blank\">Eagle Files</a></li>\n</ul>\n<strong>Replaces:</strong> <a href=\"http://www.sparkfun.com/products/9841\">WRL-09841</a>','Arduino XBee Shield','','inherit','open','open','','4076-autosave','','','2013-04-09 09:44:19','2013-04-09 09:44:19','',4076,'http://localhost/fz-parts/4076-autosave/',0,'revision','',0);
